(21, 0, '&nbsp; &nbsp; 工合财富p2p系统正在建设中，预计在2015年3月底正式上线，敬请关注！', '', 0),
(26, 0, '<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	2015年第一个工作日，李克强视察了我国首家民营银行——前海微众银行，并鼓励微众银行：“不仅自己要杀出一条血路来，还要倒逼传统金融企业改革。”\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	通过网络大量的现场图片，我们可以看到微众的几个关键词：“科技、普惠、连接”，这三个关键词恰好是互联网金融的核心：利用技术手段的革新，基于互联网推行人人参与的普惠金融。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	新年首访，总理选择了中国第一家互联网银行，显然是释放一种信号，要鼓励民营银行，鼓励互联网金融的发展。那么，对于互联网金融的重要组成部分，网贷企业，将带来什么样的影响呢?\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	首先，对于网贷行业来说，这是一个很明显政策利好。李克强总理先后在不同的场所多次表达出了对互联网金融的支持，希望通过互联网金融真正的推行普惠金融。而在普惠金融的道路上，P2P网贷扮演着不可或缺的角色。P2P网贷的出现，对于资金需求方来说，降低了他们的融资门槛;而对于投资理财端的客户来说，则降低了投资门槛，人人可参与，可以说是普惠金融在现实中的运用和实现。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	民营银行的出现，对于网贷企业来说，其实是机遇与挑战并存。政策利好也有可能导致行业竞争的加剧。从李克强总理选择在新年第一个工作日视察微众银行可以看出，政府在未来一年的金融工作重心，一定是放在推行互联网金融的领域。但是，作为P2P网贷来说，微众银行这类型的互联网银行的发展，在未来肯定会给网贷行业带来一定的冲击。基于目前的经济发展形势来看，2015年整体的闲散资金规模有可能会收缩，而在市场总量收缩的同时，微众银行等民营银行的成立，给大家提供了更多的投资理财渠道，一定会吸纳到一部分的社会闲散资金，这在一定程度上，会减少网贷行业的资金来源。另一方面，在政策利好的情况下，市场上定会出现更多竞争者，因而造成行业竞争在一定程度上加剧。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	互联网与金融结合所产生的高效、便捷给了更多有融资需求的企业和个人便利。随着民营银行开始入场，必将带来的是企业的融资成本降低，而高利差盈利的时代会慢慢过去。因而，对于网贷企业来说，一方面需要给投资人提供较高收益，一边还要在出借端面临民营银行的竞争，提供更低利率的贷款，这样就导致了网贷企业利润空间的进一步压缩。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	另一方面，未来民营银行的巨大发展空间，在普及互联网金融，市场教育方面，承担着更大的责任，对互联网金融行业的发展，对整个市场份额的扩大是很有帮助的。越来越多的投资人接受互联网金融，进入互联网金融，给网贷企业带来了机会。同时，我们也可以看到其中潜藏的巨大合作机会。微众银行虽然起点比较高，但是由于其业务覆盖能力还是很有限，未来必将选择和其他机构合作以加快业务拓展速度。那么，这就给了很多具有本土化优势的平台机会。我们可以看到不管是在东部地区还是中西部地区，都有很多极具本土化的金融机构。这些地方性的金融机构都在不断的想办法突破原有的业务范围，建立自己的核心业务和风控的优势，找到自己在市场中的位置。\r\n</p>', '', 0),
(25, 0, '<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	<strong>网贷之家讯</strong><span style="line-height:1.5;">&nbsp;近日，国内知名P2P网贷行业门户网“网贷之家”对外公布了《2014年12月网贷平台发展指数评级》。评级报告显示，陆金所、人人贷、宜人贷、有利网、招财宝、积木盒子、投哪网、微贷网、拍拍贷、你我贷，发展指数排名前十。</span>\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	2014年12月，受股市好转与年底投资谨慎的影响，中汇在线、银通贷、涌金贷、金豪利、快速贷等多家平台提现困难，P2P平台滞后的风险集中爆发。上述评级报告指出，虽然这个行业正在进步，也得到越来越多的认可，但不可否认，行业风险暂未消逝，且目前多数平台的抗风险能力还很差。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	<strong>12月P2P行业概况与2015年1月市场研判</strong>\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	网贷之家首席研究员马骏指出，目前行业地域风险仍较大。温州和山东问题平台频发，他建议投资人留意山东和温州平台的地域性风险。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	此外，上线时间久而资金实力有限的平台，抗风险性较差。12月多家上线1年多的平台提现困难，平台滞后风险爆发。他建议投资人，多警惕上线时间较久，盘子较大，但平台风控和资金实力较弱的平台。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	同时，利率越高抗风险性越差。利差和费用是平台盈利的两个来源，利差越小，平台盈利越薄弱，平台长久发展性较差。他建议投资人多关注平均利率上下的平台。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	马骏指出，若平台存在展期，投资人需留意因展期引发的平台流动性风险。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	他进一步表示，投资人在选择平台时应选择能够看得懂的平台。投资人需要掌握基础贷款风控常识;在投资前需了解平台业务来源、平台背景实力、平台业务规范程度和风控程度、平台垫付资金是否充足可靠、是否曾遭受过投资人质疑等。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	“未来一年，平台注重合法合规、透明、风险管理建设，马骏建议，投资人选择逾期数据和准备金垫付透明的平台，最好选择投资人账户和风险准备金托管，选择具备充足风险管理经验团队的平台。”\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;text-align:center;">\r\n	<img src="http://news.wangdaizhijia.com/wdzj/attached/image/2015/01/06/20150106080837_747s_.jpg" alt="" width="600" height="411" title="" align="" /><img src="http://news.wangdaizhijia.com/wdzj/attached/image/2015/01/06/20150106080838_287s_.jpg" alt="" width="600" height="328" title="" align="" /><img src="http://news.wangdaizhijia.com/wdzj/attached/image/2015/01/06/20150106080838_903s_.jpg" alt="" width="600" height="329" title="" align="" /><img src="http://news.wangdaizhijia.com/wdzj/attached/image/2015/01/06/20150106080838_703s_.jpg" alt="" width="600" height="329" title="" align="" /><img src="http://news.wangdaizhijia.com/wdzj/attached/image/2015/01/06/20150106080839_48s_.jpg" alt="" width="600" height="345" title="" align="" />\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	<strong>代表性P2P网贷平台点评：</strong>\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	<strong>开鑫贷</strong>\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	开鑫贷已经不单纯是一个平台，而成为一种模式了。这种“开鑫贷+小贷公司+结算银行”的模式，也得到了监管层的认可。但这种模式，开鑫贷能做，别人家不一定能做，所以造就了目前开鑫贷的独一无二。虽为体制内的企业，也未大肆宣传过，但开鑫贷的人气和成交量一直不低，其在互联网产品设计和体验上也一直在追求改变，真可谓国企中的战斗机。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	<strong>和信贷</strong>\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	成立一年多以来，和信贷已然成为北京中息平台中的领头羊。火爆的人气和诸多粉丝大户，让和信贷一直是一标难抢，以前每到发标时间，网站就会出现卡顿。12月以来，受年底资金回流、平台大片倒闭和股市走牛的影响，和信贷的满标速度也受到了明显的影响。同时，平台的收益率也降到了一个对原有投资人吸引力渐失的区间。但平台总体运营良好，待收金额控制在一个稳定的区间。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	<strong>银客网</strong>\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	银客网12月排名下降，主要由于杠杆积分下降所致。12月以来，银客网的贷款余额增长近1倍，几乎每日资金净流入为正值，平台扩张之心显而易见。虽然当资金净流入多日为负值时投资人需警惕平台的流动性风险，但当平台多日资金净流入为正时，投资人也值需关注平台是否同比增加垫付资金来支撑迅速增长的贷款余额，如银客网增加500万风险准备金，但相对1.7亿的贷款余额增量，杠杆积分仍下降。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;text-align:center;">\r\n	<img src="http://news.wangdaizhijia.com/wdzj/attached/image/2015/01/05/20150105210238_68s_.jpg" alt="" />\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	<strong>小牛在线</strong>\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	同与达拉斯小牛队达成战略合作的劲爆消息一样，小牛在线12月借款人数增势也异常火热。对比平台历史投资人和借款人数分级数据，小牛在线12月新增许多小额借款人，加上部分债权转让标，分散度增强，同时投资人数也有可观的增长，故排名提升。即使小额借款人增多，但是平台也不乏千万级别的大额借款人，投资人需留意大额借款人到期还款情况(详见下图)。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;text-align:center;">\r\n	<img src="http://news.wangdaizhijia.com/wdzj/attached/image/2015/01/05/20150105210317_597s_.jpg" alt="" />\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;text-align:center;">\r\n	<img src="http://news.wangdaizhijia.com/wdzj/attached/image/2015/01/05/20150105210355_962s_.jpg" alt="" />\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	<strong>恒信易贷</strong>\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	恒信易贷12月排名下降主要是由于成交表现不敌行业所致。恒信易贷主营广州、佛山等地的车贷业务,有线下公司,本地业务主要在借款车辆上安装GPS定位监测系统，借款车辆超过行驶范围就会预警。外省牌照车辆办理抵押登记、过户手续。平台有续借展期的情况，当业务扩增时，这种续借展期的平台易存仔流动性风险。此外，平台根据借款人资质不同车贷贷款成数也不同，部分高达90%、100%。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	<strong>备注：</strong>\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	<strong>从九大维度看网贷平台发展指数</strong>\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	网贷平台发展指数，是对9大维度(包括网贷行业成交量、营收、人气、收益、杠杆、流动性、分散度、透明度、品牌)和60个细分指标，用层次分析法给予不同的权重，加权平均得出。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	需要说明的是，发展指数最高的，并不代表该平台最安全、最值得投资，发展指数表征的是平台的综合影响力、综合实力，以及发展潜力。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	此外，发展指数积分，是每月平台间的相对评分，同一平台月度间的分数高低，暂不具备明显可比性，也不存在60分为及格分数线的说法。\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	上述评级报告是根据纳入网贷之家观察库的千余家P2P网贷平台的成交数据编制而成，评级旨在为投资人和P2P平台人员提供一个更好的了解网贷平台的参考指标。（网贷之家 文/陈妙美）\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	【延伸阅读】\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	<a href="http://news.wangdaizhijia.com/20141209/15717.html" target="_blank">11月国内P2P网贷平台评级发布</a>\r\n</p>\r\n<p style="font-size:14px;font-family:宋体;text-indent:2em;background-color:#FFFFFF;">\r\n	近日，国内知名P2P网贷行业门户网“网贷之家”对外公布了《2014年11月网贷平台综合评级报告》。评级报告显示，发展指数排名方面，人人贷、招财宝、有利网、陆金所、拍拍贷、红岭创投、积木盒子、宜人贷、投哪网、微贷网，排名前十。<a href="http://news.wangdaizhijia.com/20141209/15717.html" target="_blank">&nbsp;&gt;&gt;&gt;点击查看</a>\r\n</p>', '', 0),
(24, 0, '<ul style="font-family:Simsun, 微软雅黑, arial;color:#505050;background-color:#FFFFFF;">\r\n	<li class="news_con_p">\r\n		<p style="font-size:14px;font-family:宋体;color:#000000;text-indent:2em;">\r\n			全年累计成交量超过2500亿，是2013年的2.39倍;与此同时，全年共出现问题平台275家，是2013年的3.6倍……2014年，中国P2P金融可谓经历“冰火两重天”。\r\n		</p>\r\n		<p style="font-size:14px;font-family:宋体;color:#000000;text-indent:2em;">\r\n			中国网贷行业正呈现平台“百花齐放”的态势。网贷之家数据显示，截至2014年年底，中国网贷运营平台达1575家，全年新上线的<a href="http://www.touzhijia.com/platform" target="_blank">网贷平台</a>超900家(含问题平台)，这些平台平均注册资金约为2784万元，相对于2013年的1357万元，增长了1倍。\r\n		</p>\r\n		<p style="font-size:14px;font-family:宋体;color:#000000;text-indent:2em;">\r\n			P2P(个人与个人之间的小额借贷交易)人气也日渐火爆，数据显示，2014年网贷行业投资人数与借款人数分别达116万人和63万人，较2013年分别增加364%和320%。“当前，P2P网贷行业呈现高速稳定增长，多项网贷行业指标数据显示，网贷已告别萌芽期，进入成长期。”网贷之家首席研究员马骏说。\r\n		</p>\r\n		<p style="font-size:14px;font-family:宋体;color:#000000;text-indent:2em;">\r\n			然而，一半是海水，一半是火焰。在P2P金融日益“人气爆棚”的同时，诈骗、跑路、提现困难等问题频频出现，日渐成为P2P行业的“新常态”。统计数据显示，2014年全年问题平台达275家，是2013年的3.6倍，仅2014年12月就出现问题平台92家，超过2013年全年问题平台的总和。\r\n		</p>\r\n		<p style="font-size:14px;font-family:宋体;color:#000000;text-indent:2em;">\r\n			“2014年底，受经济和金融大环境影响，借款人逾期、展期现象频繁，加之一系列平台倒闭和股市走牛影响，投资人纷纷撤出资金，网贷行业面临高兑付压力，许多平台被曝光出现提现困难。”马骏认为。\r\n		</p>\r\n		<p style="font-size:14px;font-family:宋体;color:#000000;text-indent:2em;">\r\n			观察人士认为，“跑路”等行业乱象与中国至今仍未出台P2P相关监管细则有关。从2014年初到年末，业界对P2P监管问题进行了广泛的讨论，但直至今日，关于P2P监管的细则仍未推出。\r\n		</p>\r\n		<p style="font-size:14px;font-family:宋体;color:#000000;text-indent:2em;">\r\n			目前，已经明确的信息是P2P监管将由银监会主导，银监会相关人士也已提出P2P十大“监管红线”：即明确平台的中介性质;明确平台本身不得提供担保;不得搞资金池;不得非法吸收公众存款;落实实名制;设立行业门槛;资金由第三方托管;不承诺本息、不自保自融;开展外部审计;坚持小额化、支持个人和小微企业等。\r\n		</p>\r\n		<p style="font-size:14px;font-family:宋体;color:#000000;text-indent:2em;">\r\n			实际上，原则性的“监管红线”，正体现了当前不断推进的“负面清单”式包容性监管理念。“互联网金融创新太快，过早地监管很容易扼杀创新，所以监管比较审慎。”中国人民大学法学院副院长杨东说。\r\n		</p>\r\n		<p style="font-size:14px;font-family:宋体;color:#000000;text-indent:2em;">\r\n			中央财经大学金融法研究所所长黄震等学者认为，当前P2P网贷的行业周期性特点和系统性风险状况仍未完全暴露，同时也没有为学界和监管者完全掌握，相关监管细则的出台可能还需要一段时间的“观察期”。\r\n		</p>\r\n		<p style="font-size:14px;font-family:宋体;color:#000000;text-indent:2em;">\r\n			尽管监管政策仍处“空中楼阁”、行业“乱象”不断，但资本市场对P2P金融仍“宠爱有加”。据统计，2014年全年至少有38家线上P2P平台完成融资，涉及资金在40亿元以上。\r\n		</p>\r\n		<p style="font-size:14px;font-family:宋体;color:#000000;text-indent:2em;">\r\n			业内人士预计，大量资本的进入将使P2P行业竞争更加激烈，甚至会使大部分平台退出P2P舞台。“风投的进入，只是一部分，主要还要看行业的发展以及企业自身的功力。”<a href="http://www.touzhijia.com/" target="_blank">投之家</a>CEO黄诗樵说。\r\n		</p>\r\n	</li>\r\n</ul>', '', 0),
(23, 0, '<h2 style="font-weight:normal;font-size:22px;font-family:微软雅黑;color:#333333;">\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　据网贷之家发布的《中国P2P网贷行业2014年度运营简报》显示，截至2014年年末，我国网贷运营平台达1575家，接近2013年的两倍;全年累计成交量达2528亿元，是2013年的2.39倍;行业总体贷款余额1036亿元，是2013年的3.87倍。网贷行业在这一年可谓是高歌猛进，发展蓬勃。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n		<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021654477.jpg" style="width:550px;height:281px;" />\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　然而，在P2P网贷一路狂飙的同时，“跑路”事件的频频发生也让行业饱受垢病。根据《简报》，2014年全国问题平台高达275家，是2013年的3.62倍。仅12月份就出现问题平台92家，超过了2013年全年的问题平台数量。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　本文根据网贷之家公布的数据，从发生问题时间、运营时间、所在地区、注册资本、问题表现等几个维度对问题平台进行一番剖析，以使投资者能更全面地审视这些问题平台。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		<strong>　　一、从发生问题时间分布上看</strong>\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　根据网贷之家公布的行业数据，2014年共有问题平台275家。从图表中可以看出，平台爆发问题的时间集中在10~12月，尤其是12月份问题平台达92家，占了全部问题平台数量的三分之一。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n		<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021720258.jpg" style="width:550px;height:289px;" />\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　原因分析：问题平台集中在年底爆发的原因，主要有两点。一是，年底时银行信贷政策收紧，投资者的投资态度也更加谨慎，而中小企业及个人的资金需求则持续旺盛，严重的资金供求不平衡下，平台面临兑付考验，尤其是那些对贷款项目进行了拆标和期限错配的平台最容易出状况;二是，11月份以来股市持续走高备受瞩目，部分投资者转移战线，分流了P2P平台资金，也加大了P2P平台的兑付风险。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		<strong>　　二、从运营时间分布看</strong>\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　根据网贷之家公布的问题平台数据，275家问题平台中有注明上线时间和问题时间的243家;而2013年问题平台共76家，有注明上线时间和问题时间的69家。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　从问题平台运营时间分布图中，可以看到问题平台的运营时间集中在0~6个月之间;\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n		<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021756487.jpg" style="width:550px;height:243px;" />\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　而在2014年问题平台运营时间饼状图中，可以看到0~3个月的问题平台数量共109家，占比44.85%;0~6个月的问题平台数量共152家，占比62.55%。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n		<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021817433.jpg" style="width:550px;height:366px;" />\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　结合两个图表，得出结论：问题平台的爆发期主要在0~6个月，其中前3个月尤为关键。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　原因分析：P2P平台在前3个月最容易出事，其原因可以归结为：1、创始人对P2P行业的风险认识不足，在高利润前景吸引下贸然进入，平台的信审机制、风控机制等不够完善，无法适应激烈的市场竞争，导致问题的发生;2、一些平台本身就是以欺诈为目的的，没有长远经营地打算，一开始就以高息等形式吸引投资者，稍有问题就卷钱跑路。根据整理，在94家有注明上线时间和问题时间的“欺诈”和“跑路”类型问题平台中，运营仅0~3个月的平台高达到76家，占了全部问题平台的27.64%。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n		<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021850104.jpg" style="width:550px;height:339px;" />\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		<strong>　　三、从问题平台所在地区分布看</strong>\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　根据整理，2014年问题平台所在地区的前五名为：广东、浙江、山东、上海、北京;然而，这五个地区也是网贷平台运营数量最多的前五名，因此不能简单地推断说这几个地区的平台比较容易出现问题。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n		<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021916551.jpg" style="width:550px;height:298px;" />\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　然而，对运营平台大于10家的地区，比较问题平台占该地区的总运营平台数量比例，从图中可以看出，湖南、湖北、广西、山东这几个地区的风险系数较高。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n		<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108022010585.jpg" style="width:550px;height:261px;" />\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　原因分析：注意到，“两湖一广”都是内陆地区， 只有山东是沿海省份。这些地区的风险系数较高，一般可以归结为当地的金融体系建设有所不足，平台的外部约束较为稀缺。反观广东、浙江和北京，尽管问题平台数量排名前三，但占所在地区的总平台数量比例则较低，这一定程度上可以归功于地区的金融市场比较健全，或者组织了行业自律协会，或者当地政府部门出台了指导意见规范。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		<strong>　　四、从问题平台注册资本看</strong>\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　在275家问题平台中，有注明注册资本的共225家。从图表可以看出，注册资本在1000~1999万元的问题平台数量最多，其中注册资本为1000万元的达86家，注册资本在1000万元以下(含1000万元)的达139家，占了总样本的61.78%。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　因此，尽管注册资本并不一定就是P2P平台的实缴资本，但也一定程度上反映了平台的实力。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n		<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108022055502.jpg" style="width:550px;height:287px;" />\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　原因分析：与小贷公司的业务规模大多被限定在自有资金的1.5倍相比，P2P平台的一个极大优势就是可以将资金杠杆放到无限大。然而，当前P2P平台无法做到纯粹的信息中介角色，高杠杆比例下就难以避免高风险。笔者在之前的一篇文章《从注册资金看行业门槛》中提到，英国P2P监管就是采用静态指标和动态指标相结合的办法确定P2P公司的最低资本金，随着平台业务规模的增大，其最低资本金也要相应地提高，否则在高资金杠杆比例下，一有风吹草动，平台就很容易被压垮。因此，相比于高注册资本的平台，低注册资本的更容易出问题。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		<strong>　　五、从问题平台表现类型看</strong>\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　在275家问题平台中，有注明问题原因的共272家。经过对问题原因的重新归类和整理后，从图表中可以看出问题平台的主要表现为：提现困难、跑路和欺诈，其中提现困难为最主要的原因，占了总样本的41.18%。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n		<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108022122818.jpg" style="width:550px;height:291px;" />\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　原因分析：P2P平台作为信息中介，按理说是不应当出现“提现困难”的，之所以出现，原因可以归结于两点：1、客户资金没有进行第三方托管，使得P2P平台能够以极低的成本擅自挪用;2、贷款人希望贷款期限尽可能长，而投资者则希望投资期限尽可能短，平台为了迎合双方需求，对贷款项目进行拆标和资金错配，一旦有较大额资金提款时，就极容易导致“提现困难”的发生。至于“跑路”和“欺诈”，则要归咎于行业缺乏监管，使得一些人试图浑水摸鱼。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　结语：P2P网贷本是舶来品，进入我国后与小额贷款和民间借贷相融合，民间借贷借助P2P网贷实现了阳光化。然而，民间借贷本质上具有高收益高风险的属性，在P2P行业处于“无准入门槛、无行业标准、无外部监管”的“三无”状况下，问题平台的发生无可避免。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　一方面，投资者应当积极去了解行业相关知识，增强对平台的辨别能力，避免“踩雷”;另一方面，P2P平台也应当清醒地认识到，只有通过不断加强自身各项机制建设并创新业务才能在激烈的市场竞争中长久生存，才能通过细水长流的方式赚取更大的利润，试图通过欺诈的方式一夜暴富，最终只会招致灭顶之灾。当然，当前最迫切也是最关键的，就是需要政府部门早日出台监管政策，对行业进行规范，推动P2P网贷的持续健康发展。\r\n	</p>\r\n	<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n		　　(文章系作者授权发布原创作品，仅代表作者个人观点，不代表网贷之家官方立场，转载请注明出处)\r\n	</p>\r\n<br />\r\n</h2>', '', 0),
(22, 0, '<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　据网贷之家发布的《中国P2P网贷行业2014年度运营简报》显示，截至2014年年末，我国网贷运营平台达1575家，接近2013年的两倍;全年累计成交量达2528亿元，是2013年的2.39倍;行业总体贷款余额1036亿元，是2013年的3.87倍。网贷行业在这一年可谓是高歌猛进，发展蓬勃。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n	<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021654477.jpg" style="width:550px;height:281px;" />\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　然而，在P2P网贷一路狂飙的同时，“跑路”事件的频频发生也让行业饱受垢病。根据《简报》，2014年全国问题平台高达275家，是2013年的3.62倍。仅12月份就出现问题平台92家，超过了2013年全年的问题平台数量。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　本文根据网贷之家公布的数据，从发生问题时间、运营时间、所在地区、注册资本、问题表现等几个维度对问题平台进行一番剖析，以使投资者能更全面地审视这些问题平台。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	<strong>　　一、从发生问题时间分布上看</strong>\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　根据网贷之家公布的行业数据，2014年共有问题平台275家。从图表中可以看出，平台爆发问题的时间集中在10~12月，尤其是12月份问题平台达92家，占了全部问题平台数量的三分之一。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n	<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021720258.jpg" style="width:550px;height:289px;" />\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　原因分析：问题平台集中在年底爆发的原因，主要有两点。一是，年底时银行信贷政策收紧，投资者的投资态度也更加谨慎，而中小企业及个人的资金需求则持续旺盛，严重的资金供求不平衡下，平台面临兑付考验，尤其是那些对贷款项目进行了拆标和期限错配的平台最容易出状况;二是，11月份以来股市持续走高备受瞩目，部分投资者转移战线，分流了P2P平台资金，也加大了P2P平台的兑付风险。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	<strong>　　二、从运营时间分布看</strong>\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　根据网贷之家公布的问题平台数据，275家问题平台中有注明上线时间和问题时间的243家;而2013年问题平台共76家，有注明上线时间和问题时间的69家。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　从问题平台运营时间分布图中，可以看到问题平台的运营时间集中在0~6个月之间;\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n	<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021756487.jpg" style="width:550px;height:243px;" />\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　而在2014年问题平台运营时间饼状图中，可以看到0~3个月的问题平台数量共109家，占比44.85%;0~6个月的问题平台数量共152家，占比62.55%。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n	<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021817433.jpg" style="width:550px;height:366px;" />\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　结合两个图表，得出结论：问题平台的爆发期主要在0~6个月，其中前3个月尤为关键。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　原因分析：P2P平台在前3个月最容易出事，其原因可以归结为：1、创始人对P2P行业的风险认识不足，在高利润前景吸引下贸然进入，平台的信审机制、风控机制等不够完善，无法适应激烈的市场竞争，导致问题的发生;2、一些平台本身就是以欺诈为目的的，没有长远经营地打算，一开始就以高息等形式吸引投资者，稍有问题就卷钱跑路。根据整理，在94家有注明上线时间和问题时间的“欺诈”和“跑路”类型问题平台中，运营仅0~3个月的平台高达到76家，占了全部问题平台的27.64%。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n	<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021850104.jpg" style="width:550px;height:339px;" />\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	<strong>　　三、从问题平台所在地区分布看</strong>\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　根据整理，2014年问题平台所在地区的前五名为：广东、浙江、山东、上海、北京;然而，这五个地区也是网贷平台运营数量最多的前五名，因此不能简单地推断说这几个地区的平台比较容易出现问题。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n	<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108021916551.jpg" style="width:550px;height:298px;" />\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　然而，对运营平台大于10家的地区，比较问题平台占该地区的总运营平台数量比例，从图中可以看出，湖南、湖北、广西、山东这几个地区的风险系数较高。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n	<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108022010585.jpg" style="width:550px;height:261px;" />\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　原因分析：注意到，“两湖一广”都是内陆地区， 只有山东是沿海省份。这些地区的风险系数较高，一般可以归结为当地的金融体系建设有所不足，平台的外部约束较为稀缺。反观广东、浙江和北京，尽管问题平台数量排名前三，但占所在地区的总平台数量比例则较低，这一定程度上可以归功于地区的金融市场比较健全，或者组织了行业自律协会，或者当地政府部门出台了指导意见规范。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	<strong>　　四、从问题平台注册资本看</strong>\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　在275家问题平台中，有注明注册资本的共225家。从图表可以看出，注册资本在1000~1999万元的问题平台数量最多，其中注册资本为1000万元的达86家，注册资本在1000万元以下(含1000万元)的达139家，占了总样本的61.78%。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　因此，尽管注册资本并不一定就是P2P平台的实缴资本，但也一定程度上反映了平台的实力。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n	<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108022055502.jpg" style="width:550px;height:287px;" />\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　原因分析：与小贷公司的业务规模大多被限定在自有资金的1.5倍相比，P2P平台的一个极大优势就是可以将资金杠杆放到无限大。然而，当前P2P平台无法做到纯粹的信息中介角色，高杠杆比例下就难以避免高风险。笔者在之前的一篇文章《从注册资金看行业门槛》中提到，英国P2P监管就是采用静态指标和动态指标相结合的办法确定P2P公司的最低资本金，随着平台业务规模的增大，其最低资本金也要相应地提高，否则在高资金杠杆比例下，一有风吹草动，平台就很容易被压垮。因此，相比于高注册资本的平台，低注册资本的更容易出问题。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	<strong>　　五、从问题平台表现类型看</strong>\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　在275家问题平台中，有注明问题原因的共272家。经过对问题原因的重新归类和整理后，从图表中可以看出问题平台的主要表现为：提现困难、跑路和欺诈，其中提现困难为最主要的原因，占了总样本的41.18%。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;text-align:center;">\r\n	<img alt="\\" src="http://news.wangdaizhijia.com/zhuanlan/uploadfile/2015/0108/20150108022122818.jpg" style="width:550px;height:291px;" />\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　原因分析：P2P平台作为信息中介，按理说是不应当出现“提现困难”的，之所以出现，原因可以归结于两点：1、客户资金没有进行第三方托管，使得P2P平台能够以极低的成本擅自挪用;2、贷款人希望贷款期限尽可能长，而投资者则希望投资期限尽可能短，平台为了迎合双方需求，对贷款项目进行拆标和资金错配，一旦有较大额资金提款时，就极容易导致“提现困难”的发生。至于“跑路”和“欺诈”，则要归咎于行业缺乏监管，使得一些人试图浑水摸鱼。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　结语：P2P网贷本是舶来品，进入我国后与小额贷款和民间借贷相融合，民间借贷借助P2P网贷实现了阳光化。然而，民间借贷本质上具有高收益高风险的属性，在P2P行业处于“无准入门槛、无行业标准、无外部监管”的“三无”状况下，问题平台的发生无可避免。\r\n</p>\r\n<p style="color:#333333;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	　　一方面，投资者应当积极去了解行业相关知识，增强对平台的辨别能力，避免“踩雷”;另一方面，P2P平台也应当清醒地认识到，只有通过不断加强自身各项机制建设并创新业务才能在激烈的市场竞争中长久生存，才能通过细水长流的方式赚取更大的利润，试图通过欺诈的方式一夜暴富，最终只会招致灭顶之灾。当然，当前最迫切也是最关键的，就是需要政府部门早日出台监管政策，对行业进行规范，推动P2P网贷的持续健康发展。\r\n</p>', '', 0);
INSERT INTO `gica_document_article` (`id`, `parse`, `content`, `template`, `bookmark`) VALUES
(27, 0, '网贷之家讯 大公数据发布网贷平台黑名单和预警名单所引发的“连锁反应”仍在发酵，P2P行业从业者、专家学者以及各大媒体，颇为一致地对这份名单给予了“差评”。北、上、广三地的互联网金融协会也纷纷对此发表了声明，其中，广东互联网金融协会的声明措辞最为强硬。\r\n中国政法大学金融创新与互联网金融法制研究中心主任李爱君表示，大公数据“此行有扰乱市场秩序之嫌疑”。而大公评级董事长关建中则对媒体称，大公要担当评级公司的社会责任，来净化互联网环境，针对不规范平台不断进行信用扩张的行为，大公有权利有资格通过信用评级，阻止他们为所欲为。\r\n“黑名单”引发的声讨\r\n1月21日，大公信用数据有限公司(简称：大公数据)在北京召开发布会，公布了266个网贷平台黑名单和676个预警名单。一直被网贷行业奉为既有背景又有规模的“老大”陆金所被列入“预警名单”，同时，上海的拍拍贷“被搬家”到陕西，而早在去年11月就提现困难的重庆P2P平台渝商创投，被列入预警平台名单并被归到了四川;中汇在线、文妥财富、MY标客等多家问题平台，也被列入“预警观察名单”;在广西地区的黑名单中，出现了两个“兴利贷”平台……该份名单一经发布，就遭到了整个网贷行业的声讨。\r\n“看到这个名单，本来不想说什么，但实在是憋不住。我们拍拍贷怎么一下子被搬家到了陕西?见过不负责任的，还没见过这么差劲的评级。”拍拍贷执行副总裁周浩对此表示无法理解。“这家机构恐怕是借机炒作，可是这水平，也太低级了吧。”\r\n他表示，对于P2P，官方多次传递出积极信号，而就在前一天，银监会设立了普惠金融部监管P2P行业，现在突然冒出这一哗众取宠的名单，实在是太不和谐了。\r\n“鼓掌的都是工作人员，提问的都是安排好的，名单都是不知道怎么评的……今天也成了互联网金融记者和P2P平台pr(公关)的一场聚会，本来这些pr因上榜而紧张，但发现陆金所这种大平台也在其列时，便觉得哭笑不得，”有记者写道。\r\n一石激起千层浪。一时间，P2P行业的人都在热议这一事件。“上榜的平台说，我们和陆金所一样安全;没上榜的平台说，我们比陆金所要安全”，还有平台戏称“没有上榜，是因为不够知名，还得继续努力”。\r\n某业内人士则直言，“我说2句，就2句：1，能和陆金所齐名，我们表示很荣幸;2，你们应该不允许我说脏话吧?那就没什么可说的了。”\r\n他进一步指出，大公评级这一事件对很多投资者还是有影响的，在年底这个敏感的时间节点，哪怕是一个普通人出来报个黑名单都不得了，别说一家机构了，本来不出事的平台都要出事了。“这就像踩踏，本来就人满为患，拥挤不堪，人心惶惶，突然有人说地上有600多个地雷，人群肯定疯狂逃窜，出现踩踏，后果不堪设想。”他认为，这份名单本身更像谣言，媒体应慎重报道。\r\n北、上、广三地协会纷纷发表声明 广东互联网金融协会措辞最强硬\r\n上述黑名单一发布，当日，广东互联网金融协会、北京市网贷行业协会随即发表了关于“大公数据网金黑名单及预警名单”的声明;次日(1月22日)，上海网贷联盟(上海网络信贷行业企业联盟)也发布了关于“大公”网贷评级的声明。\r\n北京市网贷行业协会的声明，直指大公国际评级行为易成套利工具，“必须指出的是，黑名单或预警名单具有负向激励作用，易于成为套利工具。尤其是在监管措施尚未出台的情况下，负面评价缺乏第三方监督与监管，客观性、公正性难以保证，或对合规、合法经营的平台造成严重伤害。”\r\n上海网贷联盟在声明中表示，近一段时间以来，一些网站、社会服务机构频频对网贷行业作出评价，发布警示信息(包括大公网贷评级)。声明称，除去极个别机构“监管套利”谋取私利的行为外，许多机构的评测还是从支持、鼓励行业发展的愿望出发，虽然在推出网贷行业的商业化评价中有些信息失真、有的判断缺失公允，评级方式、评价指标与评级模型缺少与网贷企业的沟通，专业性不足，这些都需要在今后的工作中加以改进。\r\n而广东互联网金融协会的声明，措辞则颇为强硬。其声明指出，大公国际作为我国具有一定公信力的评级机构，在行业准入机制未定且监管尚未明确的情况下，以非科学的评级手段、无法解释的数据获取方式和不透明的评价模型为行业设定“黑名单”及“预警名单”，可行性和准确性有待商榷，无论对行业或所谓“黑名单”网贷企业都将造成严重伤害。\r\n广东互联网金融协会呼吁网贷行业同仁及被“误伤”的规范网贷平台对此份报告进行抵制，也强烈要求大公信用数据有限公司对此份报告给予充分的解释说明，并向“误伤”平台道歉。\r\n大公数据“此行有扰乱市场秩之嫌疑”\r\n中国政法大学金融创新与互联网金融法制研究中心主任李爱君撰文指出，大公数据没有信用评级的资质，也没有征信的资质，更没有“金融信用风险预警”公布的职能，没有资格进行“金融信用风险预警”及“黑名单”的公布。此外，大公数据是“大公国际资信评估有限责任公司”全资子公司，其具有独立的法人地位，但并不具有“大公”的职能。\r\n她同时指出，此次公布的对象并不是“金融信用”机构，因此评价的客体是错误的。她认为“大公数据”的此次公布结果，违反科学性，且公布的信息错误百出，有违评级结果。“此行有扰乱市场秩之嫌疑。”\r\n大公要通过评级来净化互联网环境?\r\n大公方面在发给媒体的邮件中表示，大公信用发布“黑名单”是社会要求规范发展互联网金融的必然反映;标准力求科学准确、公正全面，能够经得起历史和市场的检验。\r\n与此同时，大公评级董事长关建中在接受香港商报采访时也表示，这份评级报告最终是由债权人和市场来决定，而不是债务人即上述P2P网贷公司使用。\r\n针对业内人士关注的评价指标体系的构成缺乏透明度，关建中介绍，大公国际目前主要采用在线的公开信息，他坦承线下调研没有正式开展，而双向交流机制需要通过协议和契约方式进行。\r\n他称，如今国内已有上亿投资人进入平台中，更有超万亿资金不断涌入，信用规模如果不能控制在适度范围，会给金融体系带来系统性危险。“大公要充当的是中立的第三方，担当评级公司的社会责任，来净化互联网环境，针对不规范平台不断进行信用扩张的行为，大公有权利有资格通过信用评级，阻止他们为所欲为。”(网贷之家 文/牧晨)', '', 0),
(28, 0, '摘要：受相关政策，越来越多P2P机构除了引入第三方担保公司外，还开始探索引保险公司“入伙”的新模式。\r\n目前比较流行的合作模式有两种：一是保险公司直接向P2P产品资产端提供方提供信用保证，二是对P2P机构所有产品进行分类，根据不同类别产品的违约风险设定差异化的风险敞口与赔付比例，作为计算保费的主要依据。\r\n21世纪经济报道记者了解到，不少P2P机构比较倾向于采取第二种合作模式，因为它能降低P2P机构的保费支出与经营成本，操作起来也相对便捷。但保险公司则有自己的顾虑，一旦他们对不同类别P2P产品的违约概率与风险敞口计算有误，无形间就要额外承担不小的赔付风险。\r\n随着相关部门严禁P2P行业自行提供产品担保，越来越多P2P机构除了引入第三方担保公司外，还开始探索引保险公司“入伙”的新模式。\r\n多家保险公司人士向21世纪经济报道记者透露，目前多家P2P公司正与保险公司协商，为P2P产品提供履约保险保障，其中包括1月17日刚刚上线的“第壹投”。\r\n记者向壹投经营方翰典金融副总裁、第壹投CEO唐震求证，对方表示相关合作协商正在进行中。\r\n唐震表示，目前第壹投P2P产品的主来资产端来源，是上海东虹桥小贷公司的各类小贷资产。一旦能给P2P产品引入保险保障，无形间等于给P2P产品提供了双重保障—即便第三方担保公司难以履行P2P产品兑付义务，保险公司也能帮助P2P产品完成到期兑付责任。\r\n但他没有透露第壹投与保险公司具体的产品合作模式。\r\n一位与保险公司有过合作沟通的P2P机构主管透露，目前P2P产品引入保险保障的具体模式主要有两种：一是保险公司直接向P2P产品资产端提供方提供信用保证，二是对不同风险程度的P2P产品设定差异化的履约保险赔付额度与费率。\r\n“但是，能真正得到保险公司认可的P2P机构并不多。”他直言。究其原因，保险公司内部对P2P机构设定了一套严格的准入门槛。\r\n高准入门槛\r\n唐震介绍，目前第壹投已按照保险公司的要求，提供平台业务模式、管理团队背景、P2P产品资产端提供方经营数据等资料，供保险公司测算这家P2P公司的信用评级。\r\n“这也是P2P产品能否引入保险保障的敲门砖。”上述与保险公司有过合作沟通的P2P机构主管表示。只有保险公司内部测算认定P2P公司信用评级较高，才能开展后续的产品合作沟通。\r\n要迈过信用评级这道坎，并非易事。上述主管透露，针对P2P机构信用评级的测算，保险公司通常会采取三种评估标准：一是根据P2P平台自行提供的业务模式、风控手段等资料，给出一个信用评级估值；二是对P2P机构做业务关联性评估，比如分析P2P机构与P2P产品资产端提供方（包括小贷公司等）的股东关系与以往合作关系，判断这些机构会不会合谋套取保险公司赔付款；三是对P2P公司的同行业竞争对手开展调查，因为有些保险公司风控人员相信这种做法能够更全面系统地挖出P2P机构在各个业务流程环节的风险隐患。\r\n“有些P2P机构没有通过信用评级测算，最终被拒之门外。”上述P2P机构主管说。但是，即便P2P机构迈过信用评级这道坎，也未必能够顺利达成产品合作意向。\r\n究其原因，双方往往在产品合作模式方面存在不少分歧。目前比较流行的合作模式有两种：一是保险公司直接向P2P产品资产端提供方提供信用保证，二是对P2P机构所有产品进行分类，根据不同类别产品的违约风险设定差异化的风险敞口与赔付比例，作为计算保费的主要依据。\r\n21世纪经济报道记者了解到，不少P2P机构比较倾向于采取第二种合作模式，因为它能降低P2P机构的保费支出与经营成本，操作起来也相对便捷。但保险公司则有自己的顾虑，一旦他们对不同类别P2P产品的违约概率与风险敞口计算有误，无形间就要额外承担不小的赔付风险。\r\n唐震表示，通常保险公司不会作为P2P产品违约的第一赔付来源。多数情况下，P2P机构会先找担保公司进行赔付，只有担保公司无法履约，才由保险公司出面完成产品兑付。\r\n在他看来，一旦P2P产品能够引入保险保障，将大大盘活其资产转让几率。目前，第壹投正尝试推出两项P2P产品受益权流转服务：一是P2P产品受益权转让服务；二是P2P产品受益权融通服务，即投资者可以将自己持有的P2P产品受益权质押给第壹投平台进行融资，到时只需按时偿还融资本金利息，就能赎回P2P产品受益权。\r\n“这两项业务稳健经营的一大前提，就是P2P产品能确保到期兑付万无一失。”唐震说。\r\n保险公司顾虑\r\n保险公司之所以涉足P2P保险保障业务，其实也有自身的考量。\r\n据网贷之家统计数据显示，2014年国内网贷行业累计成交量高达2528亿元，是2013年的2.39倍。截至去年底，网贷行业贷款余额达1036亿元，是2013年的3.87倍。\r\n“若保险公司能先与数家P2P机构达成合作，就能将模式复制到其他P2P公司，在这个千亿网贷行业获得更多市场蛋糕。”一家保险公司产品创新部人士说。\r\n但他同时坦言，目前保险公司开展这项业务遇到的最大瓶颈，就是无法获得P2P公司真实的经营数据。多数情况下，部分P2P公司为了美化自身财务报表，都会标榜自己有第三方担保公司为其产品提供担保，但经保险公司调研后发现，有些第三方担保公司要么是P2P机构重要股东的关联公司，要么自身资金实力也不够雄厚。甚至个别P2P机构还会借助资金池业务进行借新还旧，变相降低P2P产品实际违约率。\r\n一旦保险公司被这些“假象”迷惑，就将面临远远高于预期的赔付压力。\r\n正是基于风险控制的考量，大型保险公司对这项业务仍然持观望态度，反而是中小型保险公司的积极性更高。\r\n“其中，大型保险公司还有一项顾虑，就是监管部门的态度。”上述保险公司产品创新部人士坦言。即便个别中小型保险公司有意涉足这项业务，基于相关金融监管部门尚未出台P2P行业监管政策，因此更倾向于针对P2P产品的资产端提供方（如小贷公司等）提供相应的信用保证保险这一合作模式。', '', 0),
(29, 0, '摘要：易观智库21日发布的研究报告显示，2014年P2P网贷行业规模迅猛增加，达2012.6亿元。\r\n易观国际旗下易观智库21日在深圳发布的研究报告显示，线下移动支付将迎来爆发，消费场景将由原先线上大额理财、转账汇款以及网络购物等逐渐小额化、高频化的方向发展。\r\n该报告指出，2014年第三方支付企业互联网收单交易额已达88161亿元，第三方支付企业互联网收单竞争格局相对稳定，根据2014年中国第三方支付企业互联网收单交易份额来看，支付宝几乎占据半壁江山，占比达46.15%，财付通占比达18.08%，银联网上支付为14.65%。\r\n易观智库方面预测，2015年中国互联网巨头如BAT等的生态布局趋于完善，将走向实质性发展；传统服务业互联网化催生O2O出现更多新玩法，美甲、家政等上门服务发展迅猛；大数据概念降温，在更多领域得到实际落地应用；移动营销行业将迎来爆发式增长期，移动营销生态日趋成熟。\r\n根据易观智库对P2P网贷市场监测数据，2014年P2P网贷行业规模迅猛增加，达2012.6亿元，环比增长117%，业内网贷平台创新能力继续提升，行业零散特征依旧明显，市场升空间仍然巨大。\r\n“P2P企业将成为投资市场的宠儿，行业逐渐规范，厂商面临洗牌，竞争格局逐步显现。”据易观智库高级分析师李立介绍，2015年互联网金融将趋于成熟，从政策层面来看，互联网金融整体监管细则出台，将对初步发展阶段的互联网金融进行整体行业指导，起到积极促进作用，P2P、众筹监管细则出台，将确立行业准入门槛、进一步规范市场、保护投资者。\r\n“2015年，智能硬件将持续创新，各种可穿戴设备实现创新和优化，但受到硬件发展及非刚需制约，行业仍未到爆发点。”李立告诉记者，曲度更高、柔韧性更好、分辨率更高的屏幕的发布，将会为可穿戴设备厂商带来新的卖点并为用户带来新的交互体验，从而带动市场规模的扩大。', '', 0),
(30, 0, '最近，刘强东现身宜宾五粮液“饮酒”。这位京东集团创始人兼CEO新年伊始亲赴宜宾，还提出“2015年京东将成为五粮液最大的零售商”。\r\n \r\n　　电商巨头与白酒“大佬”的这段“恋情”始于2014年6月，双方达成战略合作，五粮液登陆京东商城，并推出京东定制五粮液酒产品。有数据显示，截至2014年底，京东自营平台累计共完成3.8亿元的五粮液核心产品销售额。\r\n \r\n　　销售不错，彰显“牵手的甜蜜”，于是双方要谋求更深的 “结合”：一系列战略合作，2015年将上线五粮液产品众筹项目。对此，五粮液副总经理朱中玉昨日(1月21日)向《每日经济新闻》记者表示，双方是在原先战略合作协议上推进合作，众筹卖酒目前是一个“方向性的探讨”。\r\n \r\n　　制定万亿目标 京东看重白酒？\r\n \r\n　　新年伊始刘强东即亲赴四川宜宾，品尝五粮液美酒外，这位电商“大佬”有着怎样的思考和谋略？\r\n \r\n　　作为国内自营电商龙头，几天前的京东内部年会之夜，刘强东放出豪言，未来“净收入要超过1万亿元”。目前，交易额达千亿规模的京东，距万亿规模的宏伟目标尚有不小差距。电商业务方面，刘强东希冀京东2015年能扩展品类。\r\n \r\n　　家电、手机等京东传统强项外，白酒或是刘强东看重的领域之一。据悉，近年京东积极布局白酒品类，成为目前唯一获得全部八大名酒直供合作授权的电商企业。\r\n \r\n　　在参观五粮液厂区、饮酒的同时，刘强东提出，“2015年京东将成为五粮液最大的零售商”。对此，五粮液一位高管向《每日经济新闻》记者表示，五粮液希望加大合作，因为公司“看好电商市场”。\r\n \r\n　　双方的“联姻”始于2014年6月。“以前签订了协议，如今暂没有增加新的合作，是在原先基础上继续推进合作，是巩固。”朱中玉介绍说。\r\n \r\n　　实际上，知名酒企对电商渠道是又爱又恨，2014年“双十一”更让酒企与酒类电商的矛盾白热化。“名酒特别害怕特价和低价促销，所以五粮液、茅台曾公开表明没与一些酒类电商进行合作，变相指责了这些电商的特价行为。”白酒行业专家赵义祥分析师称，但电商是未来主流途径之一，酒企又必须进行布局，实际上更看重京东、天猫等综合类电商平台。\r\n \r\n　　如今，酒企纷纷加大在电商渠道的布局，线上和线下传统经销商的利益如何平衡，也一直是业内探讨的焦点。\r\n \r\n　　在白酒营销专家肖竹青看来，已有部分酒企为抢占线上市场份额，将非主要流通产品用于网上销售，这样可以避免造成大面积线上线下产品价格“互相残杀”。\r\n \r\n　　2015年上线五粮液众筹项目\r\n \r\n　　2014年双方宣布合作时，五粮液董事长刘中国曾透露，五粮液不仅提供旗下白酒产品在京东销售，还将在产品的销售、宣传、物流配送方面和京东展开合作。昨日，五粮液一位高管表示，双方在物流方面的合作，暂无更多进展。\r\n \r\n　　如今，京东与五粮液的“恋情”升级，或带给白酒业新的营销模式——众筹卖酒。双方提出，2015年京东将上线五粮液产品众筹项目。朱中玉对记者表示，众筹卖酒“是提出了一个合作方向”，是“值得探讨”的一种新模式。\r\n \r\n　　京东现有的产品众筹模式如何操作？众筹卖酒能否在白酒行业进行大范围推广？\r\n \r\n　　“属于京东集团金融板块，2014年开始做众筹产品，主要应用在科技、智能产品领域。具体模式，比如某公司的产品已初具雏形，计划未来大规模运用和生产，这就需要投入钱来进行改进，实际就用众筹方式，类似提前预售的模式。”有熟悉京东众筹的相关人士向《每日经济新闻》记者表示。\r\n \r\n　　据悉，2014年京东金融正式推出众筹业务——“凑份子”。项目初期，出资人在产品设计、生产和定价等环节与筹资人建立起深层次互动，并能决定产品的未来。\r\n \r\n \r\n　　近期，京东众筹也联合新希望乳业推出国内首个互联网牛奶众筹项目。众筹卖酒未来能否在白酒业内推行？具体如何施行？对此业内看法不一。\r\n \r\n　　白酒行业专家万兴贵指出，发起众筹有的以金融为目的，有的以消费为目的，关键看五粮液怎么选择，“特定的环境、营销群体、消费对象，都要精准考量。”\r\n \r\n　　万兴贵认为，对酒企而言，众筹卖酒的益处在于：第一，转向以消费市场为导向的营销创新，这对白酒行业来说是好事，这种方式真正触摸到了消费第一线；第二，以最快的时间和最短的距离拉近与消费者的距离，省掉经销商，从酒厂到消费者直接点对点。\r\n \r\n　　万兴贵建议，众筹卖酒的具体方式，可超越简单的开店模式，深入涉及到资本、商业模式、品牌合作等内容。白酒营销专家谢一颖表示，五粮液可将力图打造的一些明星产品进行众筹，“新增的明星产品如特曲、头曲等，突破500ml的产品容量，采用较大容量的产品，用线上的这些产品来带动线下500ml容量产品。', '', 0),
(31, 0, '网贷之家讯 在刚过去的2014年中，虽屡次有传言将出台对互联网金融的监管政策，但在人们的翘首期盼中始终没有出台。而对于监管政策的迟迟不肯出台，有人将P2P平台准入门槛低从而引起跑路等现象，对于监管屡次有小风声却无大动作有所批评。但也有人将过去一年行业的快速发展归功于监管层的“不作为”，而对于互联网金融监管的难度也予以理解。\r\n1月20日下午，银监会宣布进行机构调整，将原有27个部门分拆、合并成23个部门。网贷平台由新设立的普惠金融部监管。就在前一天，1月19日互联网千人会在北京亦庄举办的“第二届互联网金融全球峰会”上，对于监管政策是否会在今年落地，中国支付清算协会副秘书长王素珍说：“2015年将成为真正的互联网金融监管元年”。\r\n监管层的“不作为”促使行业飞速发展？\r\n对于如何评价监管层过去一年的成绩，中国人民大学信用管理研究中心主任吴晶妹认为：“监管层对市场的尊重程度，开放程度和包容程度，大大进步了，没有现在监管的包容开放的态度，就没有我们今天互联网这么好的形式。这次放开的8家个人的征信机构意义重大，并且这8家中还有3家互联网公司，这就意味着征信要从传统专业化到数据机构，另外一个从传统的金融信贷，扩大到了社交和商务。\r\n而翼龙贷董事长王思聪也认为：“监管层如果有监管，就没有现在的成绩，所以我觉得监管不作为有好处，给了行业一个空间。2014年以前，互联网金融是一个草根、屌丝们想怎么干就怎么干的时代，人人都有机会去当英雄。到了2015年以后我理解就不是了。因为监管的靴子有可能落地，而我们国家的监管往往都是设定了很多的条件，很有可能独立于我们这些曾经的草根互联网金融公司。”\r\n好贷网CEO李明顺对此看法有所不同，他说：“市场上出现了一些上线没有多久就跑路的互联网金融平台，还出现了一些虽说可能运营能力达到很好的状况，但做了些影响投资者，或者影响客户的利益的事情。还存在一些不作为的情况。”\r\n互联网金融因“互联网”属性为监管带来难度\r\n虽说监管政策迟迟不落地，但各平台老总对于互联网金融监管上的难度也予以理解。点滴身边董事长谢涛说：“我觉得监管机构确实是挺难的，因为互联网金融既有互联网的元素，又有金融的元素。互联网是一个开放的平台，是一个没有门槛的领域、大家有想法就可以进入的领域。把金融和互联网这两个东西加在一块，我觉得对于监管来说确实是出了一个难题。”\r\n李明顺说：“互联网金融监管把互联网放在前面，代表了它的特性。互联网的创新是自下而上的，传统金融创新更多的是自上而下的。可能我们今天看到每一类银行的模式差不多，但是在互联网上产生的就不一样了。”\r\n王素珍也解释了互联网金融监管的难度。她说：“监管规则的制定要跟上创新的脚步，走的太慢太快都不好。当前互联网金融已经进入了一个全新的时期，形成了去专业化，互联互通的主要特征。互联网金融本质是金融，这没有错，但与此同时，互联网金融的发展动力来源于互联网，没有互联网，互联网金融也就失去了活力。”\r\n2014年留下的监管悬念，会在2015年得到答案\r\n但即使难监管，对于该如何监管网贷行业，作为网贷平台高管的谢涛给出些建议：“首先设立门槛，让大家有清晰的指标来跨这个门槛，知道达到什么样的条件才能进行申请。其次规定些具体的条件，比如说高管人员有多少是从事金融的，多少从事计算机安全的，多少是从事风控领域的，资本金的充足率是怎样的，具备了可能允许你进行经营。”\r\n王素珍认为国家对互联网金融的发展一直持鼓励态度。“上周人民银行刚刚发布了关于推动移动金融技术创新健康发展的指导意见，明确了移动金融技术创新健康发展的方向性原则。这就是遵循最安全可控的原则、并称利民的理念、坚持创新发展、注重服务的重合发展。这体现出监控层对互联网金融创新的大力支持。”\r\n而王素珍同时也认为政府会在2015年大力推进互联网金融的监管。她说:“国家对互联网金融监管的总体原则是鼓励创新、防范风险、驱利避害、健康发展。去年业界期盼的互联网金融监管只闻楼梯响，不见人下来。但我想去年互联网金融监管留下的悬念，在2015年一定会得到一个明确的答案。2015年可以说将真正成为互联网金融监管元年。”（网贷之家 文/张诗雨）', '', 0),
(32, 0, '网贷之家整理 业内人士常说P2P网络借贷是民间借贷的“互联网化”，是一种互联网金融创新模式。那么，P2P网贷与一般的传统贷款而言，究竟有怎么的特点和优势呢？整理网贷之家社区里投资人的分享，相较于传统贷款、传统银行小额贷款，网络借贷具有以下几点优势。\r\nP2P网贷与一般的传统贷款而言，具有以下几点优势：\r\n一、集资能力非常强，其可供贷款的金额更加充裕\r\n传统行业中，贷款一般由各大银行提供，如需贷款，则需要经过诸多的抵押以及验证程序，通过了重重关卡，最终贷款的金额也非常有限。相反，P2P网贷却不一样，由于其一般都只存在于网络上的一些借贷平台，这些平台给予放贷者的利率相当高，因此很多有闲散资金的人都愿意将资金存放在这样的平台上来获取利益。一般用于网贷的资金大致收益率会在一般理财产品的8-10倍，这样的利率不可谓不让人动心，因此贷款平台的集资能力非常强，其可供贷款的金额也就更加充裕。\r\n二、手续简便\r\n与传统的贷款众多繁琐的程序相比较，P2P网贷拥有非常简洁的操作程序，贷款者足不出户，既不需要通过繁杂的资料审批，也不需要在交通工具上浪费时间，只需要通过网络达成一致协议即可。且目前的网贷趋于小额化，有些无需贷款者提供抵押，只需要通过网络贷款流程即可，这就更大程度的简化了贷款的手续。\r\n三、形式灵活\r\n传统的贷款一般都是通过向银行贷款，形式非常单一，但现在存在于网络的P2P网贷，其形式非常灵活，依存于网络服务于大众，让更多人可以通过不同形式的平台最终实现贷款。这样的贷款模式不仅促进了商业经济更高速有效的发展，而且也刺激了现有的贷款制度，让贷款可以以更多不同的形态出现在我们的生活中。\r\n核心优势\r\n与传统金融模式相比，P2P网贷有以下优势：\r\n一、信息处理和风险评估通过网络化方式进行。\r\n二、资金供求的期限和数量匹配，不需要通过银行或券商等中介，供求方直接交易。\r\n三、超级集中支付系统和个体移动支付的统一。\r\n四、产品简单化。\r\n五、金融市场运行完全互联网化，交易成本极少。\r\n六、更为重要的是，市场参与者更为大众化，互联网金融市场交易所衍生出的巨大效益更加普惠于普通民众。\r\nP2P网贷相对于银行小额贷款的比较优势：\r\n一、交易的快捷和便利。与一般银行苛刻的贷款申请条件、繁复的材料准备以及冗长的等待过程相比，竞价式的P2P网贷金融服务优势十分明显。网络借贷成为注册用户后，填写完一系列基本信息，网站专门的评级系统会对每个申请人进行风险评级，随后申请人就能在网站上发布自己的相关贷款信息。\r\n二、成熟的P2P网贷平台运作，具有风险低和流动性强等优势。P2P网贷投资是弱市中“高收益、稳健型”投资产品，相对来说，收益情况受到经济环境的影响不太明显。甚至有些地区由于资金需求在经济下滑和萎靡时期往往更加旺盛，平台上的借贷活动也会更为活跃。\r\n三、P2P网贷模式可以采用信用贷款，更适合中国国情。当前我国中小企业平均存活时间不到3年，中小企业普遍存在财务报表混乱、缺少可抵押物、抗风险能力薄弱等问题，银行很难放手借款。除此之外，传统银行企业贷款业务以客户为导向，进行精细风险管理，在人力成本、管理成本近似情况下，银行及其业务人员都不愿意受理小额贷款业务。', '', 0),
(33, 0, '作为一个P2P网贷中生代，参过团，踩过雷，在高息中疯狂，在跑路潮中惶恐。新年之际将我（注：一位资深投资人）所有的经验献给各位新来P2P网贷的投友们，希望大家可以在新年里获得满意的回报。\r\n1. 风险承受。\r\n我觉得一个新人要明确自己的风险承受能力，即最多能够承受多大的损失。在进入这个行业之前，要自己考虑清楚自己的承担能力，投资有赚有赔，而风险承受能力我认为也与选择的平台戚戚相关，如果承受风险能力不强，建议投资低息且背景深厚的平台，风险小，投的也更放心。如果承担风险能力强，可适当选择高息网站，当然全投高息网站是不可取的，全投高息我觉得就是赌博，一旦碰上倒闭潮，必然血本无归。\r\n2.资金\r\n拿什么投网贷?拿钱呗，所以资金在投P2P中占有举足轻重的作用。小于30万，小散 ;30万-200万， 中户;200万以上大户。不同的资金量，投资策略更加不同，作为小散，最适合的投资方法是 多账户分散投资法，即在选择的平台采用直系亲属注册多个账户，既方便投标，也便于保持 账户总额在1万以下。据倒闭潮经验，相当一部分倒闭平台老板为了减轻罪责都会清小散，所以理论上来说，同等情况下，账户资金越少，在倒闭时更有可能全身而退。中户的话 还是要分散投资，高息低息搭配好，对于中户来说，我觉得信息很重要，每一个平台倒闭前，都是有风声的，先一步得知信息，就有可能先从悬崖边跑掉，所以，一个甚至多个消息灵通的网贷投资群是必不可少的，对于自己要重仓的平台，最好实地考察确认下，花费一点利息，可大为降低风险，舍不得孩子套不住狼啊。大户，算了吧，土豪的世界我辈不敢多说。\r\n3.时间\r\n选择平台，是一个技术活，作为小散可能对数据不太需要，但中户大户，就最好能够自己分析平台，分析数据，有自己的投资方法，一个人的投资方法，是不断修正，成熟的，一个没有时间的网贷人，选择平台可能就是看看网贷之家的利率，看看之家的考察报告，这等于把自己的钱交给别人，把自己的脑袋让给别人指挥自己，其中的风险非常之大，在此，奉劝时间不多的网贷投资人，不可把大部分资金投向网贷。纵观人类历史，赚到钱的永远是少数人，不存在大多数人都能赚钱的行业，想靠人云亦云，随波逐流，赚到钱是不可能的。\r\n4.选择平台\r\n很多老人，包括我，都是从拍拍贷交了学费毕业的。虽然拍拍贷确实很流氓，但我觉得在拍拍贷教的学费值，起码让我掌握了基本的分辨能力，最起码，我不会上一个明显是骗子的当。在去年，打新还是一个高收益低风险的行当，但随着骗子们纷纷上线，打新已经是一个高风险高收益的行当了，已经不适合新人参与了。大多数人都无法对新平台去实地考察，只能听别人的介绍，现在的打新，完全是赌博行为，因为一个平台风控好不好，运营实力怎么样，是否自融都不是短期能看的出了，吸引打新者的唯一理由就是高息，套用一句话：你想着他的息，他想着你的本，打新要不得，特别是在目前的环境下。作为一个新人，还没有养成自己的投资策略，作为小散，也没有钱和精力去实地考察，那么最好是参考一下现在各版本的评级，一般来说，随着评级的降低，收益越高。一般来说，评级的平台可基本排除纯粹骗子的可能，当然也不是说绝对不倒闭，但比较来说，倒闭可能比不进评级的还是要小的多，新人可根据自己的情况，在不同等级中选择适合的平台投资，新人来说，低息高评级平台多投点，等慢慢有了投资经验，再慢慢加大中高息平台的投资额。\r\n投资如人生，可能有引路人但没人能代替你，投资的魔力只有我们享受过才能明白其中的精彩。\r\n投资不易，且投且珍惜。', '', 0),
(34, 0, '凭借余额宝登顶公募基金“一哥”的天弘基金，正将目光投向小额贷款行业。1月21日，21世纪经济报道记者从广州小贷业界获悉，天弘基金正与部分小贷公司协商开发新产品，用货币基金等现金管理工具，试图盘活小贷公司的“站岗资金”。\r\n \r\n这一消息最早是在广州举办的“2015年南方金融创新论坛”上，天弘基金华南营销中心总经理张技辉透露，但他并未阐述产品设计细节。\r\n \r\n一名参与研讨的小贷公司负责人对21世纪经济报道记者透露，该产品名称初定为“日日利现金1号”。实际上，这是一款“一对多”的基金专户资产管理计划，资产端对接协议存款、通知存款、短期融资券、货币基金等，专门向小贷公司发售，每日可开放申购、赎回。赎回资金在T+1模式上到账。\r\n \r\n另一小贷行业人士认为，天弘基金的这款产品在到账周期等方面尚待改进。且小贷公司参与投资亦需监管批准，推广难度不小。天弘基金方面则表示，产品交易结构与名称均待确定，推出市场的时机尚未成熟。\r\n \r\n“站岗资金”的生意\r\n \r\n何谓“站岗资金”？广州一名小贷公司负责人解释，根据其来源，具备两大要素。一是此前小贷公司未分配的利润不允许放贷(现已逐步放开)而堆在账面无法盘活；二是放贷过程资金有进有出，进出之间常有一两周的闲置期，此周期内亦不能带来盈利。\r\n \r\n“按之前省金融办的估算，全省小贷行业站岗资金大概有60亿，实际可能不到这个数。因为计算基准是行业净利率的10%，而这几年一些小贷公司达不到。”前述负责人表示，“但资金量还是有的，我们也很愿意跟天弘谈合作。”\r\n \r\n前述人士表示，天弘基金可能借助其专户子公司“北京天地方中资产管理有限公司”的资管通道来设计产品。初步方案中，天弘基金每年收取0.2%的管理费，按日计提，按季支付。\r\n \r\n广东南方金融创新研究院高级研究员徐北表示，天弘基金亦有动力做站岗资金生意。“一方面给天弘带来盈利，另一方面也可以缓解它资金来源单一的问题。模式成熟以后，可以推广到全国范围。”\r\n \r\n公开的数据显示，2014年末，天弘基金以5897.97亿元的资产管理规模蝉联行业第一，其中对接余额宝的“天弘增利宝货币市场基金”的规模达到5789.36亿元，占比在98%以上。\r\n \r\n某种程度上，余额宝本身就是为了盘活消费者在支付宝的“站岗资金”而生。而当今互联网理财市场上，P2P亦有大量站岗资金的沉淀。\r\n \r\n深圳某平台负责人对21世纪经济报道记者表示，大量网贷平台资产端开发不足，导致资金无项目可投的现象越来越严重。“尤其是每年春节到4月份，融资需求非常低迷，我们也想引入现金管理工具给投资者更高的收益。否则钱存入平台的虚拟账户中，就没有任何收益。”\r\n \r\n但他认为，天弘基金这项新业务无法照搬到P2P行业，因为基金专户资管计划按一对多、一对一的类别，投资门槛分别是100万、3000万，不适合网贷“小散”，“平台也不能汇集资金来买，否则真成了非法集资”。为解决这个问题，目前业界思路有两种，一是设计自动投标产品，但这仍受制于融资项目不足；二是投资者直接在页面购买货币基金，但系统对接成本太高。\r\n \r\n是否超范围经营\r\n \r\n　　一个显而易见的问题是，小贷公司为何不直接买余额宝，而要购买基金专户资管计划？\r\n记者获得的资料显示，天弘“日日利”以银行七天通知存款为业绩比较标准，同时参考余额宝表现。“谈项目的时候天弘基金提出收益给到年化4.5%。”广州一名小贷公司负责人称，目前该公司现金管理用的是平安银行“天天利”理财产品，收益为2.78%至3%。由此，业界推测天弘基金推出这款产品的意图可能的解释是，资金门槛提高可带来收益上浮。\r\n \r\n相较之下，天弘基金的方案收益更高。但前述负责人认为，小贷公司对收益率并不敏感，到账时间更加重要。“我们有些客户合作了很久，有足值抵押物，可以在授信额度内随时提取资金。天弘基金T+1的方案不好用，反而银行理财T+0更能够配合。”\r\n \r\n他同时表示，这些技术细节均可能在后期调整，但真正成为天弘基金推广障碍的是地方金融办的态度，即小贷公司能否购买基金专户资管计划。\r\n \r\n“几年前我们跟银行合作，投了个‘四天通知存款’产品。就是诸如你周一通知、周四到账，周四通知、下周一到账的周期。当时给客户放款最小周期是3天，这个周期很合适。但有会计师事务所认为这是超范围经营，害我们向金融办解释了半天。”\r\n \r\n金融办要求解释的原因显然是，银行标准的通知存款是7天周期，修改为4天后，会计科目就以“理财产品”显示。而根据规定，小贷公司只能以小额信贷获取盈利，投资理财产品需要地方金融办认可。“连银行理财都卡得这么紧，投基金公司的产品就更严格了。”\r\n \r\n　　另一方面，根据广东省金融办去年末下发的《关于小额贷款公司利用未分配利润发放贷款的试行办法》，从今年2月1日起，小贷公司账面的“未分配利润”可用于放贷。其中，未分配利润的计算口径是上一季度末资产负债报“未分配利润”与“盈余公积”之和。这意味着小贷很大一块“站岗资金”能投入再生产，对现金管理的需求亦将减少。', '', 0),
(35, 0, '1月20日，银监会宣布组织架构重大改革，并获中央有关部门批准通过。据了解，这是银监会自2003年4月成立以来首次大规模调整监管架构。\r\n此次监管架构改革将机构和人员编制向前台监管部门倾斜，调整后银监会内设22个部门，其中监管部门由11个增加到17个，占部门总数的77.3%。银监会相关人士表示，这种调整强化了银监会的监管“主业”。在目前金融市场向细分化、专业化方向发展的大背景下，加强监管部门的编制十分必要。\r\n此外，银监会将加大对民营银行和信托公司的监管力度，并首次明确将网贷纳入监管框架。\r\n厘清各部门的监管范围\r\n《每日经济新闻》记者注意到，银监会将原有27个部门拆分，调整后银监会内设22个部门，其中监管部门由11个增加到17个，占部门总数的77.3%。\r\n本次针对部门和监管业务的调整主要有几下几个方面的变化：撤销2个部门 (培训中心、信息中心)，设立城市商业银行监管部，专司对城市商业银行、城市信用社和民营银行的监管职责;设立信托监督管理部，专司对信托业金融机构的监管职责;改造3个部门(统计部、银行业案件稽查局、融资性担保业务工作部)，设立审慎规制局，牵头非现场监管工作，统一负责银行业审慎经营各项规则制定;设立现场检查局，负责全国性银行业金融机构现场检查;设立银行业普惠金融工作部，牵头推进银行业普惠金融工作;强化银行业普惠金融工作部在小微、三农等薄弱环节服务和小贷、网贷、融担等非特牌机构监管协调方面的总抓任务。\r\n同时，银监会将按监管职责内容命名各机构监管部。银行监管一部为大型商业银行监管部;银行监管二部为全国股份制商业银行监管部;银行监管三部为外资银行监管部;银行监管四部为政策性银行监管部;合作金融机构监管部为农村中小金融机构监管部。\r\n首次表态监管网贷\r\n社会科学院金融研究所银行研究室主任曾刚向记者分析指出，目前监管也要适应行业的变化，之前是全国性股份制银行和城商行以及民营银行都在一个部门监管，现在股份制商业银行规模比较大，属于全国性质，而城商行是地区性银行。随着各自体量不断增大，二者监管有一定的差异性，配置的监管资源也要随之增加，现将民营银行放在城市商业银行监管部监管，主要是将民营银行当成地方性银行对待。\r\n“设立信托监督管理部主要是信托规模越来越大，业务也越来越复杂，涉及的事情比较多。为了适应信托行业本身规模的扩大，将其与其他非银机构分开也在意料之中。”曾刚说。\r\n优选宝执行总裁张虎成认为，银监会本次调整最重要的意义有两点：第一，信托监管部的成立有利于信托市场的发展，我国目前信托的监管制度法规等已经有不能适应发展的需要，监管制度专业化更有助于调整与目前发展不匹配的制度，能够助推信托发展与制度调整的高度同步性;第二，普惠金融部的设立承认了网贷平台存在的意义与其合法性，部门成立后将会有助于推动P2P监管方面一系列制度的落地，更有利于行业朝着健康的方向发展。\r\n曾刚表示，在普惠金融方面，国家赋予了银监会这个职能，推进国内银行业普惠金融的发展，普惠金融业务以前分散在不同部门之中，之前有一个中小企业融资办公室放在二部，后来普惠金融涉及到农村，合作部也在做一些内容，这次调整把原来分散在不同部门中的和普惠金融相关的一些也组合集中起来，包括小贷、网贷等，这样可以形成系统的监管。\r\n银监会相关人士表示，这种调整强化了银监会的监管 “主业”。在目前金融市场向细分化、专业化方向发展的大背景下，扩大监管部门的编制十分必要。以信托市场为例，目前信托资产规模近13万亿元，仅次于银行业总资产，因此完全有理由单划一个部门出来监管。\r\n重点是简政放权\r\n银监会表示，此次监管架构改革的重点是清减下放行政权力，明确风险监管主体职责。银监会本着风险为本、法人监管、属地负责的原则，进一步明确了总会与派出机构之间的风险监管职责和权力，对于全国性机构，主要由总会各机构监管部门承担风险监管主体责任，派出机构负相应监管协助责任;对于地方性机构，总会仅对法人机构的新设筹建、市场退出、重组改制和破产重整进行审批，其他市场准入权力下放给银监局，并由注册所在地派出机构承担风险监管主体责任，总会相应监管部门负指导责任。\r\n银监会相关人士介绍，银监会只对“三个半”部门负主体责任，即政策性银行、五大行、股份制银行及非银行中的四大资产管理公司。而其他的主体职责全部交到地方银监局，由其进行监管。同时，银监会只保留三项准入权力：新机构的出生(只批筹建不批开业)，机构的重组改革、机构的破产重整。\r\n曾刚表示，简政放权是一个趋势，银监会过去也做了很多简政放权的工作，准入是银监会的核心职能，其他非准入性的行政许可要么放掉，要么让渡给银行业协会。\r\n', '', 0),
(36, 0, '    1月23日，一行三会相关负责人在国务院新闻办公室举行国务院政策例行吹风会上，回答互联网金融监管问题时均作出表态。\r\n    央行副行长潘功胜首先评价互联网金融。他指出，互联网金融健康发展对于提高中国金融体系的普惠性和包容性的水平，提高金融交易的效率，降低金融交易的成本，引导民间金融走向一个更加规范化的发展等，有非常积极的意义。同时也要看到，互联网金融也是金融，金融行业不同于其他的行业，金融行业在风险的特征上具有很强的隐蔽性、突发性、传染性、外溢性等。潘功胜明确指出，关于对互联网金融的发展和监管政策，人民银行的态度长期以来都是一致的，就是鼓励创新发展、适度监管。\r\n    “人民银行牵头银监会、证监会、保监会等相关部门，制定了关于促进互联网金融健康发展的指导意见。按照适度监管、分类监管、协同监管、创新监管的原则，建立和完善互联网金融的监管框架，科学地界定各种业态的业务边界和准入条件，落实金融监管部门之间的相互分工和责任。同时，明确底线，保护合法经营，打击违法和违规经营”。潘功胜进一步指出。\r\n    银监会副主席王兆星则表示，在过去的5年当中，中国的金融业有两件事情让全世界感到惊讶。第一件事情是，中国已经有好几家银行进入全球前十大银行;第二件事情，就是中国互联网金融的快速发展。\r\n    在王兆星看来，中国互联网金融的发展，表明中国当前的经济发展有很大的金融服务的需求，而传统银行业还不能完全满足这些需求。“互联网金融有很积极的作用。”\r\n    谈及互联网金融监管，王兆星称，一方面要促进互联网金融健康发展，促进银行业加快改革和创新，改善金融服务;另一方面，也要高度关注互联网金融可能带来的一些金融风险，在资本、流动性以及信息公开等方面加强规范。“目前，人民银行和银监会，正在抓紧制定相关制度，加以规范，使互联网金融得到更健康的发展。”\r\n    此外，保监会副主席周延礼指出，互联网的发展对保险来说，是提供了一个难得的发展机遇，互联网保险的快速发展也为保险业发展注入了活力。保监会对此持积极态度，鼓励创新、适度监管，切实保护消费者利益，这是监管的一个思路。', '', 0);
INSERT INTO `gica_document_article` (`id`, `parse`, `content`, `template`, `bookmark`) VALUES
(37, 0, '这是最好的时代，这是最坏的时代!\r\n这是英国作家狄更斯传世名作《双城记》中的开篇，若是概括当下的P2P市场，恐怕没有比这更恰当的语言了。\r\nP2P，即peer to peer，是近年来在国内兴起的一种新型互联网借贷方式。\r\n一方面，投资股市、楼市的超高回报早已不在，各类“宝宝”的收益不断下滑，银行定期存款利率在通胀面前显得微不足道，此时各类P2P平台的出现很难不吸引大家的目光，超高的年化收益率不断刺激着投资者的神经。\r\n另一方面，无准入门槛、无行业标准、无监管机构亦是p2p行业目前的现状。P2P平台卷款跑路的消息屡见不鲜，这让手里攥着真金白银的投资者望而却步。\r\n虽然经历了倒闭潮、创始人携款跑路的诸多负面消息，但也没有阻挡新的P2P如雨后春笋般涌现，新平台层出不穷，如果投资人能够冷静、理性的分析，找到一家靠谱的平台来获取稳定的高收益也并非难事。\r\n平衡风险与收益\r\n一个P2P平台若想在激烈的市场竞争中获得一席之地，需要解决一个根本性的问题：在保证投资者本金安全的前提下获得高收益，即在风险与收益这对“天敌”之间找到最佳平衡点，若一味强调高收益，则本金安全性难以保证，若只想着安全，不去花心思找项目设计产品，那么与银行利率相差无几的收益又很难吸引投资者。\r\n越来越多的国资和银行正在慢慢渗透互联网金融领域，作为国内民营银行市场化的领军者，平安银行和民生银行也作出了有效的尝试。\r\n平安银行与民生银行均为民营银行中运营质量最高、体量最大的代表，民生银行是中国首家主要由非公有制企业入股的全国性股份制商业银行， 2013年实现净利润422.78亿元，总资产超过3.2万亿元。平安银行是平安集团控股，2013年实现净利润152.31亿元。总资产近1.37万亿元。\r\n目前平安银行很多高管来自民生银行，现任平安银行行长邵平就出自民生银行，曾担任民生银行副行长等核心职务，因此平安有很深的民生烙印：即关注小微金融、事业部制改革等。在整体运营上，平安越来越具有民生的风格，但是在互联网金融上的探索上，这两家民营银行的佼佼者却采用了两种完全不同的思路：平安银行旗下只有一家P2P平台陆金所，而民生银行旗下则有民生易贷和民贷天下两个平台。\r\n陆金所，即上海陆家嘴国际金融资产交易市场股份有限公司，是平安旗下的P2P平台，2012年3月正式上线运营，董事长计葵生亦有多年的从业经验，荣誉无数。站在平安集团这艘金融航母上，陆金所可谓安全无忧，但是8%左右的年化收益让高信用的光环也没有那么耀眼。列举几个具体的产品及收益。我们从陆金所网站首页看到，主推的稳盈-安e 系列预期年化收益率最高8.4%，而投资门槛略低的富盈人生，预期年化收益率更是只有6%。\r\n民生易贷，是民生电商旗下的专业投融资平台，它的推出代表着民生电商正式介入P2P网络借贷领域，于2014年7月15日正式对外运营。民生银行的背景让民生易贷的平台中也难觅年化收益率超过8%的产品，该平台目前主推的满溢系列，年化收益率均在7%以下。\r\n民贷天下，由民生银行与广州基金共同出资设立。具有银行和政府双重保障的民贷天下从信用等级上看值得信任。该平台上目前上线的产品，起投金额为100元，年化收益率约8.5%-15%。从目前的收益率上看，民贷天下的产品收益明显高于其他国资或者银行系P2P平台。我们不知道这种高收益是为了给新平台聚拢人气还是能有所持续，但可以肯定，这能够给投资者带来真金白银的收益。\r\n如上，虽然不约而同的在互联网金融领域布局，但两家所采用的形式完全不同：平安集团只推出一个P2P平台陆金所，民生银行先后设立民生易贷和民贷天下两个平台。很难去猜测民生银行的实际想法，是采取赛马机制?抑或是民生银行把互联网金融当成重要的战略发展方向，采用两架马车并驾齐驱的双保险模式在这个行业进行多元化的战略布局与精耕细作。和民生易贷有所不同的是，民贷天下是目前华南第一家同时具有国资与银行背景的P2P平台，因此所能融合的行业以及资源也会更为广泛。当然，互联网金融行业发展迅速，市场需求与容量也是巨大的，未来，整个行业会形成几十家的大型的P2P平台，不同的行业、不同的客户群定位，都会有不同P2P公司发展的巨大空间。\r\n银行系P2P在风控上独具先天优势\r\n互联网金融的本质是应该是金融，所以P2P的核心竞争力在于风控，不论是以提供信息为主的纯平台模式，还是线上收取材料、先下审核的O2O模式，让投资者最为关注的恐怕先是安全性。\r\nP2P行业应有一定的行业门槛，自身不能为投资者提供担保，平台不能承诺本金收益，只能做信息中介而不是信用中介，不允许设资金池，打击非法集资。由于投资者和借款方信息不对称，投资人不可能对每个借款项目有清楚的了解，根据自身风险承受能力来决定投资对象和额度。\r\n银行较高的风险控制能力，也为银行系P2P平台的风控提供了先天的、其他P2P平台很难比肩的优势。以上述民生系P2P平台民贷天下为例，除了不设资金池，严格筛选项目，保证投资者资金信息安全等种种措施之外，还首次提出了行业最高标准的三金制度：每笔业务合作机构会存入一定比例的保证金、按照营业收入一定比例计提风险准备金、信贷条线(业务、风控双线人员)队伍30%备扣奖金做风险储备金。这些措施，无疑能给投资者的本金和收益带来极大的保障。\r\n收益并非越高越好\r\n众所周知，现金使用成本的衡量标准就是利息的高低，目前国内P2P平台超过上千家，各种各样的新平台如雨后春笋般不断出现，很多新平台为聚拢人气，会以高息，甚至超高息的条件吸引投资人。对于此类高息新平台，各位投资人还需谨慎选择，尽可能通过各种渠道了解关注平台的各方面情况，综合考虑，横向比较，最好是等平台运行一段时间，在此期间观察平台的运营情况，再做决定。\r\n试想，如果年化收益率为30%，那么就意味着借款方用这笔钱一年需要获利超过30%才能保证按时归还本息，但又有什么生意一年能有30%的利润呢?不是说没有，但数量寥寥无几。\r\n对比市场上P2P平台的收益率，陆金所与民生易贷的收益率均在8%以下，而据民贷天下信息显示，平台上线后推出的产品收益将在8%-15%，既没有为了吸引投资者不顾风险的推出高收益，也没有因为几乎可以认为“零风险”的高信用等级而降低收益，可以说给予了投资者一个令人兴奋的回报。\r\n目前全国网贷平台平均利率约在15%-20%左右，较之去年行业普遍高息的局面，今年网贷的年化收益率有所下降。今年P2P网贷平台新增数量大幅增长，发标规模随之扩大，投资人抢标现象已经大幅减少，供需矛盾趋缓也是借贷利率下降的重要原因。在市场博弈因素决定下，随着投资者数量增加，利率下降是自然趋势。回顾全世界信贷金融工业发展100年以来的历史，在任何一个阶段、任何一个区域，都不曾有超过三年年化收益率超过15%的产品。\r\nP2P行业发展已经进入2.0时代\r\n虽然经历了倒闭潮、创始人携款跑路的诸多负面新闻，P2P的行情时至今日依然火爆。\r\n不知不觉，国内信贷P2P行业发展模式正在发生隐秘变化。一个较为明显的现象是，通过最初的野蛮成长，越来越多资金雄厚的机构介入P2P，包括银行、上市公司、财富管理集团等正在打造升级版P2P。\r\n其中银行系P2P的崛起最为引人关注，目前，已经布局P2P领域的银行有招商银行、平安集团、民生银行、国家开发银行、兰州银行、包商银行、江苏银行、苏州银行、宁波银行、齐商银行、恒丰银行等。\r\n银行系进入P2P网贷领域增强了消费者对于银行品牌形象“创新”、“亲民”的印象，借助强大的银行品牌背书也快速提高其P2P平台在投资者中的认知认可度。在当前国内征信体系尚不健全的情况，由于银行的风控体系较为成熟，投资者在这方面对银行系P2P有着较强的信任感。', '', 0),
