INSERT INTO `gica_z_article` (`id`, `title`, `art_info`, `art_keyword`, `art_content`, `art_writer`, `art_time`, `type_id`, `art_url`, `art_img`, `art_userid`, `sort_order`, `art_click`, `art_set`, `art_attr`) VALUES
(87, 'P2P网贷疯狂生长 加速金融行业洗牌', '火热的网络借贷背后，P2P平台风险正集中暴露。P2P平台平均每天新增3~4家，然后又以每天倒闭1家的速度洗牌。', 'P2P网贷,金融行业洗牌', '<p>　　火热的网络借贷背后，P2P平台风险正集中暴露。P2P平台平均每天新增3~4家，然后又以每天倒闭1家的速度洗牌。</p><p>　　但这个互联网金融的创新方向依然受到资本的青睐。11月15日，软银中国资本投向互联网金融的首个项目浮出水面——有利网获得首轮投资，融资规模达到千万美元。距离这个平台正式上线不过10个月的时间。</p><p>　　还不仅仅是风险资本， 着急的还有银行，招商银行近期已经完成了第7个线上融资项目。从9月17日上线第一个项目以来，招行“小企业e家”金融服务平台上类P2P贷款的投融资撮合服务到目前揽金1.5亿元。</p><p>　　甚至政府，也对这种新的模式表现出了难得的热情——2012年12月，江苏省金融办联合国家开发银行主办的开鑫贷上线。其目标为：引导民间借贷的健康发展，拓展小微企业融资渠道。运作11个月之后，至10月25日为止成交1162笔，投资用户2303人，完成5468笔投资，借入用户734人，通过开鑫贷平台向“三农”和中小微投放了交易金额17.56亿元。</p><p>　　互联网“入侵”金融迅猛，P2P作为其中重要的形态，疯狂的速度之下，从观念到操作挑战着传统金融的边界。</p><p>&nbsp;</p><p>　　<strong>疯狂成长</strong></p><p>　　P2P眼下正陷入疯狂的成长期。</p><p>　　在2010年，P2P平台仅有20家机构，而今年底将达到800家。</p><p>　　3年来，网贷平台数量以400%的速度疯长。而今年下半年以来，增速在加快，“现在一个月要上线100家平台，每天增加3~4家，预计到年底全国网络借贷平台会突破800家”。网贷之家创始人徐红伟说。</p><p>　　事实上，目前除了西藏、青海、宁夏、黑龙江和吉林之外，中国所有的省市区都有P2P平台了。其中第一梯队是广东和浙江，占全国的15%以上。第二梯队是江苏、北京、山东和上海，它们在7%~9%之间。</p><p>　　而P2P疯狂成长的数据，除了飞速增加的平台数量之外，还有高速增长的贷款总量。</p><p>　　来自网贷之家的数据显示，平台总成交量2010年为6亿元，此后以每年500%的速度增长，预计2013年行业总成交量将达到1000亿~1200亿元。而实际的贷款存量要除以4或者5，这因为网络借贷行业的借款周期非常短，成交量带有滚动效应，所以实际贷款存量估计在200亿～300亿元之间。</p><p>　　徐红伟认为，P2P的迅猛发展，重要来源是因为民间借贷“网络化”，“5年后，中国网贷市场的总成交量可能会超过10万亿元。”徐红伟告诉《中国经营报》记者。</p><p>　　据7月公布的《中国P2P借贷服务行业白皮书2013》（以下简称《白皮书》）显示，根据在132家中选取21家活跃度较高的P2P借贷平台，对交易情况做出的分析显示：2008年这21家机构交易量小于0.1亿元，到2011年度已经达到10.03亿元，2012年全年的成交额也达到了104.13亿元。交易笔数由2011年的5.79万笔增加到了21.14万笔。</p><p>　　具体统计中，除去5家成立较晚的P2P机构，其他16家机构2012年1～12月，借款平台成交额从1.94亿元上升到16.97亿元，实现了871%的增长。全年累计成交额达到98.5亿余元，与2011年相比约有10倍以上的增长。</p><p>&nbsp;</p><p>　　<strong>快速洗牌</strong></p><p>　　就在P2P平台规模迅猛扩张的同时，平台倒闭也在以每天一家的速度倒下。</p><p>　　仅刚刚过去的10月份，媒体报道指出，全国已陆续有20家P2P平台倒闭或出现提现困难。根据公开资料不完全统计，10月份有20多家平台或倒闭或提现难：铜都贷、天力贷、东方创投、钰泰财富、宜商贷、家家贷、力合创投、万利创投、浙商365、银实贷、川信贷、盈通贷、福翔创投等。10月份出现问题的P2P网贷平台总贷款余额超过10亿元，最新已确认的铜都贷和家家贷陷入困境，而这两家平台代收金额都超过1亿元。</p><p>徐红伟告诉记者，这一情况未来还可能会加剧，“以后可能一个月倒闭100家”。</p><p>　　刚刚起步，却又迅速陷入行业洗牌，即便是通常以日新月异为形容词的互联网行业，这也是个罕见的现象。</p><p>　　从总倒闭的情况看，目前倒闭的大都是新上线不久的平台，它们为吸引人气，年贷款利率出到30%~40%，有的甚至高达60%，而《白皮书》统计16家P2P借贷机构名义利率显示，大部分年化利率均保持在12%～22%。</p><p>　　业内人士指出，这些跑路的平台，有的是一开始就想欺诈，有的是管不住自己的风险。给投资者的投资利率太高，但哪有那么多高回报的投资项目？</p><p>　　风险也来自一些创新业务。徐红伟提供的数据显示，新平台首月平均借贷周期比旧平台显著缩短，其借贷周期主要分布在1~3月。徐红伟介绍，早期以人人贷为代表的传统老平台，如果借款者的需求为3个月或者6个月，它们就会发3个月或者6个月的标，但在目前市场竞争激烈的情况下，新平台上线不光对金额进行拆分，同时对期限进行处理，“拆标”成了行业新名词。但“拆标”会带来平台流动性风险的问题，比如，钱借出去3个月，但平台发1个月的标，如果投资人要提前兑付，平台就可能出现流动性风险。</p><p>　　“我们认为目前市场上合适的回报率最多在15%左右，高于这个比例，资金的融资成本就太高了。”有利网CEO刘燕南表示。</p><p>　　“未来洗牌后，最终可能只剩下几十家网贷平台。”徐红伟说。</p><p>&nbsp;</p><p>　　<strong>各路资本角逐</strong></p><p>　　但是眼下，入场者仍蜂拥而至。</p><p>　　在“硅谷对话北京：2013互联网金融创新峰会”间隙，Lending Club首席风险官陈超美向记者透露，未来业务拓展会进入中国。</p><p>　　而据彭博社的Air Levy报道，11月14日，Lending Club再次获得俄罗斯亿万富翁Yuri Milner 的DST投资公司和基金管理公司Coatue Management LLC的5700万美元。这是继半年前获得Google领投的1.25亿美元，估值15.5亿美元之后再度获得巨额融资，至此，Lending Club估值升至23亿美元，比半月前估值增值48%。相较获得Google融资的5月份，10月份的Lending Club的月新增贷款规模已经增长了50.7%。</p><p>　　在Twttier上市之后，Lending Club现在是美国私有市场估值最高的公司。</p><p>　　目前在国内，LendingClub已经与点融网有所合作，后者的启动资金来自LendingClub的风投机构，因此二者在技术、理念和人员上多有交流。“我们的技术团队来自于他们。”点融CEO郭宇航说。</p><p>　　不仅国外模式想挤进来，在国内的互联网巨头中，涉足P2P 的传闻也不断</p><p>　　10月16日，阿里巴巴的小微金融研究院院长陈达伟表示阿里巴巴也可能会尝试P2P。</p><p>　　11月13日，有消息称，阿里巴巴旗下的阿里金融将战略投资P2P平台拍拍贷，交易规模在3500万美元左右。虽然阿里巴巴和拍拍贷CEO张俊均向记者否认了上述消息。不过，张俊表示，目前的确有与多家机构谈战略合作， “年内会有消息”。</p><p>　　另一边，腾讯入股人人贷的传言也在被各大网站转载。记者向人人贷创始人张适时求证，其通过公关负责人表示，“日前，在网络上传出了腾讯将收购人人贷的相关新闻，此消息为不实新闻。刚刚结束的三中全会对金融创新予以了肯定，人人贷会坚持一直以来的发展策略，并保持良好的发展势头。”</p><p>　　“创业的人都会被问一个问题：腾讯要做的话，你怎么办？但是你看，歪歪也上市、唯品会也上市，所以这是一个伪命题。” 张俊说。</p><p>　　张俊认为，大的公司有其自身的问题。“他们有太多可以做的事情，他们会去做权衡。对我们来说，我们所有的鸡蛋就这么一个，我们全部的精力就是想办法把她孵出来，阿里百度有那么多的鸡蛋，他们的集中度不一样。”</p><p>　　“对我们来说，就是要迅速地做得更快、迅速地扩大市场，尽可能在某一个方面做到极致，巨头进来了也不要去害怕。”张俊说。</p><p>　　“中国是一个金融压抑特别强的国家。30年前连商业银行都没有，金融需求极大，但大部分的金融需求得不到满足。P2P满足了这部分市场，是民间借贷阳光化的体现，同时也让资源配置效率极大提高，钱不再在金融系统中空转了，进入了实体经济。”有利网CEO刘雁南说。</p><p>&nbsp;</p><p>　　<strong>交锋未来</strong></p><p>　　伴随着互联网入侵金融，以P2P为代表的新金融和以银行为代表的传统金融互联网化不可避免将迎来交锋。</p><p>　　目前网络借贷行业有两股主流力量：</p><p>　　一是传统金融业务的互联网化。它们以招行的“小企业E家”、与平安银行相关的陆金所为代表，标志着传统的金融大鳄入场。并且未来趋势将会有更多金融大鳄入场。</p><p>　　二是民间借贷的网络化。目前上线的网络借贷平台参与者中，数量上有超过90%是来自民间借贷行业的机构和从业人员，这其中包括小贷公司、担保公司，以及民间高利贷等。</p><p>　　民间的P2P平台对金融大鳄的进入表现出欢迎的姿态。相同的看法是：“银行加入进来，可以培养出更多的P2P投资人，蛋糕做大了，大家都得利。”</p><p>　　“招行试水P2P，是想占一块天地，他是想拿这个跟大银行竞争。与大银行相比，招行没有物理网点优势，这样做是在变相地利率市场化，抢大银行的资金。”万惠投融CEO陈宝国说。</p><p>　　陈宝国表示，并不害怕银行进场踢球。“第一，大银行做，其实是左右手互博。定期存款利率年化只有3%~4%，活期利率与通胀相比可以说，基本上没有。一个大银行开P2P平台，收益只要给到7%~8%，那储户到你银行来，是存款还是放在平台呢？银行必然要压着成本高的这块发展，因为对他自己而言是没有成本效益的。银行进来，只是赶潮这么一个领域而已。”</p><p>　　“任何人都可以说自己是P2P。招行模式只是一种理财产品变化，与我们P2P没有关系。 P2P应该是小额分散的匹配撮合，他们做的是类资产证券化产品打碎。”郭宇航说。</p><p>　　郭宇航说，一个互联网金融企业的发展，不是靠钱或者用户砸出来的，是要相当多的技术能耗在里面慢慢积累出来。“比如5月份google入股lengdingclub，她没有选择自己做，而选择投资，是一个聪明的互联网巨头的选择。”</p><p>　　“从技术上看，互联网做风控是不如银行。但从本质看，差距很大的。互联网是做小微企业的业务，是被银行体系脱离的那一部分，而这部分需求又很刚性。用大数法则分析，100个人中多少人违约这部分需求也很刚性。互联网有分析数据的能力，可以通过整合数据来分析交易行为，目前很多的数据还是没被开发，还有不少数据在政府部门等。”李明顺说。</p><p>　　目前，国内的主流是对来自国外的P2P模式进行了创新：国内增加了“线下”模式；一些P2P平台直接提供担保；出现涉嫌非法集资的业务模式；传统民间高利贷直接“网络化”。</p><p>　　这些创新业务，带来了良莠不齐的局面。目前，P2P行业处于“三无”状态：无准入门槛、无行业规范和自律、无监管。</p><p>　　但P2P行业自身已开始试图建立行业标准，并寻找外来的监管者已改变整个行业混乱的局面。</p><p>　　陈宝国介绍，广东省互联网金融协会即将挂牌成立；而北京市也在争取成立互联网金融协会，P2P行业即是其中的有效组成板块；此外，中国小额贷款联盟内部也已建立了P2P机构行业自律公约。</p><p>　　在寻求自律之外，监管当局对P2P行业的调研正在密集展开。业内较一致的预测是，未来可能将由地方金融办管理P2P平台。</p><p>　　而对未来可能到来的监管，行业人士多持欢迎的态度，业内普遍认为，有效的监管有利于P2P行业健康可持续的发展。</p><p>&nbsp;</p><p>　　<strong>银行闯入者——招商银行</strong></p><p>　　招行“小企业e家”金融服务平台上，9月17日开始提供类P2P贷款的投融资撮合服务。</p><p>　　对于招行试水，业界认为，其用意与互联网企业争夺P2P平台的高风险收益相比，恐怕大有不同，更可能是基于留住小微客户的意图。</p><p>　　而目前跃跃欲试，意图跟进招行产品的银行，不在少数。</p><p>　　至今，招行名为“e+稳健融资项目”的投融资平台已完成6期项目发行、融资，6个项目全部投满，融资金额已经达1.2937亿元；融资期限均在180天左右；约200个投资人参与出资，最低投资规模为1万元，预期年化投资收益率为6.10%～6.30%。</p><p>　　而第7个线上融资项目也于近期完成，此项目融资金额为1454万元，预期年利率为6.25%。迄今为止招行这个线上贷款平台共融资1.4391亿元。</p><p>&nbsp;</p><p>　　<strong>招行P2P业务对比普通P2P业务</strong></p><p>　　招行P2P业务</p><p>　　融资门槛</p><p>　　融资项目金额从58万元到5000万元不等，起点均为1万元。</p><p>　　利率水平</p><p>　　仅为6个点</p><p>　　责任归属</p><p>　　不对融资项目、融资人归还本息承担任何形式的担保、保证责任。</p><p>　　普通P2P业务</p><p>　　草根的P2P网贷平台，大部分融资项目起点都很低，目前P2P平台最低投资门槛已低至50元起。</p><p>　　约15个点</p><p>　　一般都规定承担担保的责任，即平台对投资人的投资成本进行兜底。</p><p>　　点评：“从业务实质上，招行的P2P服务更接近于资产证券化，银行从事该业务的出发点主要是监管套利，项目来源可能是既有的小微业务，在这一点上与此前互联网企业的P2P实践存在明显区别。”简单地来说，招行试水P2P，并非为了P2P平台做搓合带来的“蝇头小利”，而可能是为了自身的小微贷款需求另谋出路。由于银行额度、存贷比限制，使得银行一部分贷款需求得不到满足，所以通过P2P业务来满足这种需求，还能从中收取一定的手续费，创造一块增量的中间业务收入。</p><p>&nbsp;</p><p>　　<strong>政府试水者——开鑫贷</strong></p><p>　　2012年12月，开鑫贷上线。它的主办单位是江苏省金融办联合国家开发银行。成立之初，它的目标就是：引导民间借贷的健康发展，拓展小微企业融资渠道。它的意义在于，地方政府正在积极探索搞活并规范地方金融发展的道路。</p><p>　　目前开鑫贷运作了11个月，至10月25日为止成交1162笔，投资用户2303人，完成5468笔投资，借入用户734人，通过开鑫贷平台向“三农”和中小微企业投放了交易金额17.56亿元。平台投资人的平均收益率在10.69%，借入人平均成本14.45%（含担保费）。已还款3.79亿元，无逾期贷款。</p><p>简单来说，其运作方式是政府引导、市场运作、IT支撑、网络化服务，采用线上与线下相结合的方式。　</p><p>　　开鑫贷平台做法是不接触客户资金，资金全部通过江苏银行，在江苏银行里开立账户，进行清结算账户。而作为委托资金管理银行的江苏银行是江苏省的地方性商业银行。</p><p>　　至于P2P行业讨论热烈的“线上”“线下”模式，开鑫贷都采用了：在“线上”，出借人和借款人通过互联网提交资金信息在网上进行撮合；在“线下”，通过遍及江苏全省的小贷公司提供贷前调查、贷后跟踪、贷款担保等服务。</p><p>&nbsp;</p><p>　　<strong>开鑫贷——如何让资金对接实体经济</strong></p><p>　　项目规定</p><p>　　开鑫贷平台鼓励和引导民间富裕资金流向三农和小微企业，支农支小。平台最高借款额为300万元。目前，开鑫贷平台平均借款额度为145万元，最小借款额度2万元。</p><p>　　利率规定</p><p>　　开鑫贷规定借款利率不得超过11%，出借人利率收益空间保持在8%~11%，这最终确保了借款个人或中小微企业的综合融资成本不高于15%——其中的11%作为利率，剩下4%左右是服务费。</p><p>　　风险管控</p><p>　　平台上的项目是由江苏省优秀的小贷公司推荐自身的客户。而江苏金融办的管理办法规定，对参与开鑫贷平台融资的小贷公司有严格准入标准，并建立风险准备金制度。事实上，目前江苏省500多家小贷公司，但只有50家A级以上小贷公司允许开展开鑫贷业务。</p><p>　　江苏省有信息管理系统，同时还有自动量化评级，再加上现场考察定性化评级，总体起来给小贷公司评A、B、C三级。用这种方式选出50家小贷公司。其后，在这50家小贷公司的有限资金放完了后——所有的小贷公司都受困于资金来源不足难题，这些小贷公司可推荐自己的客户到开鑫贷平台上借钱。</p><p>　　此外，开鑫贷与银行合作研发在线资金结算和电子合同合法性签约模式，在技术上确保无操作盲点，以此来防范平台自身的道德风险。</p><p>点评：在整个融资过程中，开鑫贷平台仅承担中介作用，不涉及任何筹资、承诺还本付息等担保行为，平台人借出人和借入人直接签约。一直研究P2P行业的中国小额信贷联盟理事长杜晓山对开鑫贷平台给予高度评价，“因为是国开行和江苏省金融公司做的，不一定完全适用于商业性的P2P网贷公司，但是思路是可以参考的。”</p>', 'admin', 1385347154, 338, '', '', 0, 0, 0, 0, 0),
(86, '温州民间借贷首获合法身份 利率上限未能突破', '', '', '<p>　　上报稿中年化利率最高不得超过48%的规定未获通过</p><p>　　一直处于灰色地带的民间借贷，终于通过一部地方法规，首次获得了合法身份。</p><p>　　11月22日，浙江省十二届人大常委会第六次会议正式通过《温州市民间融资管理条例》(下称《条例》)，对允许企业进行定向债券、定向集合资金融资，并对大额民间借贷边界、监管主体进行了相应规定，并通过强制备案方式进行监管。</p><p>　　“这次立法对民间借贷的发展具有重要意义，以后民间借贷将有法可依，居民企业都可以昂首挺胸地去借贷。”《条例》推动者之一、温州中小企业发展促进会会长周德文对《第一财经（微博)日报》记者说，此次立法，对推动民间借贷合法化、阳光化、规范化具有重要意义。</p><p>　　而此前备受关注的民间借贷利率上限，并未在《条例》中出现，规定不得违反国家有关利率限制的规定。</p><p>　　<strong>利率限制模糊表述</strong></p><p>　　此次浙江省人大常委会审议通过的《条例》共七章50条，涉及民间借贷方式、民间融资服务主体、风险防范和处置、监管等多个方面，完成向全国人大常委会、最高人民法院和最高人民检察院、央行、银监会等报备程序后，将于2014年3月1日起实施。</p><p>　　对于民间借贷危机爆发之后，仍然深陷融资困境的温州中小企业而言，《条例》无疑开启了一扇全新的融资之门。《条例》规定，企业因生产经营需要，可通过非公开方式向合格投资者进行定向债券融资，融资后企业资产负债率不得高于70%；民间资金管理机构则可通过非公开方式，向合格投资者募集不超过净资产8倍的定向集合资金，用于特定生产经营项目投资。</p><p>　　“这次立法的最大突破之一，除了使民间借贷合法化之外，拓宽了企业融资渠道，并且把间接融资和直接融资结合起来。“周德文说。</p><p>　　而作为上述规定的配套措施，《条例》规定，温州还将设立资金管理、融资信息服务、行业服务机构等三类民间融资服务机构，分别从事定向集合资金募集管理、供求资金撮合及理财产品推介、民间融资行业服务，以满足不同借贷人的需求。</p><p>　　按照《条例》，地方金融管理部门、民间融资服务机构工作人员，将被禁止参与民间融资活动。周德文认为，以前温州民间借贷里面就有公务员和金融从业人员的身影，通过上述规定，可以防止权力寻租产生的不公平现象，并防止因套利而产生的金融机构资金体外循环风险。</p><p>　　最值得注意的是，此前备受关注的民间借贷利率上限，并未在《条例》中出现，仅规定利率由借贷双方协商确定，但不得违反国家有关利率限制的规定。今年9月，温州在上报稿中曾规定，一月期以上的民间借贷，年化利率最高不得超过48%，超过则按高利贷予以行政处罚。</p><p>　　“最初起草时确实设置了一个利率上限，而且浙江内部讨论时已经通过了，但上报中央有关部门后引起了一些争议，并且明确要求修改。”48%的利率上限，已经突破央行最高利率规定，并且会对高利贷形成正面导向作用，所以最终采用了模糊表述。</p><p>　　“对民间借贷进行立法，本来就有遏制高利贷的考虑，如果明确规定利率上限，非常容易引起误解，变成了鼓励高利贷。”周德文说。</p><p>　　<strong>促进民间借贷阳光化</strong></p><p>　　如何对规模庞大、频繁发生且多处于地下状态的民间借贷实现监管，是摆在监管层面前的重大难题，而此次通过的《条例》对此亦有所突破。</p><p>　　《条例》规定，单笔借款金额300万元以上、累计借款1000万元以上、向三十人以上特定对象借款，均属大额民间借贷；凡涉及上述情形之一，借款人都应当自合同签订之日起15日内，将合同副本报送地方金融管理部门或者其委托的民间融资行业服务机构备案。</p><p>　　在温州，以“抬会”等古老形式吸收资金放贷，并酿成危机屡见不鲜。而为了防止此类现象的发生，《条例》明确规定，出借人应以自有资金出借，双方签订书面合同，不得非法吸收、变相吸收公众资金或者套取金融机构信贷资金，用于借贷牟取非法收入。</p><p>　　“整个借贷过程都要进行文本程序，通过备案，监管部门可以对出借人有无借贷能力、资金来源是否合法等进行监管，能够及时掌握借贷双方的实际情况，便于兼顾处置。”周德文说。</p><p>　　实际上，备案制亦有将民间借贷阳光化的考虑。今年9月，浙江省金融办主任丁敏哲也曾表示，民间借贷地下运行，政府部门无法了解具体情况，通常只能在事发后才能介入，这也是近年来温州民间借贷隐患爆发，却难以事先防范的重要原因，而通过强制备案，可以便于政府掌握民间借贷的运行状况。</p><p>　　《条例》规定，若违反上述规定，且地方金融管理部门责令仍逾期未改，将对自然人借款人处以1万元~5万元罚款，企业和其他组织借款人则处以3万元~10万元罚款。</p><p>　　但值得注意的是，去年3月，温州成立民间借贷登记服务中心，对民间借贷进行登记，但该中心成立后，虽然登记资金规模庞大，但实际交易量却颇为冷清。而对于规模庞大的民间借贷资金而言，上述处罚约束力似乎有限，而这恰恰也是温州需要面临的重大考验之一。</p><p>　　“原来没有法律，缺乏相应规定作为约束，所以不能强制登记，处理起来通常都跟政策环境有关。现在有了规定，就等于有了法律保障。”周德文认为，此次立法虽然仍有遗憾，但在将来民间借贷发生纠纷时，备案材料可以作为其合法性的重要依据，从而得到法律保护，否则将面临着很大的法律风险。</p>', 'admin', 1385346361, 338, '', '', 0, 0, 0, 0, 0),
(85, '三中全会后扩内需首子落地 消费金融公司试点大扩容', '', '消费金融,贷款用途,扩内需', '<p>　　在拉动经济增长的“三驾马车”中，消费对中国经济发展的作用越来越大。党的十八届三中全会已经勾勒出中国新一轮经济改革的蓝图。在当前宏观经济增速放缓的形势下，持续有效地扩大内需已成为各界共识，也是金融业改革等议题的着眼点。自2010年试点开始，“消费金融”试点已证明了其普惠大众，拉动内需增长的活力。11月22日，银监会公布修订后的《消费金融公司试点管理办法》，进一步拓宽了消费金融公司资金来源，放宽了发展空间。</p><p>　　开辟金融服务新天地，促进消费稳增长。中国的消费金融要探寻一条怎样的道路，又怎样从试点一步步走向成功，且让我们拭目以待。</p><p>　　11月22日，银监会公布修订后的《消费金融公司试点管理办法》（以下简称《办法》），进一步拓宽了消费金融公司资金来源，放宽了发展空间。此前，银监会已经宣布新增10个城市参与消费金融公司试点。</p><p>　　银监会表示，此次修改是为了贯彻落实2013年7月1日《国务院办公厅关于金融支持经济结构调整和转型升级的指导意见》。该《意见》要求“逐步扩大消费金融公司的试点城市范围，培育和壮大新的消费增长点。”</p><p>　　就在银监会公布上述《办法》的同一天，商务部也召开了扩内需会议。</p><p>　　长江商学院金融学教授周春生对《每日经济新闻(微博)》记者表示，中国消费金融才刚起步。在国外，消费金融增强了消费者的支付能力，虽然不好量化，但消费金融对推动消费应该起了重要作用。</p><p>&nbsp;</p><p>　　<strong>试点初衷即为“扩内需”/</strong></p><p>　　在拉动经济增长的 “三驾马车”中，投资的效果越来越弱，出口由于欧美经济复苏不稳定以及经济发展战略的调整，也难现往日辉煌。消费对中国经济发展的作用越来越大。</p><p>　　首都经济贸易大学统计学院院长纪宏近日指出，中国GDP的构成份额中，最终消费的占比2013年已经达到了50%。而美国则占80%以上，近几年接近90%。最终消费由政府消费和居民消费构成，对比中美两国最终消费情况，中美两国政府消费非常接近，最大的差距是居民消费，2011年美国的居民消费占到GDP的70%，中国是35%左右，相差了一半。</p><p>　　周春生对《每日经济新闻》记者表示，中国整体消费需求在稳步增长，但消费占GDP的比重没有显著提高。原因很多，如果财富分配越均匀，消费就越高。社会保障体系也有待完善，看病、买房子、孩子上学等是中国的家庭重要支出准备项目，国民储蓄率高。</p><p>　　在其他条件短时间内难改变的情况下，信贷对于消费和扩内需的推动作用不容忽视。</p><p>　　“从国外情况来看，消费金融是金融重要组成部分。中国这方面发展一直相对比较滞后，原来一直服务的对象是企业，传统消费金融主要局限于汽车等。国外消费金融涵盖广泛，包括电子类和一般家庭消费等，一些大型企业，包括财务公司，也都可以提供消费金融。金融公司提供类似服务更是普遍，提供的消费金融远超国内的企业。”周春生表示。</p><p>　　事实上，中国的个人消费贷款增速也高于贷款的平均增速。</p><p>　　据银监会年报，截至2012年底，银行业个人消费贷款余额为10.4万亿元，比年初增加1.6万亿元，同比增长17.6%。而2012年末，本外币各项贷款余额为67.3万亿元，比年初增加9.1万亿元，同比增长15.6%。</p><p>　　2013年7月1日，国务院发布《关于金融支持经济结构调整和转型升级的指导意见》。《意见》总共十条，其中一条为 “进一步发展消费金融促进消费升级”，提及消费金融公司的表述为“逐步扩大消费金融公司的试点城市范围，培育和壮大新的消费增长点。”可见高层对于消费金融公司在促进消费方面还是抱有期望的。</p><p>　　《意见》另一条“扩大民间资本进入金融业”中，亦有提及消费金融，“尝试由民间资本发起设立自担风险的民营银行、金融租赁公司和消费金融公司等金融机构。”民资的进入，将扩大消费金融公司的资金来源，消费金融公司将进一步壮大。</p><p>　　早在2009年最初的 《消费金融公司试点管理办法》公布时，银监会就表示，启动消费金融公司试点的原因是为了贯彻落实党中央、国务院“保增长、调结构、促改革、惠民生”的宏观经济政策，加大金融对扩内需促消费的支持力度，促进经济平稳较快增长和可持续发展。</p><p>　　<strong>低收入家庭占比较高/</strong></p><p>　　2010年首批4家消费金融公司成立以来，其发展情况并未得到业界太多关注。由于试点少、规模小，对于内需扩大的直接效应不太明显。</p><p>　　去年11月27日，时任中国银监会副主席蔡鄂生在天津表示，截至2012年10月底，北京、天津、上海和成都的4家试点消费金融公司资产总额达40.16亿元，同比增长126.82％；贷款余额为37.09亿元，同比增长197.98％。4家公司客户总户数达19万多人。</p><p>　　《每日经济新闻》记者从北京的北银消费金融公司、上海的中银消费金融公司、四川锦程消费金融公司、天津的捷信消费金融公司等现有4家消费金融公司了解到，目前其贷款用途主要是家用电器、电子产品、家具等各类耐用消费品，以及教育、旅游、婚庆、装修等，房、车类贷款目前不允许。</p><p>　　刚公布的修订版《消费金融公司试点管理办法》中，仍规定“本办法所称消费贷款是指消费金融公司向借款人发放的以消费（不包括购买房屋和汽车）为目的的贷款。”</p><p>　　尽管此次银监会修改《消费金融公司试点管理办法》在贷款用途上没有大的突破，但是在地域限制、民资成为主发起人、吸收股东存款、贷款上限由“借款人月收入5倍”修改为“20万元人民币”等方面都实现了突破，而这些方面也正是此前试点消费金融公司在实践中的困难和问题。</p><p>　　从消费金融公司服务的客户来看，低收入家庭占比较高，对于促进消费、扩大内需的作用不容忽视。</p><p>　　以北银消费金融公司为例，该公司今年2月透露，其3年来努力打造差异化运营模式，在提高中低收入百姓生活水平、促进消费增长、创造和谐社会方面做出积极贡献。目前公司客户平均贷款金额5万元；贷款客户中，年收入低于3万元的家庭占比达60%以上。</p>', 'admin', 1385345694, 338, '', '', 0, 0, 0, 0, 0),
(81, '人们热衷于网贷的五大理由', '人们热衷于网贷的五大理由', '网贷 ', '<p>　　之前，我们做过一次阅读调查，调查读者们热衷于网贷的各种理由，根据大家的回应，我最终把他们归类为以下5个标题。</p><p>　　一、道德至上 (6 条回复): 最让我欣慰的是，人们热心于网贷的首要原因是为了帮助那些真正需要资金去解决问题的人。这些投资人往往把赚钱排在第二位！</p><p>　　二、收益 (6 条回复): 能赚到大量的钱（平均收益在7~15%之间）是大家给的两大主要原因中的另一个。</p><p>　　三、网贷是未来的发展趋势(5条回复): 很多人乐意投资是因为传统投资渠道变得不可信赖，分散投资才更靠谱！</p><p>　　四、绕开银行 (4条回复):有趣的是，人们对网贷保持兴趣的一大理由竟然是对抗现存的金融机构，投资人们好像在为技术将要超越一向不可撼动的银行而幸灾乐祸。</p><p>　　五、有主动控制感及风险低 (1 条回复):另外两个理由是，一，感觉到掌握了操控自己资金的主动权，网贷不像在股票市场中那样难掌控；二， 感觉投资风险较小。</p>', '盛世汇盈客服站站', 1385091050, 338, '', '', 0, 0, 0, 0, 0),
(84, 'P2P网贷：监督比监管更重要 优胜劣汰是必然选择', '', 'P2P网贷', '<p>　　最近的3年里，P2P平台数量和成交量分别以400%、500%的速度增长。</p><p>　　“这是一个最适合屌丝创业的行业，它让金融创业门槛降低，变得屌丝能‘够得着’。”软交所副总裁罗明雄说。</p><p>　　迸发速度与激情的同时，P2P网贷却也伴随着众多投资者维权无门的纷杂和争议。就在刚刚过去的2013年10月份， 这个才冒起的行业内，已核实出现或疑似出现提现困难的平台达到了22家。不断出现的跑路、虚假标、高息标、拆标、老赖等现象，暴露出我国当下P2P网贷行业的“三无”乱象：无准入门槛、无行业标准、无监管机构。</p><p>　　近期，有关互联网金融政策待出的消息在业界流传，消息中仍颇为玩味的信息是——银行或是监管政策的助推手。</p><p>　　日前，中国人民银行金融消费权益保护局局长焦瑾璞公开表示，互联网金融给金融消费权益保护带来了新的挑战。</p><p>&nbsp;</p><p>　　<strong>银行失血</strong></p><p>　　2013年，P2P网贷平台开始进入加速生长期，“现在每天增加3~4家，一个月要上线100家平台，预计到今年年底全国网络借贷平台会突破800家。”网贷之家负责人徐红伟在此前接受《中国经营报》记者采访时说。</p><p>　　“行业上半年还是负面情绪，下半年则是正能量。”万惠投融董事长陈宝国承认6月份余额宝上线并热卖对P2P网贷行业起到了加速度的作用。</p><p>　　去年“双12”才上线的万惠投融也是从那时起开始了加速增长。“余额宝教育了投资者，网上理财也是可以赚钱的。”</p><p>　　在入场者增多的同时，P2P网贷行业的放贷规模也在急速增长。“去年是200亿元，今年有望增长十倍到2000亿元，会不会明年上万亿元呢？”好贷网CEO李明顺说，目前整个银行贷款市场一年十多万亿元规模，互联网通过几年把银行几十年做的颠覆掉。</p><p>　　“3~5年后，10万亿元指日可待。”陈宝国说。</p><p>　　这似乎也让传统金融大鳄——银行感受到了威胁。近期，包括招行、平安、农行和浦发等银行都有试水P2P的动作或者传言。</p><p>　　“实际上，P2P网贷冲击的并不是银行的信贷业务。真正对他们的冲击在理财端。你看上市银行报表可知，银行20%~30%的收益来自于理财业务。”安家世行CEO杨大勇说。</p><p>　　包含P2P网贷在内的互联网金融创新，对银行业所带来的冲击正在显现。</p><p>　　近日，央行发布的金融统计数据报告显示，今年10月，我国住户存款减少8967亿元。其中三季末建行存款余额较二季度末环比减少334 亿元，活期存款更是减少了661亿元。</p><p>　　另据媒体报道，截至10月27日，四大行存款负增长1.29万亿元。</p><p>　　上述接近监管的人士称，“华夏、民生等多家银行近期一直在跟银监会吐苦水。它们觉得包含P2P网贷、余额宝、百发等在内的互联网金融创新其实是监管套利，它们感到压力很大。”</p><p>　　“这些银行的诉求点是，如果监管放开让它们也可以做，它们能做得更好。”上述人士说。</p><p>　　据网贷之家的统计显示，2013年以来，有近50家的P2P平台倒闭或预警。其中不乏经营不善而倒闭的，也有恶意跑路的。</p><p>　　对于网贷平台的冲击，央行在关注，在观察，同时动作也频频。</p><p>　　7月1日，央行副行长刘士余在北京召开“网络信贷专题座谈会”时称，对于网贷记录纳入央行征信系统，并允许网贷企业查询，央行研究后将上报国务院。</p><p>　　8月初，由央行征信中心控股的上海资信宣布，全国首个网络金融征信系统正式上线，网贷企业征信数据将在该系统上实现共享。业内人士分析指，这将为以后网络借贷纳入央行征信做前期准备。</p><p>　　10月14日，由刘士余带队的互联网金融发展与监管研究小组上午在深圳腾讯总部，下午赴中国平安集团和招商银行调研。据悉，此次调研重点是P2P网络借贷，且延续之前调研风格，只聆听不表态。</p><p>　　中国社科院数量经济与技术经济研究所副所长何德旭日前透露，互联网金融已经引起监管层的重视，中国人民银行成立了专门研究小组对全国互联网金融状况进行分析调研。“相关的调研报告已经提交，未来很可能会在国务院层面出台监管政策。”消息人士称。</p><p>&nbsp;</p><p>　　<strong>“婆婆”是谁？</strong></p><p>　　事实上，虽然银行想找“婆婆”做主，但到底谁来监管P2P行业仍然是一个多方角力的过程。</p><p>　　截至目前，对P2P网贷平台“喊话”的监管部门仅有银监会。2011年8月，银监会曾下发一份《关于人人贷有关风险提示的通知》，提示P2P贷款平台具有潜在风险，要求各地银监局和各家银行采取措施，做好风险预警监测与防范工作，但未有具体的监管措施。</p><p>　　“监管层其实比较犹豫，是像第三方支付一样，放央行；还是类似小贷公司，放地方金融办呢？如果由当地金融办管，它管不了全国的事，央行又管不了当地的事。这怎么办呢？”陈宝国说，现在由谁来管，还是一个未知数。</p><p>　　前述接近监管的人士也表示，到底由谁来管还是一个待定的命题。“银监会自己那么多家银行都管不过来，不想管也没有能力管，但是商业银行受到威胁了，感到委屈了，来找银监会做主，这也让银监会很纠结。”</p><p>　　“P2P网贷现在是工商注册即可，拿的多是咨询公司执照。从这个角度说，银监会或者央行也没有监管的权力。”一位业内人士说。</p><p>　　江南愤青撰文称，P2P目前这种完全游离在监管之外，却又扮演了金融机构的角色，是不正常的情况，最终伤害的是P2P整个行业。</p><p>　　“定义为金融机构，就必须要纳入监管，因为金融机构的本质其实就是扩杠杆，拿人家的钱放贷，它最终是要对大量投资人负责的，因此普遍上世界上所有的金融机构都面临着强监管。”他说。</p><p>　　“行业舆论分两种，一种说让P2P网贷再飞一会儿，也有人说赶紧管，但是其实国家没有这个能力，因为监管主体还没定，这其中还需要时间，目前是监管空白期。”陈宝国说。</p><p>　　“其实P2P网贷平台经营的门槛不低。你看现在倒闭的P2P，上半年以前一共才十几家，下半年到现在已经26家，这26家加上以前的，99%都是老板先进监狱。”翼龙贷CEO王思聪表示，P2P跟电商不一样，如果倒闭、清盘，涉嫌骗取投资人的资金，就得进监狱。</p><p>　　“任何企业的倒闭都会产生一系列社会问题，金融必须要有特别强的保护，因为复杂的金融产品老百姓不了解。”点融网CEO郭宇航说。</p><p>　　陈宝国则认为，P2P网贷一定要有门槛，要把其当作一个金融企业来管。“监管可以结合第三方支付与地方金融办特色，即地方化又网络化。”</p><p>&nbsp;</p><p>　　<strong>怎么管？</strong></p><p>　　“今年8月发起互联网金融千人会，请到刘士余揭牌，刘行长说了一句话：针对互联网金融的监管未来的思路应该是‘监管变成监督’，这个也是代表行业进步的方向。”李明顺说。</p><p>　　郭宇航曾撰文说明，P2P网络借贷在交易撮合方面类似房地产中介，从信用分析和评估的角度看，接近评级公司。和商业银行不同，P2P提供的中介咨询服务，属于金融信息服务业，因此不适用于资本充足率、风险保证金比例等金融机构的监管要求和市场准入标准。“虽然有一些平台倒闭出现，但不能因此而扼杀创新，设定太多的门槛。” 郭宇航说。</p><p>　　“我们的存在取代了高利贷市场，高利贷的存在是因为信息不对称，有资格借钱的人不知道我们的存在，在海量不认识的人之间把资金做有效化的配置，把整体民间借贷成本降低。”郭宇航建议，国家出台创新金融监管的时候，应该考虑金融创新企业的实际情况和实际发展规律，不能像管传统金融企业一样用准备金去管，这一管就死。</p><p>　　郭宇航认为，投资者教育是一个非常重要的环节，“ 对2P平台来说，就是要透明化资金的用途、投资人的信息等，而不是卖‘打闷包’的理财产品。”</p><p>　　“政府应该‘放水养鱼’，让P2P网贷发展一些时间，待交易有一定的积累后，你可以回溯来看他的历史交易记录。在这个过程中，你可以看风控水平、坏账率发生以及整个操作流程的规范，在这个基础上实行‘反向监督’。”</p><p>　　郭宇航举例称，比如，在过去一年中，坏账率在政府监管指标之下的，可以多发给几年的运营资质等。“对一家初创企业特别是这样新型的企业，一开始设ABCD，就没法干了。可以学习对第三方支付行业的监管，第三方支付整个监管流程，最终是让第三方公司来参与制定监管细则。由监管层来拍脑袋将是行业灾难。”</p><p>　　“‘监督’比‘监管’可能更加重要。互联网创新是非常发散的，如果在行业刚开始的时候就限定哪些能做哪些不能做，会扼杀创新。比如马化腾做微信，一定不是自上而下的，而是自下而上的。现在金融产品的出现很大问题就是需要主管部门批复才能发，这种方式对互联网行业会起到不好的影响，创新会受到很大的制约。”李明顺说，监管应该是底线原则，即我们的政策要制定的是“什么不能做”，而不是“能做什么”。</p><p>　　“现在对P2P网贷的问题，舆论有点‘出事论’。这中间的确是有良莠不齐的情况存在， 监管当局多次调研，也是非常审慎的。”杨大勇认为，监管不是要一把抓，要用市场的力量来优胜劣汰。</p><p><br />　　“我们大多数的平台更多的都是正能量发展，传递的是正能量。推动的是小微企业融资， 解决的是普通老百姓的投资理财需求。”陈宝国认为，应该从市场需求看P2P网贷的监管问题。“小部分的违法行为有国家法律惩治，行业的行为就是市场的行为，优胜劣汰是必然的选择。”</p><p><br />　　<strong>监管之惑</strong></p><p>　　我国当下P2P网贷行业面临“三无”窘境：无准入门槛、无行业标准、无监管机构。</p><p><br />　　<strong>现状：</strong></p><p>　　P2P平台以咨询公司为名进行注册，但从事的是类金融业务。</p><p>&nbsp;</p><p>　　<strong>未来监管猜想</strong></p><p>　　类第三方支付——央行管辖</p><p>　　类小贷公司——地方金融办管辖</p><p>　　类银行——银监会管辖</p><p>　　或者，第四种选择</p><p>　　考虑互联网金融特性的“底线原则”&nbsp;</p>', 'admin', 1385345466, 338, '', '', 0, 0, 0, 0, 0);
INSERT INTO `gica_z_article` (`id`, `title`, `art_info`, `art_keyword`, `art_content`, `art_writer`, `art_time`, `type_id`, `art_url`, `art_img`, `art_userid`, `sort_order`, `art_click`, `art_set`, `art_attr`) VALUES
(83, '谷歌入股美国网贷领先者Lending Club', '谷歌入股美国网贷领先者Lending Club', '网贷', '<p style="padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 2em; margin: 0px 0px 15px; padding-left: 0px; padding-right: 0px; font: 14px/18px ''microsoft yahei'', arial, helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(51,51,51); word-spacing: 0px; padding-top: 0px"><span style="font-family: microsoft yahei; font-size: 16px">2013年5月1日，Lending Club宣称谷歌在其与风投公司Foundation Capital对Lending Club的1.25亿美元的投资中占了很大一部分，该快速增长的估值达15.5亿美元。Lending Club CEO雷诺·拉普兰赫（Renaud Laplanche）表示，谷歌以“二手”交易方式投资Lending Club（ “二手”交易方式意味着这1.25亿并不会流入Lending Club的金库），一些现有的股份持有者将他们不超过20%的部分股份出售给了谷歌和Foundation Capital。谷歌将获得Lending Club的少数股权，谷歌高管大卫·劳威（David Lawee）将作为观察家加入后者的董事会。</span></p><p style="padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 2em; margin: 0px 0px 15px; padding-left: 0px; padding-right: 0px; font: 14px/18px ''microsoft yahei'', arial, helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(51,51,51); word-spacing: 0px; padding-top: 0px"><span style="font-family: microsoft yahei; font-size: 16px">15.5亿美元是个令人印象深刻的数字，上一次Lending Club接受融资是11个月之前的事情， Kleiner Perkins 向它融资了1500万美元，使公司的估值达到了5.4亿美元&nbsp;，而现在的估值几乎是当时的3倍。</span></p><p style="padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 2em; margin: 0px 0px 15px; padding-left: 0px; padding-right: 0px; font: 14px/18px ''microsoft yahei'', arial, helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(51,51,51); word-spacing: 0px; padding-top: 0px"><span style="font-family: microsoft yahei; color: rgb(51,127,229); font-size: 16px"><strong><font size="3">谷歌为什么会接近Lending Club</font></strong></span></p><p style="padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 2em; margin: 0px 0px 15px; padding-left: 0px; padding-right: 0px; font: 14px/18px ''microsoft yahei'', arial, helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(51,51,51); word-spacing: 0px; padding-top: 0px"><span style="font-family: microsoft yahei; font-size: 16px">我很好奇为什么谷歌和Lending Club会相互接近。“谷歌接近我们是因为他们很好奇我们可以中断银行的部分业务,” 雷诺·</span><span style="font-family: microsoft yahei; font-size: 16px">拉普兰赫说道。“在某种程度上，这与谷歌垄断广告业务有些相像——使之更高效、透明，为消费者提供更好的服务。</span></p><p style="padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 2em; margin: 0px 0px 15px; padding-left: 0px; padding-right: 0px; font: 14px/18px ''microsoft yahei'', arial, helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(51,51,51); word-spacing: 0px; padding-top: 0px"><span style="font-family: microsoft yahei; font-size: 16px">谷歌想要参与，但是其实Lending Club并不真正需要筹集额外资本；Lending Club每月都会有营收与负债对照表。因此拉普兰赫就问现有的股份持有者，他们是否愿意出售一些股份，部分人同意了。</span></p><p style="padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 2em; margin: 0px 0px 15px; padding-left: 0px; padding-right: 0px; font: 14px/18px ''microsoft yahei'', arial, helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(51,51,51); word-spacing: 0px; padding-top: 0px"><span style="font-family: microsoft yahei; font-size: 16px">“尽管我们在借款人业务方面有很多不同的观点，但我们会与谷歌一起努力的，”拉普兰赫说道。当我试图就细节进一步与其探讨时，他只是腼腆地说道“有些比合并借款人更雄心勃勃的想法。”很难理解这句话的确切意思。谷歌已经将它的手伸向了很多领域，今后会如何发展，我们拭目以待。</span></p><p style="padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 2em; margin: 0px 0px 15px; padding-left: 0px; padding-right: 0px; font: 14px/18px ''microsoft yahei'', arial, helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(51,51,51); word-spacing: 0px; padding-top: 0px"><span style="font-family: microsoft yahei; color: rgb(51,127,229); font-size: 16px"><strong><font size="3">稳步走向主流</font></strong></span></p><p style="padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 2em; margin: 0px 0px 15px; padding-left: 0px; padding-right: 0px; font: 14px/18px ''microsoft yahei'', arial, helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(51,51,51); word-spacing: 0px; padding-top: 0px"><span style="font-family: microsoft yahei; font-size: 16px">谷歌是全球最引人注目和最有价值的公司之一。对于P2P网贷行业来说，一个全球领先的公司入股Lending Club是个大新闻。这巩固了Lending Club在全球P2P网络借贷领域领先者的地位，并且P2P网贷向主流社会又迈进了一步。</span></p><p style="text-align: right; padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 2em; margin: 0px 0px 15px; padding-left: 0px; padding-right: 0px; font: 14px/18px ''microsoft yahei'', arial, helvetica, sans-serif; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(51,51,51); word-spacing: 0px; padding-top: 0px"><span style="font-family: microsoft yahei; font-size: 12px">By&nbsp;PETER RENTON&nbsp;on&nbsp;MAY 1, 2013&nbsp;&nbsp; From LENDACADEMY</span></p>', '盛世汇盈客服站站', 1385102995, 338, '', '', 0, 0, 0, 0, 0),
(88, '为什么P2P网贷不是低门槛行业？', '', '', '<p><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">网友飘飞的柳絮：</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">P2P网贷很火，回报率非常吸引人，有的据说年化收益率可达20%。一边是做P2P网贷的公司非常多，让人想起几年前团购的热闹景象。另一边则是近期开始看到媒体报道越来越多的P2P网贷公司倒闭。如何看待P2P网贷的竞争门槛？</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">腾讯科技：</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">P2P行业进入门槛看似很低，但要在这个行业生存下去并健康发展的门槛却不低。</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">进入门槛的确很低</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">P2P网络借贷弥补了银行所没有覆盖到的小额借贷市场，吸引了很多创业者的目光。其本身的运作模式非常灵活，而且投资周期可选择，普遍宣称收益很高。借款方无需抵押担保即可获得资金。</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">1、P2P网贷公司成立的门槛很低，建个网站，然后去工商部门注册下，公司就可以运作了。而很可能公司没有足够的资金储备、没有专业的项目评估人才和完善的投资流程，造成潜在的隐患。同时这类公司又不属于金融机构，因此不受到相关法律法规的制约，监管上也是空白地带。</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">2、突出表现为，今年以来新进入的P2P网贷公司越来越多。甚至只要花几千块钱，买一个模板，就可以做P2P了。</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">所以，目前出现了很多对互联网没有概念，对金融也不懂的人也纷纷冲进这个行业。这些都促成了P2P行业形式上的火爆。</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">运营门槛的确不低</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">P2P网贷公司作为平台方，其主要的作用是“牵线搭桥”，公开信息，保证投资者的知情权，保障投资者和借款方的及时有效沟通。</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">做好P2P网贷，必须要有足够的投资人、放贷人。要有足够数量的优质借款人。对金融风险的防控，和互联网技术能力。</span><br style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px">同时，不管是金融端还是互联网端，P2P网贷对运营的能力要求都非常高。一方面，要让没有见过的投资人相信能通过平台完成投资；另一方面，还要让素未谋面的借款人通过平台借钱，并且有能力还钱。</span></p>', 'admin', 1385444220, 321, '', '', 0, 0, 0, 0, 0),
(89, 'P2P与银行并肩服务小企业', '', '', '<p>&nbsp;</p><table style="widows: 2; text-transform: none; text-indent: 0px; width: 680px; border-collapse: collapse; font: 12px/15px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; empty-cells: show; table-layout: fixed; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" cellspacing="0" cellpadding="0"><tbody style="word-wrap: break-word"><tr style="word-wrap: break-word"><td style="word-wrap: break-word; font-size: 14px" id="postmessage_6900" class="t_f"><p style="text-align: left; line-height: 2em; margin-top: 10px; text-indent: 2em; margin-bottom: 10px"><span style="font-family: 宋体, simsun; font-size: 16px"><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">根据统计数据显示，截至目前，全国P2P网贷企业已经超过500家，而2010年全国总共只有10家，在不到3年时间内，数量增长了50倍左右。据预测，在互联网金融热潮的推动下，未来将有更多新的P2P企业成立，到今年年底P2P企业将有望突破1000家。而这些网贷平台的兴起和发展，无疑将与银行一起并肩协力，更好地服务和满足中小微企业的金融需求。</span><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">P2P发展迅速</span><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">所谓P2P网贷，是指个人通过网络平台相互借贷，贷款方在P2P网站上发布贷款需求，投资人则通过网站将资金借给贷款方。仟帮资都的专家告诉记者，P2P网贷最大的优越性，是使传统银行难以覆盖的借款人在网络世界里能充分享受贷款的高效与便捷。因而，网贷平台以其抵押担保要求松、审核快、放款快等优势对接中小企业“短小频急”的融资特点与难点，赢得越来越多的中小企业及社会各界的关注与认可。</span><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">在互联网金融的浪潮下，P2P网贷平台正在以摧枯拉朽之势闯入企业和大众的经济生活。在监管层政策渐趋明朗之后，P2P网贷可谓欢声一片。个人用户对理财的需求、中小企业对资金的渴望，激发了庞大的市场需求潜力。数据还显示，在P2P企业数量快速增长同时，P2P企业的业务增速也非常惊人。2010年，P2P业务金额为6亿元左右，2011年达到30亿元，2012年则突破200亿元。多家机构预测，2013年P2P金融业务金额将有望达到1800亿元。</span><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">对传统金融的补充</span><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">可以说，P2P网贷平台的出现是对传统金融的有益补充。不难看到的是，在互联网环境下的P2P借贷，给投资人带来的更多是平等、开放、协作、分享的互联网精神，以及较低的交易成本;对借款人而言，带来的则更多是短期小额资金周转的便利。在互联网的激化下，传统金融的高成本难以开展的业务将会变得更加便捷，在传统金融机构融资难的小微企业和个体经营者将获得更广阔的融资渠道，同时这也不会对银行等金融机构形成竞争。</span><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">进一步的，从服务的目标市场来看，银行和P2P平台的竞争也不在一个层面上。前者的业务重点是服务于大企业与国企，而P2P平台更多的是为中小微企业提供贷款服务。</span></span></p></td></tr></tbody></table>', 'admin', 1385444323, 321, '', '', 0, 0, 0, 0, 0),
(90, '小企业主涌进金博会“找钱” P2P及小微贷项目受热捧', '', '', '<p>&nbsp;</p><table style="widows: 2; text-transform: none; text-indent: 0px; width: 680px; border-collapse: collapse; font: 12px/15px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; empty-cells: show; table-layout: fixed; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px" cellspacing="0" cellpadding="0"><tbody style="word-wrap: break-word"><tr style="word-wrap: break-word"><td style="word-wrap: break-word; font-size: 14px" id="postmessage_6900" class="t_f"><p style="text-align: left; line-height: 2em; margin-top: 10px; text-indent: 0em; margin-bottom: 10px"><span style="font-family: 宋体, simsun; font-size: 16px"><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">在北京做建材生意的刘先生昨日一大早就来到了第九届北京（国际）金融博览会现场，不过他此行的目的不是为了体验新金融服务，也不是为了寻找新的投资理财机会，而是想找找适合的融资项目。北京商报记者从昨日开幕的金博会上了解到，小企业主纷纷涌进金博会寻求融资机会，成为了本届金博会的一大亮点。</span><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">“到了年末，我们作为小企业需要进货、付款，有很多需要资金的地方，但是现在的融资渠道比较多，银行、小贷的产品也特别多，想借这个场合来了解了解，看看我们适合通过什么渠道、用什么产品融资。”刘先生说。</span><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">其实昨日抱着像刘先生一样目的来到金博会现场的小企业主或个体户并不在少数，这也使得一些做P2P贷款融资的企业和银行的展台受到热捧，原来更多倾向于投资理财的金博会，今年似乎正在走向小微企业的融资对接并重。</span><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">在本届金博会现场，多家P2P公司备受追捧，在其展区人头攒动，不少驻足咨询的参观者除了有正常理财需求的个人及企业外，还有很多希望通过P2P平台获得融资的企业主。</span><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 14px/21px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 14px/21px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">北京商报记者从一家参展的P2P商那里了解到，他们此行本来的主要目的是展示P2P的投资功能，希望更多的投资者能够参与这种投资方式，可没想到还有很多客户亲自找上门来询问融资的成本、方式和手续问题。</span></span></p></td></tr></tbody></table>', 'admin', 1385444432, 321, '', '', 0, 0, 0, 0, 0),
(91, '监管部门将调研互联网金融网贷平台', '', '', '<p style="text-align: left; line-height: 2em; margin-top: 10px; text-indent: 2em; margin-bottom: 10px"><span style="font-family: 宋体, simsun; font-size: 16px">近期央行和深圳市政府金融办将分别对深圳一些金融机构展开调研，调研行程中，网贷(P2P)平台公司成为重要一站。据了解，全国已上线的网贷平台超过500家，并处于不断增长之中，无门槛、缺少监管带来风险聚集的现状亟待改变。<br style="text-align: left; text-indent: 2em" />调研<br style="text-align: left; text-indent: 2em" />互联网金融机构<br style="text-align: left; text-indent: 2em" />证券时报记者获悉，近日，深圳市金融办将组织深交所、深圳证监局、深圳银监局、深圳保监局等监管部门派出机构赴平安保险、招商银行、国信证券、红岭创投等公司调研，将就互联网金融在深圳的发展基础、发展策略和行动路径向业内了解情况、收集意见。<br style="text-align: left; text-indent: 2em" />据了解，央行原定于9月下旬赴深调研的计划因故延迟，这一计划将于近期重启。央行的调研安排中，网贷平台也成为重要一站。<br style="text-align: left; text-indent: 2em" />网贷资讯平台——网贷之家总经理朱明春对证券时报记者表示，据统计，目前全国网贷平台总数已经超过500家，平均每天都有两家新的网贷平台上线。火爆的互联网金融概念让大量机构和个人加入网贷行业，使得网贷平台出现供大于求的现象，目前大部分网贷平台处于亏损状态，无门槛、缺监管造成的风险在积聚，这一状态亟待改变。<br style="text-align: left; text-indent: 2em" />今年以来，央行在各个场合的表态让不少网贷平台开始明确自身的定位。一位参与了今年7月份央行座谈会的网贷平台创始人表示，央行高层在座谈会中表示不反对网贷平台发展，希望网贷平台做银行的补充，吸引民间资金，服务小微企业。<br style="text-align: left; text-indent: 2em" />据了解，对于建立网贷行业征信系统的课题，央行也在积极研究之中。不过到目前为止，网贷行业仍无明文规范。</span><br style="text-align: left; text-indent: 2em" /><br style="text-align: left; text-indent: 2em" />&nbsp;</p>', 'admin', 1385444521, 321, '', '', 0, 0, 0, 0, 0),
(92, '美国如何监管P2P平台', '', '', '<p style="line-height: 2em; margin-top: 10px; margin-bottom: 10px"><span style="font-family: 宋体, simsun; font-size: 16px">确保消费者有足够保护，是美国金融监管系统的主要目标之一。美国监管者努力采取措施解决借款者和投资者面对的信息劣势，保证他们能够得到足够的信息以做出合适的决定，同时监督商业操作和销售实践以防止欺骗和滥用。<br style="text-align: left; text-indent: 2em" />美国监管体制对于消费者保护主要关注以下三个方面：第一，公平对待所有消费者（主要是投资者）；第二，保护消费者的隐私（主要是借款人）；第三，消费者意识和教育（借款人和投资者双方）。<br style="text-align: left; text-indent: 2em" />美国证券交易委员会（SEC）的注册要求设立了很高的市场参与门槛，有效阻止了那些没有优秀运营模式的新参与者加入。在接受SEC监管之后，P2P（个人网贷）平台每天都要至少一次或者多次向SEC提交报?告。<br style="text-align: left; text-indent: 2em" />这个要求有些时候显得过分，但是，全面的信息披露有很重要的意义。P2P平台需要将每天的贷款列表提交给SEC，保证当有消费者对P2P平台提起法律诉讼的时候，有存档的记录来证明是否存在错误信息误导消费者。这个措施或许可以使消费者在申请贷款时，免于不实信息的误导。<br style="text-align: left; text-indent: 2em" />P2P平台的注册文件和补充材料包含着广泛的信息，例如经营状况、潜在的风险因素、管理团队的构成和薪酬以及公司的财务状况。任何希望成为P2P平台借款人的消费者必须要尝试尽可能多地了解P2P平台，理解P2P借贷内在的风险。消费者有各种途径可以了解到P2P借贷，这有助于他们衡量自身的风险承受度、多样化投资、理智而非盲目地将钱投入到P2P平台或其他贷款当中。<br style="text-align: left; text-indent: 2em" />另外，美国实行按行为监管。<br style="text-align: left; text-indent: 2em" />美国的金融监管机构很少对各种机构的性质进行区分，而是根据各机构的业务采取执法行动。例如，FTC（联邦贸易委员会）对于银行和P2P机构没有明确的管辖权，但是银行或者P2P机构如果采取了法律意义上的“不公平或者欺骗性行为”，FTC就可以采取执法行动。美国的监管机构认为，只要金融机构提供了全面、真实、无偏差的信息披露和风险提示，作为理性人的消费者经衡量后，就可以根据自身情况做出正确的选?择。<br style="text-align: left; text-indent: 2em" />在向SEC登记注册之前，Prosper和Lending Club允许放款人直接购买贷款份额。P2P平台通过Web Bank，以向P2P平台负有还款义务的信用凭证形式，向借款人发放贷款，同时设立相对应的信用凭证。Web Bank再将这些信用证出售给放款人。这个模式有效地将借款人和放款人直接联系起?来。<br style="text-align: left; text-indent: 2em" />在SEC登记注册之后，P2P平台改变了这一模式，以反映出售给放款人的信用凭证属于证券类别，同时遵守相关的证券法律。借款人的贷款仍然是由Web Bank来发放，然后Web Bank会将债权卖给P2P平台，P2P再将这些贷款又以收益权凭证形式卖给放款人。<br style="text-align: left; text-indent: 2em" />通过这种形式，放款人就成了P2P平台的无担保债权人，而非是借款人的债权人，在借款人违约的情况下，放款人只有很有限的途径去追索。<br style="text-align: left; text-indent: 2em" />Web Bank在整个过程中的作用就是分销贷款，这是P2P平台没有相关牌照所不能做的业务。进一步来说，考虑到有大量的法律和监管法规针对消费者贷款发行这一环节，因而委托有牌照的银行来分销贷款，有助于P2P平台符合这些法律法规的要求，也有利于美国的多头监管，从而保护借贷双方，防止欺诈。<br style="text-align: left; text-indent: 2em" />可以看出，由于中美之间金融市场化程度不同和政策环境不同，因此同样是P2P，其实中美之间的差异很大。但国内存在诸多不利因素，诸如金融市场化程度很低，垄断横行，社会征信体系极不完善，政策不明朗等，却反而带来更大的发展潜力。<br style="text-align: left; text-indent: 2em" />因为P2P平台面对的服务群体更多，市场容量更大，且规则尚不完善，有非常巨大的成长空间，而国内P2P也很有可能成为现有金融体系内的服务补充，这对推动整个金融行业市场化有非常深远的意义。 </span><br style="text-align: left; text-indent: 2em" />&nbsp;</p>', 'admin', 1385444655, 321, '', '', 0, 0, 0, 0, 0),
(93, 'P2P行业首发自律公约', '', '', '<p><font size="3">近几年，本身作为先进模式引进的P2P模式(个人对个人)，却往往被看作是非法集资、卷款跑路的代名词。日前，中国小额信贷联盟在京正式发布《个人对个人(P2P)小额信贷信息咨询服务机构行业自律公约》。　　P2P小额信贷信息咨询服务业务作为近年来从国外引进的小额信贷创新业务，其基本原理是通过信息和互联网技术，为个人与个人之间的小额信用借贷行为提供信息咨询性质的中介服务，从而满足个人的信贷和投资需求。但是，在快速发展的背后，也出现了一些包括涉嫌非法集资、编造虚假债权、交易成本增加等诸多问题。而P2P行业目前面临准入门槛低、法律监管尚处于“真空”状态等问题。<br style="text-align: left; text-indent: 2em" /><span style="font-family: 宋体, simsun">&nbsp; &nbsp; &nbsp; &nbsp;据了解，自律公约要求P2P服务机构必须合法合规经营，完善企业治理和内部控制机制，提升风险管理能力，针对信用风险、操作风险、流动性风险、市场风险等制定积极可行的防范措施。同时积极与征信机构合作，把借款还款信息主动纳入统一的征信体系，建立涵盖P2P服务机构借款人信息的征信管理系统平台，通过数据报送和数据查询的双向数据交流，增强P2P服务机构防范信贷风险的能力。</span></font><br style="text-align: left; text-indent: 2em" />&nbsp;</p>', 'admin', 1385444710, 321, '', '', 0, 0, 0, 0, 0),
(95, 'P2P理财PK银行理财 谁更胜出？', '', '', '<p>&nbsp;</p><table style="widows: 2; text-transform: none; text-indent: 0px; width: 680px; border-collapse: collapse; font: 12px/15px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; empty-cells: show; table-layout: fixed; letter-spacing: normal; color: rgb(68,68,68); word-spacing: 0px" class="" cellspacing="0" cellpadding="0"><tbody style="word-wrap: break-word"><tr style="word-wrap: break-word"><td style="word-wrap: break-word; font-size: 14px" id="postmessage_6900" class="t_f"><p style="text-align: left; margin-top: 10px; text-indent: 2em; margin-bottom: 10px"><span style="font-family: 宋体, simsun; font-size: 16px">银率网统计数据显示，以上海市正在发售的银行理财产品为例，1个月至3个月、3个月至6个月、6个月至1年期限的银行理财产品平均预期最高年化收益分别是4.37%、4.64%和4.80%。与之相比，以业内著名P2P企业产品为例，同样期限的P2P理财产品预期年化收益分别高达8% 、9%、10.5%。同样以10万元购买一年封闭期的银行理财产品和P2P产品，前者的收益尚不及后者的一半。</span></p></td></tr></tbody></table>', 'admin', 1385444890, 321, '', '', 0, 0, 0, 0, 0);
INSERT INTO `gica_z_article` (`id`, `title`, `art_info`, `art_keyword`, `art_content`, `art_writer`, `art_time`, `type_id`, `art_url`, `art_img`, `art_userid`, `sort_order`, `art_click`, `art_set`, `art_attr`) VALUES
(96, '“温州改革”不会导致银根开闸', '', '', '<p>&nbsp;最近，中国在温州设立金融综合改革试验区的事引起普遍关注，一时间，种种分析和推测浮出水面，其中，有外媒分析说，温州金融改革预示着中国货币政策将放松，货币供应会出现暖春。对此，有关专家提出不同看法，认为温州金融改革与货币政策是两码事，“温州改革”不会导致银根开闸。<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />要打破垄断盘活民间资本<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />对于“温州金融改革”和“货币政策放松”这两个概念，专家认为它们是属于不同层面的问题。国家发改委投资研究所“促进民间金融健康发展”课题组负责人林勇明在接受本报记者采访时指出，货币政策是立足宏观调控的政策，主要针对总量，是相机调整的短期政策；而温州金融改革属于尝试解决金融领域深层次问题的改革试点政策，立足点重在中长期与“调结构”，也就是逐步打破货币供应的供给方式与流向上的国有垄断局面。<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />打破金融业的国有资本垄断，放低民间资本进入金融领域的门槛，是近期关于金融领域改革最多的建议。此次温州金融改革一个重要目的就是解决该问题，要打破垄断盘活民间资本。温家宝总理曾对此表示，民营资本进入金融领域就是要打破垄断，温州试点的有些成功经验要在全国推广。<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />林勇明认为，温州金融改革一方面破解长期以来民营企业、中小企业“融资难”的难题，另一方面也有助于以民间金融增量改革促国有金融部门存量改革。由于目前的金融结构格局，货币政策“放”的时候，更多的是国有部门获益，而“收”的时候，民营中小企业则更是“雪上加霜”。与此同时，民间借贷局部性风险也会加大。“温州改革”的目的其实是让民间金融更有效率，也更安全地服务于民营企业发展的投融资需要，这将为民间资本开辟更大的进入空间。<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />让“大小水库”发挥互补作用<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />温州金融改革还有一个重点是调整金融结构，通过体制机制创新，构建与经济社会发展相匹配的多元化金融体系，为全国金融改革提供经验。经济学家辜胜阻指出，建立温州金融试验区最大的突破是打破银行垄断，重构竞争有序的金融生态。其中包括让民间金融合法化，构建多元化、多渠道、多层次的金融体系。温州计划在三五年内，由民间资本为主发起设立50家村镇银行。<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />如果把国有大银行比喻为大“水库”，构建多元化金融体系则可以描述为多建一些小“水库”和小“水渠”。林勇明认为，温州改革的实质是促进民营企业融资渠道的多元化与规范化，相当于不是大“水库”放水(一般意义上的放松银根)，而是在大“水库”之外，多一些蓄水和供水的渠道，让大“水库”与小“水库”、小“水渠”之间发挥互补的作用。<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />相比大“水库”，小“水库”和小“水渠”与民营中小企业更具有天然相匹配的缘分。林勇明分析说，温州改革的“立意”之一，应是以金融改革来促金融结构的优化，建立多元化、多层次、能够满足各种经济类型融资需要的金融服务体系。一般来说，国有大银行系统在服务可及性上更多地与国有企业、大企业相匹配，中小型、本地型民间金融天然地与民营中小企业融资相匹配，这些“草根金融”主要依托地缘、亲缘的信用体系，靠较高的利率来弥补规模小和风险高的劣势，发展这些“熟悉本地、立足本地、服务本地”的中小型民营金融，有助于填补大银行系统存在的“服务盲区”，促进金融资源配置在全社会范围内的公平与效率。<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />不是货币政策局部放水<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />专家指出，“温州金融改革”与“货币政策放松”没有必然联系，温州改革不代表货币政策会局部放水。“这是两个不同概念，货币政策是宏观调控的问题，温州改革是体制改革的问题”，中国社会科学院金融所银行研究室主任曾刚对本报记者说，温州金融改革是长期的事情，是金融体制管控的问题，它将影响未来5至10年金融改革的方向，是长期的制度性的，而货币政策是短期的。<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />林勇明说，温州金融改革对民营部门、民营企业、民间资本来说，无论是当下，还是未来中长期来说，都是利好消息，但改革试点不会导致全局上的银根放松，也不会导致对国有部门的银根放松，因此不能把这一政策简单地解读为货币政策将出现暖春迹象。<br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" /><br style="text-align: left; line-height: 17px; text-indent: 2em; font-family: tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; color: #444444; font-size: 15px" />曾刚指出，货币政策放松与否取决于外部环境的变化。现在未来经济走势高度不确定，货币政策放松与否真是难以预测。现在主要看欧洲的经济情况，不确定性很高，对货币调控政策带来很大难度。</p>', 'admin', 1385444994, 321, '', '', 0, 0, 0, 0, 0),
(97, 'P2P专属多元化互联网金融让投资不打烊', '', '', '<p>&nbsp;多年来一直寂声发展的理财管理市场，因互联网金融的产生，被搅皱了一池春水。存储量越来越旺盛的闲散流动资金，开始从传统理财产品市场上退出，进而涌入互联网金融“淘金”。稳回报、低风险兼高流动性，成为大多数新型理财项目的主打牌。，在这种背景下，收益率成为投资者进入互联网金融领域选择理财工具的重要衡量标准。如某些投资品种将用户账号内的闲散资金去购买货币基金，或某些P2P平台提供高收益加担保的投资项目。<br /><br />从当下互联网金融发展来看，高举创新口号的投资理财产品相较于传统理财产品并不具备非常明显的收益优势，如某些投资品种可能只是将用户账号内的闲散资金去购买货币基金，事实上，这种投资方式在方便快捷性上的突破意义要远胜于对于投资回报的提升。相较而言，P2P投融资平台提供的一些优势项目，在回报水平上远远高于传统理财产品。以互联网金融创新发展的典型代表平安陆金所为例，其推出的稳赢-安e贷投资项目，预期年化利率高达8.4%以上，且有平安融资机构提供担保，确保即使在出现违约风险的情况下投资人也可以收回本金利息。这一投资项目自推出以来，就赢得了投资者的追捧、 并於每个工作日19：30特别开设新客专场，让每个人都有机会参与投资。 就处于供不应求的状态，以至于某些新客户无法及时参与投资。<br /><br />据了解，为满足投资者日益高涨的需求，陆金所特开设专属理财频道，面向会员推出了专属的理财项目预期年化收益率在5%以上，为一次性还本付息的固定收益类投资项目，该系列收益稳定，较同期银行理财产品高出10%-15%以上。产品供应丰富，投资形式灵活，2.5万起投，期限在1-12个月不等，并且由中国平安担保公司全额担保，确保投资安全，更重要的是通过该系列的补充，陆金所真正做到24小时投资不打烊，为陆金所会员提供更多优质投资机会。<br /><br />业内人士指出，随着类似余额宝、P2P等新兴网络理财方式的出现，对于银行等传统理财渠道形成了直接冲击，未来银行的转型更加迫在眉睫。而对于投资者而言，更加多元化的理财方式选择，也将考验其理财能力。</p>', 'admin', 1385445089, 342, '', '', 0, 0, 0, 0, 0);
INSERT INTO `gica_z_article` (`id`, `title`, `art_info`, `art_keyword`, `art_content`, `art_writer`, `art_time`, `type_id`, `art_url`, `art_img`, `art_userid`, `sort_order`, `art_click`, `art_set`, `art_attr`) VALUES
(98, '第三只眼看温州金融改革', '', '', '<p><span style="color: #000000">温州金融改革的目标是为了解决金融体系与经济发展不相适应的问题，引导金融回归服务实体经济。我们认为温州金融改革若要取得成功，最终离不开全国范围内金融改革中的一系列工程，例如金融法律的基础建设、实质上的利率市场化和机构市场化。&nbsp;<strong style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; font: 700 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">　　投资论道：第三只眼看温州金融改革&nbsp;</strong><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><strong style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; font: 700 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">　</strong>　温州试验区&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　从永强机场前往温州瑞安，会经过一排排仍然十分简陋的家庭作坊和加工工场，人们几乎难以相信这里就是温州商人当年草创实业，掘取第一桶金的地方。温州，这座孕育了40万家民营企业和个体企业，在改革开放中率先致富，其后又以游资团和炒楼客闻名全国的城市，在去年的一场民间借贷危机中被推到了风口浪尖。今年3月28日，国务院决定在温州成立金融改革综合试验区又叫人们的目光再次投向到这座城市。一场牵动全局、影响全国的金融改革似乎已经从这里拉开帷幕。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　我们的报告首先回顾了去年开始的借贷危机。危机令到政府和公众都高度关注中小企业“两多两难”的困境。把民间融资阳光化、规范化是化解和防范危机的不二之选。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　在第二部分我们解读了温州金融改革试验区的十二项任务，预计这些任务将如何落实。最后，我们认为温州金融改革若要取得成功，最终离不开全国范围内金融改革中的一系列工程，例如金融法律的基础建设、实质上的利率市场化、以及民间金融机构的市场准入。这些范畴的改革将会对中国的资本市场产生深远的影响。所有的事情还要从去年那场“跑路”危机说起。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　民间借贷危机&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　2011年4月起，温州出现了大量“跑路”事件，部分企业主因资金链断裂、还贷困难而出逃。至2012年2月，温州“跑路”企业达到230多家，问题至今仍没有得到彻底的解决。“跑路”危机对当地产生了负面影响：企业陷入关停局面，工人失去工作，150多家企业涉及银行授信问题，不良贷款随即上升，企业之间的担保链使得受牵连范围扩大。同时，“跑路”企业使用大量民间借贷，债权人难以收回资金，个人损失严重。除温州以外，危机还蔓延到了浙江其他城市和江苏、福建、内蒙古等地区，引起高度关注。&nbsp;&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　产生危机的直接原因是企业资金链的断裂。2008年金融危机后，财政刺激和宽松货币政策出台。一方面，银行积极放贷，促使企业前来贷款；另一方面，宏观形势回暖，大批温州企业扩大投资力度和范围，并且重点投资于金融地产等非实体行业，导致企业资金需求激增。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 15px/17px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">　　</span>在短期融资方式上，温州企业经常运用民间借贷作为过渡于银行贷款续借期间的“过桥资金”，其利息高昂，部分甚至达到接近50％。如果仅用作短期的“过桥资金”，即使利息较高，仍有助于企业资金周转。但是2010年下半年开始的信贷紧缩令到银行加紧控制风险，并且收回贷款。企业在贷款到期后被抽贷，不能获得下一期信贷，自身又由于从事非主业过多而难以回笼资金。“过桥资金”被迫短债长用，高昂的利息使企业主和投资人难以承受，经营或投资难以持续。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　更严重的是随之而来的民间借贷信用体系的崩裂。温州民间借贷的一个显著特点就是资金的相互拆借，企业间的互联互保。陆续发生的违约如同多米诺骨牌一般引起了连锁反应，令到各路资金都骤然不敢外借，原本在民间辗转流动的资金池因此而被冻结。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　资金危机演化成信用危机，从而引致了更多的“跑路”事件。这一点可以从危机期间温州地区银行存款的大幅上升，以及其后当地理财产品销量的大幅增长得到印证。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　两多两难&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　温州危机引起人们关注一个更广泛的问题-即中小企业的融资困境，它们面临的“两多两难”：民间资金多，投资难；中小企业多，融资难。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　从资金需求角度来看，温州以数量众多的民营企业起家，目前共有8万多家私营企业和30多万家个体工商户，对当地的经济发展起到了至关重要的推动作用。中小企业本身的生产和经营极需资金支持，但对于银行而言，借贷给它们的成本高、风险大，以致它们获得贷款比较难、比较少。主要金融机构贷款投向显示，大多数资金仍投放于大型企业。特别是银根收紧时期，存款准备金率提高，贷款基准利率上升，银行首先就会提高贷款的资质条件，不少中小企业被抽贷，融资困难程度显著增加。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　另外，中小企业融资难还体现在融资成本较高上面。国有企业和大型企业可在银行获得较低息的贷款；而中小企业即使获得贷款，利率也较高，而且需要大量担保和抵押，降低了资金的流动性和利用效率。尤其在银根抽紧时期，从利率浮动区间贷款占比中可以看出，利率下浮的贷款数量减少，利率上浮的贷款数量增加，加剧了中小企业贷款的融资成本。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 15px/17px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">　　</span>从资金供给角度来看，温州除了银行等正规金融机构，还蕴藏大量的民间资本，其中部分出自温州本地，部分来自国内与海外的回流。由于浙江是中国民营经济发展最快最多的地区之一，多年来藏富于民，民间个人和企业拥有大量无明确投资标的的资金。它们有着强烈的投资意愿，但合乎规范的高回报投资渠道却很窄。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　因此许多民间资金投入了民间借贷，据估算2011年年中温州民间借贷规模约为1100亿元，规模约占当地银行贷款的19％。然而目前民间借贷在法律上仅作为公民和他人之间的民事法律关系，其作为商业行为缺乏明确而规范的法律规定，形成违法违规的灰色地带。这既限制了民间借贷的投融资渠道作用，也使得大量愿意投资的民间资本难以合法获利。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　而温州金融改革成败的客观衡量标准-就是看它能否解决“两多两难”的困境，冲破民间融资和民间投资之间的鸿沟。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　合理性与规范化&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　从供需角度而言，中小企业具有融资意向，民间资本具有投资意愿，搭建这两者之间桥梁的民间借贷具有其合理性。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　首先，民间借贷有助解决服务不对等的问题。中小企业贷款对银行来说存在风险大、成本高的问题：中小企业盈利不稳定，透明度不高，甚至没有可以征信调查的报表；另外它们规模小但数量多，进行信息排查的成本高，易产生信息不对称情况。民间借贷可以从侧面补充不足，弥补缝隙。民间借贷一般为当地资金，借方和贷方有一定的熟悉程度，这种熟悉程度可以增强信用，减少违约。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　其次，允许民间借贷进入金融市场有助于为风险定价。利率是风险的价格，风险越高理应利率越高。目前，银行在基准利率的一定范围内对不同借贷者上下浮动，但是它们在经营性质上偏好国有大企业，难以满足民营中小企的需求。换而言之其利率是依据所有制定价，而不是依据经营风险定价。如果民间融资加入，可以通过市场供求促成竞争，对不同的经营风险进行定价。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 15px/17px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">　　</span>把民间融资进行规范化、阳光化，可以对其进行更有效的监管和风险防控，将一般的民间借贷与性质恶劣的层级收储区分开来。更为重要的一点是降低了交易成本，消除“违法溢价”，从而降低了借贷的利率。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　金改的未来方程式&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　此次温州金融改革方案为温州设立了“十二项任务”，内容广泛，主要可以分为四个方向，一是民间融资；二是民间投资；三是地方监管；四是加强主要金融机构对小微企业的服务。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　温州金融改革的目标是为了解决金融体系与经济发展不相适应的问题，引导金融回归服务实体经济。我们认为温州金融改革若要取得成功，最终离不开全国范围内金融改革中的一系列工程，例如金融法律的基础建设、实质上的利率市场化和机构市场化。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　法律层面的基础建设&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　1、《商业银行法》。“十二项任务”中的第二项允许符合条件的小额贷款公司可改制为村镇银行，被认为是民间资本进入银行业的突破。其实早在2010年颁布的“国36条”就支持民间资本以入股方式参与商业银行的增资扩股，鼓励民间资本发起或者参与设立村镇银行等金融机构。但是由于事实上过多的障碍和过高的准入门槛，全国只有民生银行算得上是民营银行。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　《商业银行法》应适当放宽准入门槛。其中第13条规定“设立全国性商业银行的注册资本最低限额为十亿元人民币，设立城市商业银行的注册资本最低限额为一亿元人民币，设立农村商业银行的注册资本最低限额为五千万元人民币；注册资本必须是实缴资本。”目前中国的银行准入最低资本要求不仅远远高于发达国家地区，而且远远高于其他转型中的发展中国家。过高的最低资本要求给民营银行设立了过高的准入门槛。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　《商业银行法》第11条规定，设立商业银行应当经国务院银行业监督管理机构审查批准。第12条规定，设立商业银行还应当符合其他审慎性条件。这两条规定了银监会对商业银行设立的自由裁量权，但是没有对自由裁量权进行限制，过去几年中，很多设立银行的申请因为“市场竞争已经十分充分”而被拒绝。法律应该具体化自由裁量权，规范权利行使程序。《商业银行法》还应当允许股东多元化。第28条规定“任何单位和个人购买商业银行股份总额百分之五以上的，应当事先经国务院银行业监督管理机构批准。”事实上造成了商业银行都为国有大型企业控股。即使是这次列入温州金融改革议程中的“鼓励和支持民间资金依法发起设立或参股村镇银行”，现时的相关法规仍然是规定村镇银行最大股东或惟一股东必须是银行业金融机构。这些法规都需要适当的修改。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　2、《放贷人条例》。目前个人放贷方面存在法制真空。由央行草拟的《放贷人条例》第五稿已经在“两会”前夕上报国务院，前四稿因为无法控制资金流向而被否决。一方面，民间放贷资金缺乏法律规范和监管，容易滋生高利贷与非法融资等问题；另一方面，国家统计机构无法掌握准确的民间资金运行数据，导致货币政策的效果有偏差，弱化宏观调控。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　民间资金具有金额小、分布广、集中度低的特点，正好与中小企业融资特点相匹配。目前民间资金唯一可以进入金融领域只有小额贷款公司，且在资金来源和投资方向上受到严格限制。出台《放贷人条例》可以规范民间借贷，拓展民间资金投资渠道。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　《放贷人条例》制订的原则是上限为基准利率的4倍，不能吸收存款。参考国外的情况，香港《放债人条例》中规定60％的利率上限，美国对放贷资金的来源除了不允许吸收公众存款外，允许通过向金融机构贷款、发行债券和股票获取资金。中国可以参考这些国家的经营来加强利率弹性，并且适当地多元化资金来源。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　3、《存款保险法》。存款保险制度是为了保护存款人利益和维护金融秩序稳定而设立的制度安排，各类存款性金融机构作为投保人按一定存款比例向存款保险机构缴纳保险费，建立存款保险准备金，当投保人面临破产时，存款保险机构向其提供财务救助或直接向存款人支付部分或者全部存款。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　目前涉及银行破产的法律只有《商业银行法》和《企业破产法》，而这两部法律都没有明确银行破产后存款人保护的问题。完善法律是保险制度建立的基础，当前的首要任务是制订《存款保险法》，明确承保范围、保险限额和费率，规范存款保险机构的设立、存款保险基金的筹资渠道、资金来源、运作流程等问题。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 15px/17px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">　　</span>国际上存款保险机构的设臵一般有三种类型：一是政府建立，如美国、英国；二是政府与银行共建，如日本；三是由银行联合建立，如德国。中国存款保险基金可由政府和参保银行共同建立。保险范围上，国内居民储蓄存款占比大，风险承受能力低，因此目前应该以居民储蓄存款为主。在保险限额上，各国一般按照存款账户实行限额保险而非全额保险。为减少风险，宜采取按照每个存款人的存款额一定比例保险。伴随利率市场化过程，各个银行风险会差异化，因此也应该制订差别化费率。另外为了防范银行道德风险和逆向选择，存款保险制度的设立应以政府审慎监管为主，并赋予央行适当的监管职能。<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　利率市场化与机构市场化&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　所有这些法律的基础建设其实都是围绕着一个核心目的，那就是利率的市场化与机构的市场化。此次温州金融改革没有涉及利率市场化试点，并不意味着利率市场化改革可有可无，而是利率作为宏观政策范畴，不适宜在个别区域先行试点。借鉴上世纪六七十年代美国发生的“德州溢价”危机，在个别区域放开存贷款利率限制，会导致存款涌向试点区域，贷款尺度放宽，从而引发另一场危机。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　近年来，在金融脱媒的倒逼下，利率市场化其实已经有一些实质性的进展。一方面，在长期负利率的环境下，活期存款增速与M1/M2比值双双下降。为保值增值，住户存款流向有更高收益率的理财产品和投资工具，去年各家银行的理财产品销售额就曾大幅增加。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　另一方面，在社会融资总量构成中，新增银行贷款的份额在渐渐降低。由于人民币贷款基准利率高于高评级公司债发行利率和国债发行利率，企业在银行贷款的间接融资成本水涨船高，更多企业选择通过股票和债券市场直接融资。与此同时，各类信托贷款、委托贷款以及承兑汇票也层出不穷，实际上形成了多样化的利率“多轨制”。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　然而，更大范围的利率市场化与机构准入始终是实现资金资源优化配臵的最佳途径。在利率管制保证银行稳定利差的环境下，银行以规模来竞争，更愿意把资金投向国有大型企业。在利率趋向市场化的过程中，虽然民营企业、中小企业相对于国有大企业仍然会有更高的风险溢价，因而会被要求支付更高的借贷利率。但即使如此，把民间借贷阳光化规范化，还是能够为那些难以从银行获得贷款的小企业提供更多合法的资金渠道，相比起现时动辄年率高达50％的高利贷，这些资金渠道在市场竞争的机制下在边际上仍然可以为它们降低资金的成本。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><span style="widows: 2; text-transform: none; background-color: #ffffff; text-indent: 0px; display: inline !important; font: 15px/17px tahoma, ''microsoft yahei'', simsun; white-space: normal; orphans: 2; float: none; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px">　　</span>综合分析周小川行长最近的媒体访谈，我们预计利率市场化可能会沿着以下路径推进：&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　1、设立存款保险制度。利率市场化改革伴随着很大风险，市场化初期往往出现存款利率上浮而贷款利率下浮，息差收窄使银行利润压缩，小型银行面临倒闭风险。为了保护存款人的利益，在利率市场化之前应会建立存款保险制度。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　2、贷款利率市场化会比存款利率市场化先行一步，并且坚持渐进性和可控性。在央行政策的指引下，下一步贷款利率市场化会按照“先短期，后长期；先大额，后小额”的思路进行。但是由于房屋贷款的风险较低，也可能会成为贷款定价权下放的破冰之举。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　3、对存款利率的控制会非常谨慎，主要是为了防止存款利率开放后，各家银行为了扩张市场规模而竞相提高利息成本揽存，小型银行不堪重负而陷入破产的危机。发展利率替代性负债产品（如银行理财产品）、扩大利率浮动区间将会成为存款市场化的先行之举。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　利率光谱与黄金区间&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　图表1是我们绘制的一幅利率光谱。在这条光谱上，红色高利率的部分，包括民间借贷、基准贷款利率4倍上限附近、以及高于上限的区间将会是有关当局力图规范的部分。在另一端的蓝色部分，即存款利率部分，则是金融体系改革者谨慎对待的部分。我们认为，在两者之间的利率区间将会成为被鼓励市场化的部分，也是最有可能孕育更多商业机会的黄金区间。&nbsp;<br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" /><br style="text-align: left; widows: 2; text-transform: none; background-color: #ffffff; text-indent: 2em; font: 15px/17px tahoma, ''microsoft yahei'', simsun; word-wrap: break-word; white-space: normal; orphans: 2; letter-spacing: normal; color: #444444; word-spacing: 0px; webkit-text-size-adjust: auto; webkit-text-stroke-width: 0px" />　　正是由于这段黄金区间，相比起围绕小额贷款、村镇银行而在前期大涨的“金改概念股”（如浙江东日、香溢融通等），投资者现时更应该关注非银行金融板块，因为这类板块能够切实地从这段黄金区间中获益。其中我们比较青睐的是信托和保险。对于信托来说，它们可以被赋予更大的空间来发行高收益产品，板块内的股票标的包括安信信托、经纬纺机；对于保险来说，它们受益于养老金税收递延政策以及投资范围的扩大，板块内股票标的包括中国太保、新华保险。对于另外两个金融板块，银行和证券，我们的态度较为谨慎，主要是银行受制于规模增长的放缓，而券商受制于交易佣金的下滑。</span></p>', 'admin', 1385445105, 321, '', '', 0, 0, 0, 0, 0);
INSERT INTO `gica_z_article` (`id`, `title`, `art_info`, `art_keyword`, `art_content`, `art_writer`, `art_time`, `type_id`, `art_url`, `art_img`, `art_userid`, `sort_order`, `art_click`, `art_set`, `art_attr`) VALUES
(99, '市场需求催生创新金融 国内P2P呼唤“阳光化”', '', '', '<p><span style="font-size:10.5pt;font-family:宋体;">月初，央行召集几大网贷平台在京座谈，据参会的业内人士介绍，央行的态度很开放，“对网贷的定位是‘银行的补充’，能引导民间资本进入实体经济，预计下半年会出台监管措施。”</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">对一个新生的、高速发展，而且涉及群众资金的<strong><a target="_blank" href="http://www.etongdai.com/xin">P2P</a></strong>行业，如何纳入监管成为了近期的热点。而在P2P这种金融创新过程中，出现的争议性问题该如何解决，也成为业界探讨的重点。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">市场需求催生创新金融</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">1976年，36岁的尤努斯不会想到，他借给42位贫困村民的27美元，会开创跨时代的小额融资现代模式——P2P借贷。从2007年8月拍拍贷在上海诞生起，我国的P2P行业经历了高速发展和演化。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">《中国P2P借贷服务行业白皮书2013》显示，2012年末，P2P贷款服务平台超过200家，可统计的P2P平台线上业务借款余额将近100亿元，投资人超过5万人。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">而长城证券研究员黄飚则表示，行业网站的非官方数据显示，目前单纯网络借贷P2P就有上千家，从业人员（含线上线下）达到十万量级。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">迅猛的发展得益于市场需求，中国存在的“两多两难”现状（民间资本多，投资难；小微企业多，融资难）以及信贷收紧的政策催生了金融的创新。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">“<strong>P2P</strong>根 本上解决的是服务小微的问题”，宜信CEO唐宁表示，小微融资的市场需求促进了行业的发展。中小企业作为一个富有活力的经济群体，是国民经济的重要组成部 分，在促进我国经济繁荣、增加就业、推动创新等方面，发挥着越来越重要的作用，然而，融资难的问题一直困扰和制约着中小企业的发展。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">仅以今年6月深圳市政府发布的数据为例，“深圳市全市中小企业融资需求总额约为1.45万亿元，深圳中小企业通过各种直接或间接方式获得融资总额为8363.8亿元，融资缺口仍有6136.2亿元，缺口比例为43%。”</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">“P2P这种创新金融主要服务于小微企业，帮助其解决融资难、融资贵的问题”，人人聚财CEO许建文告诉21世纪网，“民间金融作为正规金融的补充，在推动民营经济和农村经济的快速发展方面发挥巨大作用”。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">P2P变形记</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">但蓬勃发展的P2P业务和雨后春笋般的P2P公司，让行业驶向快车道的同时，也暴露出行业的风险和问题。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">从 2011年7月21日，运行只有一年半的哈哈贷因运营资金不足宣布关闭；同年10月运营近3年的天使计划网站负责人王龙宇失去联系；2012年6月3日上 线仅5天的淘金贷骗倒国内100多名投资者；2012年12月上线4个月的优易贷工作人员全部失踪；再到今年4月成立不足一月的众贷网破产；在国外成熟的 P2P业务，来到中国后，不断异化。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">最近，重庆地区对P2P行业进行了一系列整顿，对5家涉嫌非法集资的P2P公司做出相关处罚，其中1家公司已被注销，其余4家被要求逐笔清退现有的债权债务，共计4.86亿元。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">对此，许建文认为，这些被整顿的公司主要是因为“公司重线下业务，违规发行理财产品，与传统的P2P业务并不相同，不是一回事儿”。这些变成“李鬼”的P2P业务脱离了以资金供需撮合为主的经营模式，而涉嫌吸收公众存款、发放贷款。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">“我 们经常谈的P2P首创于英国的Zopa，”许建文告诉21世纪网，Zopa的口号是：“摈弃银行，我们都有更好的交易”，Zopa认为去掉中间环节，理财 人（投资人）与借款人在投资收益、借款成本等方面取得更好的效果。“（所以）真正的P2P应该是点对点的直接对接，是金融脱媒的一种形式”。</span></p><p style="white-space:normal;">&nbsp;</p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">一些平台发放理财产品揽储，实际上并不是P2P行业应有的借贷模式，拍拍贷品牌总监朱长城告诉21世纪网，P2P在发展过程中确实有不同模式，就好像当初的电子商务，并不是现在大家所熟悉的“一口价”模式。现在的P2P也不是一定该怎样，它会在发展中改进。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">目前，国内P2P主要有4种模式：“有担保线上模式”、“无担保线上模式”、“线下模式”、“线上线下相结合模式”，每种模式的代表公司有人人聚财、拍拍贷、宜信和陆金所。</span></p><p style="white-space:normal;"><span style="font-size:10.5pt;font-family:宋体;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-size:10.5pt;font-family:宋体;">“人人聚财的运营模式是与外部有资质、有实力的大型担保机构合作”，许建文介绍，“风险由合作的小贷公司和担保机构承担。平台作为中介，不吸储、不放贷，只提供金融信息服务，帮助完成撮合交易”。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">而无担保线上模式的代表则是拍拍贷，主要借鉴美国 P2P网贷领导者Prosper的经验。朱长城表示，拍拍贷属于单纯的网络中介。这种“无担保模式”只负责制定交易规则和提供交易平台，不负责交易的成交 以及贷后资金管理，不承担借款人违约带来的损失，对出借人不承担担保责任。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">线下模式，则是P2P最具中国style的模式，由 传统民间借贷发展而来，代表公司为宜信。为了规避了法人放贷而成为非法集资行为的风险，唐宁设计出了“P2P平台下的债权合同转让模式”，也就是通常讲的 宜信模式。一边发放贷款获取债权，一边又通过资金重组和期限错配方式将债权转移给其他投资人。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">而在线上线下相结合模式中，平台不再是单纯的中介。因为它不仅提供撮合交易平台，自身也发展线下借款项目，再将其挂到网站交易。平安集团旗下的陆金所就是突出例子，通过集团旗下的保险、银行、担保公司，实现线下贷款与线上理财的资源型对接。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">这些不同的运营模式，有些是国际P2P发展的异化，有些则是中国独创，适应了不同类型投资者和融资者的需求。但是，由于P2P行业还没有专门的管理机构，只是暂由央行代管，也未建立完善的管理机制。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">在这种“监管双缺失”的情况下，不排除有些人打着互联网金融的幌子做一些非法勾当，淘金贷上线才5天，老板跑了；众贷网运营才28天，倒闭了。这种“李鬼”现象只是P2P高速发展的副产品，随着行业的发展，专门的监管机构必定会逐步建立并完善。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">行业阳光化，任重道远</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">“P2P的风险和不良率没有外界想象的那么高”，黄飚表示，“为了满足金融需求，（P2P）是大势所趋，央行对此也是持独立、规范行业的支持谨慎态度”。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">实际上，央行也一直关注网络信贷的发展，数次与行业公司代表座谈，了解行业现状、基本情况和风险问题，探讨如何促进网络信贷公司长远健康发展。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">温州金改过程中，政府对网络借贷公司实行的登记制不失为一种参考。鉴于此前存在中介发布虚假款信息，骗取出借人的款项后逃之夭夭的案例。温州金改办相关负责人认为，要控制风险，“就是把它们引到地面上来，进驻民间借贷登记中心，就是为最大限度地减少风险”。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">已入驻中心的机构，其配对借贷交易在登记中心备案登 记时，能直接提供原始材料进行审核印证，确保了信息准确性，该负责人说，要想推广P2P这一借贷模式，可以将实体平台与网络平台对接，扩大P2P借贷融资 备案登记的范围，同时形成与人民银行金融机构借贷信息登记系统的信息互补，完整市场金融借贷信息。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">将网络借贷纳入政府部门的监管范围，辅以适当的监管，这一监管理念也得到了一些央行研究人士的认同，他们建议从用户识别机制、资金管理机制、反洗钱系统建设、信用评级体系建设、安全技术与指标设计五个方面加强监管，促进与引导网络借贷更加持续健康发展。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">金融创新先于政府监管，这是不争的事实，朱长城以“第三方支付”为例，“02、03年就出现了第三方支付，”但是到2010年，央行才公布施行《非金融机构支付服务管理办法》。现在的P2P也是这样，2007年拍拍贷就成立了，但是这两年媒体才开始关注这一业务。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">作为企业来说，在监管措施还未落实的情况下，需要踏踏实实做业务。许建文表示，“我们希望监管机构从企业经营状况、业务模式、操作流程等方面进行全方位的监管，企业除了自身需要对平台风险进行控制以外，还要加强行业互律和他律”。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">不少业内人士坦言，如果能将P2P接入央行征信系统，这对P2P行业的发展将是一大推进。上月底，央行征信中心旗下的上海资信搭建的“网络金融征信系统（NFCS）”上线，服务网络金融领域。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">该系统收集整理网络借贷者的个人基本信息、贷款申请信息、贷款开立信息、贷款还款信息和特殊交易信息。通过平台之间信息共享，帮助网络借贷机构全面了解授信对象，防范或减少借款人恶意欺诈、过度负债等信用风险。</span></p><p style="white-space:normal;text-indent:21pt;"><span style="font-size:10.5pt;font-family:宋体;">而据报道，央行在北京再次举行<strong>网络信贷</strong>专题座谈会，包括央行副行长刘士余在内的多位监管层人士，以及拍拍贷、宜信、陆金所、人人贷、红岭创投等9家P2P公司代表参加了会议。央行对P2P行业的调研工作也同步进行，行业走向“阳光化”的进程在不断加速。</span></p>', 'admin', 1385445124, 342, '', '', 0, 0, 0, 0, 0),
(100, '网站公告测试 欢迎测试', '', '', '<p>网站公告测试 欢迎测试</p>', 'admin', 1385445155, 321, '', '', 0, 0, 0, 0, 0),
(101, '投资理财产品的选择', '', '', '<p style="font-size:16px;font-weight:bold;text-indent:0px;">银行定期存款、国债：</p><p style="text-indent:2em;">其最大的优点是安全，但代价是超低的收益率。目前人民银行规定的一年期定存利率远低于国家统计局公布的5.3%的通货膨胀率。可以说，若是把钱存在银行，一年后就将因通货膨胀货币价值至少缩水2%。而且如果提前支取，定存就将按照活期利率0.35%计息，贬值更加严重。</p><p style="text-indent:2em;">定期存款利率过低，抗通胀能力太差，只能说是普通老百姓的无奈选择。</p><p style="font-size:16px;font-weight:bold;text-indent:0px;">银行理财：</p><p style="text-indent:2em;">银行理财产品风险基本都不大，预期年化收益率随风险程度和存期时间长短而不同，但整体保持在 3% - 6%之间。作为理财投资的选择，这个收益区间显然不尽如人意，也无法抵抗国内严重的通货膨胀。因此只能说，银行理财只是在短期产品的收益率上优于定存，但 仍然达不到投资保值升值的目标。</p><p style="font-size:16px;font-weight:bold;text-indent:0px;">信托：</p><p style="text-indent:2em;">信托行业近几年发展迅猛，较高的收益率，广泛的投资领域，都给投资者提供了更多的选择。但信托 产品至少100万的大额投资门槛，把大部分普通投资者排除在外。而且动辄几年的存续期限，也十分影响投资者资金的流动性和灵活性。最近由于经济形势和行业 调控的影响，信托产品也陆续出现了兑付风险，因此投资者选择信托产品的时候也需要格外谨慎。</p><p style="font-size:16px;font-weight:bold;text-indent:0px;">私募PE：</p><p style="text-indent:2em;">国内的私募起步晚，行业还处于发展初期。在如今全球经济下行压力增大的情况下，整个私募行业步 入深度调整期，资金规模明显下降，收益状况明显两极分化。另外大多数投资者由于私募非常高的投资门槛而无法参与其中；长达3-5年的投资期限，复杂的投资 模式，无法保障的预期回报，都是投资者选择时需要考虑的因素。</p><p style="font-size:16px;font-weight:bold;text-indent:0px;">股票：</p><p style="text-indent:2em;">作为最常见的一种浮动收益类投资方式，自2008年中国股市进入熊市以来，已经套牢了无数投资者的资金。2012年，上证指数2269点收关，如此低迷的行情，想要在中国股市获利更是难上加难。</p><p style="text-indent:2em;">股票投资风险极大，需要投资者具有扎实的金融理论、丰富的投资经验以及高超的交易技巧。从中国股民十炒八赔一平一赚的残酷现状就可以看出，“股市有风险，投资需谨慎”。</p><p style="font-size:16px;font-weight:bold;text-indent:0px;">爱投资：</p><p style="text-indent:2em;">作为新兴的网络投融资平台，爱投资秉承“低风险、高收益”的投资目标，提供的投资项目期限灵 活，短到1个月，长到1年，可供投资者自由选择。在远超通胀率的高收益率基础上，所有项目均有本金及利息的全额担保和足值抵押，安全保障永远放在第一要 素。平台项目的投资门槛低，网络投资方便快捷，可让广大投资者都可轻松尝试参与，是一种创新性的理财投资新渠道。</p>', 'admin', 1385445233, 369, '', '', 0, 0, 0, 0, 0),
(102, '投资项目时间长短的选择', '', '', '<p>固定收益投资项目，投资期限通常从1个月到1年不等，而收益率也会与投资期限成正比，即期限越长，收益率越高。用户如何选择不同时间长短的项目进行投资，要根据自己的资金计划和投资风格而定。</p><p style="text-indent:2em;">选择投资短期项目，明显的好处是资金比较灵活，到期后资金方便挪作他用。但是短期项目的收益率 通常低于长期项目，并且为了保持资金的连续收益，经常需要用户花费较多的时间精力来选择多个项目进行连续投资。而每一次项目的到期兑付，都意味着一次风险 的释放，因此同一时间段内投资的项目越多，便会无形中加大风险发生概率。因此短期项目比较适合对资金流动性要求较高，有充足精力进行投资研究的的激进型投 资者。</p><p style="text-indent:2em;">相比之下，投资长期项目的收益率更高，也更为稳定。由于较长期限内只需要对个别的企业项目承担 极小的风险，属于更省力、省心的投资选择。因此，如果投资者对资金的流动性要求不高，并且不想花费太多精力在项目的研究与选择上，不妨投资看好的长期项 目。一次投资，长期获利，是稳健型投资者的较好选择。</p><p style="text-indent:2em;">总之，精明的投资者应该对自有资金分别做出短期和长期的合理划分和规划，将不同类型的资金用于投资不同时间长短的项目，长短结合实为投资者的最佳选择。</p>', 'admin', 1385445346, 369, '', '', 0, 0, 0, 0, 0),
(103, '投资收益率的选择', '', '', '<div class="article-body"><div style="margin:0 auto;color:#555;"><p style="text-indent:2em;">根据融资企业的信用等级、抵押资产，以及融资项目的期限长短等其他各种综合因素，爱投资平台上的投资项目收益率会有高低之分，投资者可根据自身的投资风格和收益要求进行灵活选择。</p><p style="text-indent:2em;">整体看，爱投资平台上的企业融资项目年化收益率大约在10% - 15%之间。这是基于我们专业团队对各类融资企业的深入了解和对金融环境的长期研究之后，在企业能够承受的融资成本基础上，得到的一个对投融资双方互惠互 利的合理利率区间。虽然目前市面上P2P网站的收益率差别很大，有的甚至超过20%，但稍作了解便会发现，利率高的网站标的往往以个人信用贷款为主，其风 险远远高于企业抵押贷款。爱投资为了创建一个安全合理，风险可控的投资环境，提供的所有项目都有足值抵押，本息全额担保，充分保障投资者的资金安全。</p><p style="text-indent:2em;">实际上，社会各类行业中经营年利润率能达到20%以上的并非多数。很多行业的年利润率都不足10%，比如交通运输业、商业零售业等等。所以过高的融资成本不但达不到帮助企业成长、获得长期稳定收益的目的，反而可能会因为过高的利息把企业压垮，事与愿违。</p><p style="text-indent:2em;">网贷平台无法让投资者一夜暴富，我们的目标是让财富稳定安全地保值增值。因此需要定制出投融资双 方共赢的合理投资模式及利率，既能让投资者稳定获利，又能令大部分优秀企业承受；推动社会资金的有效流动，从而积极促进企业发展，为社会创造更大价值，最 终也使广大投资者长期受益。</p></div></div>', 'admin', 1385445382, 369, '', '', 0, 0, 0, 0, 0),
(104, '分散投资降低风险', '', '', '<p>投资平台的一大特色在于为投资者提供了详实、可靠、富有参考价值的项目信息，以便投资者在种类 丰富的项目中轻松选择。可是根据风险与收益总是成正比的投资规律，如果想要得到高收益，必须要有相对较高的风险承受能力；而要想获得绝对的低风险，那势必 要降低对收益的要求。投资者其实不必在二者之间艰难权衡，事实上，分散投资其实是一种更加理性的投资策略。</p><p style="text-indent:2em;">一、分散投资于多个项目，降低风险的同时获取较高的平均收益率。</p><p style="text-indent:2em;">如果用户拥有50万元资金，可平均投资于10个不同收益率、不同风险等级的项目中。这样一来，如果各个项目都顺利履约，那么投资者将获得高于集中投资于保守型项目的收益；若是有个别项目发生风险，其他项目的收益并不受到影响，同时风险范围也可控。</p><p style="text-indent:2em;">二、分散投资于不同期限的项目，获取稳定收益的同时提升资金的流动性。</p><p style="text-indent:2em;">投资短期项目资金灵活，但耗费较多精力的同时收益率偏低；投资长期项目可以省时、省力获得较高收益，但又会降低资金的流动性，因此需要二者搭配组合。通过分散投资于不同期限的项目，优化资金的流动结构，兼得稳定的高收益和资金的灵活性。</p><p style="text-indent:2em;">三、分散投资于不同行业类型的项目，防范行业风险，获取稳定收益。</p><p style="text-indent:2em;">通过将资金投资于不同行业、不同类型的项目，可充分防范因经济形势或国家政策的变化，导致某一行业受到巨大影响而造成的损失，从而消除行业风险。</p>', 'admin', 1385445418, 369, '', '', 0, 0, 0, 0, 0),
(105, '投资企业信用级别高低的选择', '', '', '<div class="article-body"><div style="margin:0 auto;color:#555;"><p style="text-indent:2em;">投资者的投资目的无非是获得资产的保值增值，因此资金的安全保障一定放在首要位置，而不能片面追求高收益率。投资上面经营状况好，偿付能力强、信用等级高的企业项目，也许收益率不是最高，但安全性会相对更好。</p><p style="text-indent:2em;">审核项目时，不仅注重对抵押物的评估，还非常重视企业的诚信和信用记录。通过综合考察的 结果对企业信用评级，为客户提供有价值的投资参考。爱投资建立的是一个收益稳定、合理，资金更加安全的投资环境，对借款企业的线下审核要求非常严格。尽管 资产实力强、信用级别高的企业借款项目收益率会稍低，但企业按时付息还本几乎不会出现任何风险，是稳健型投资者的首选。</p><p style="text-indent:2em;">每名投资者对风险的承受能力不尽相同，用户应该根据企业信用等级以及其他各种项目信息，同时结合自己的投资风格和偏好来综合判断，最终做出最适合自己的项目选择。</p></div></div>', 'admin', 1385445464, 369, '', '', 0, 0, 0, 0, 0),
(106, '如何让P2P网贷投资尽量安全', '', '', '<p>&nbsp;&nbsp; 如何在500多家P2P网贷中 选择一家靠谱的？在投资中该怎 样规避风险？<br /><br />“股市有风险，入市须谨 慎”在现下火热的P2P网贷依然有 其普适性。<br /><br />所谓P2P（peer to peer lending）网贷是指“个人对个 人”的借贷，是一种依托于第三方 互联网平台的个人之间的直接融 资方式。<br /><br />今年10月份以来，P2P网贷 倒闭潮来袭。有统计数据显示， 10月份以来倒闭的P2P平台达到 40多家，导致很多P2P投资者“中 雷”，提现困难。<br /><br />在此背景下，如果想通过 P2P平台进行投资获得收益，必 须学会规避风险。腾讯科技对 P2P投资主要雷区进行了总结， 给投资者以下建议：<br /><br />1、查证。首先排除是诈骗 网站，避免投资后老板携款跑 路。如果投资金额较高，建议到 P2P公司所在地进行实地察看。 如果金额较小或相距较远，建议 到工商局网站查看注册信息。<br /><br />2、查看P2P公司创始团队、 管理团队的背景和专业素质。如 果创始团队没有在官网展示，需 要谨慎。此外，还要调查网站的 成立时间，是否已经加入行业自 律组织等。<br /><br />3、警惕高息平台。对投资 收益回报保持理性，18%以下安 全系数相对较高。这波倒闭的 P2P网贷有一个显著的集体特征 ——高息，有些年化收益率和奖 励加起来达到40%-50%。<br /><br />高息必然意味着高风险！如 果P2P平台给投资者的回报是月 息4分、5分，借款人的利息可能 是6分、8分，这一数字远超出正 常经营企业能承受的资金成本， 很可能是饥不择食、穷途末路的 项目——不能借。<br /><br />4、警惕项目期限超短的项 目。有些P2P平台投资标的期限 只有几天。需要考虑的是，什么 公司常年经营借款只有几天的生 意，这是一个真实的借款吗？很 可能是虚假捏造或者拆标。<br /><br />“拆标”是指长期借款标的拆 成短期，大额资金拆成小额，造 成了期限和金额的错配。例如， 某公司欲借款1000万元，期限为 1年，一些P2P平台将其拆成很多 个1月标。当第一 个1月标到期 后，用第二个1月标投资者的钱 去还上一个投资者的钱。这是一 个击鼓传花的游戏，当投资者对 P2P平台不信任时，纷纷提现， 产生挤兑。P2P公司资金只出不 进，资金链断裂。<br /><br />5、警惕金额过大的项目。 如金额达到几百万、上千万。小 微企业很难从银行贷几万、几十 万元，但如果在银行贷不到几百 万、上千万，而愿意在P2P平台 上付出4-5分的月息，可想而 知，很可能是被银行淘汰的客 户，风险难控。而一些金额小的 借款人，有可能是有还款能力、 银行不服务的那群人，风险相对 可控。<br /><br />6、分散风险。尽量不要把 钱放在一个平台，甚至是多个注 册地位于同一地区的网贷平台， 避免多次踩雷。例如，铜都贷、 徽煌财富、华强财富都位于安徽 铜陵市，在铜都贷倒闭后，徽煌 财富、华强财富将资金支援铜都 贷，导致自身平台逾期提现。<br /><br />最后，即使按照以上六项提 示操作，你仍然有可能不幸踩 雷。投资要有风险意识，没有零 风险的投资，不要轻信零风险的 宣传。</p>', 'admin', 1385445881, 369, '', '', 0, 0, 0, 0, 0),
(107, '谨慎投资的秘诀', '', '', '<p>随着互联网金融的盛行，作为一种从国外发展起来的互联网借贷模式，P2P网贷平台在国内虽然得到了迅猛发展，让大家慢慢的了解起来。可是网贷的信用体系和监管体系不完善的，让大多数的人担忧。<br /> &nbsp; &nbsp; 作为一名投资者想尝试着网贷投资，首先您需要制订储蓄投资计划。建议将每月收入的一部分转为定期存款进行储蓄，虽然金额只占收入的一小部分，但从长远来 看，就可以积累一笔不小的资金。此外建议，一定要进行多家网贷平台进行对比，可以从小金额开始起投，慢慢的与平台进行磨合与信任，人都可以分为好人与坏 人，何况平台呢？理财初期的资产配置应以稳健为主，增强抗风险能力，没有足够的把握，不宜进行风险较大的投资。<br /> &nbsp;&nbsp;　巴菲特说，成功的秘诀有三条：第一，尽量避免风险；第二，尽量避免风险；第三，坚决牢记前两条！通胀形势之下的理财更应该注重风险控制。</p>', 'admin', 1385446019, 369, '', '', 0, 0, 0, 0, 0),
(108, '把握投资心态 坚守投资习惯', '', '', '<p><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,">&nbsp; &nbsp; 投资虽然只是由简单的建仓和平仓构成，但从中却蕴含了很深技巧，想成为一名成功地投资者，就一定要养成一系列的好习惯，就像要有一个好身体就要养成早睡早起、合理饮食等等好习惯一样。习惯<font face="Times New Roman">--</font><font face="宋体">尤其是好习惯</font><font face="Times New Roman">--</font><font face="宋体">虽然不容易养成，但为了我们投资的最终目的</font><font face="Times New Roman">--</font><font face="宋体">盈利，我们必须要这么做。下面的这</font><font face="Times New Roman">23</font><font face="宋体">种投资的制胜习惯是很多的投资大师不约而同形成并坚持保持的，也正是这些投资习惯指引着他们一步一步的走到了福布斯的富翁排行榜上。</font><br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">1</font><font face="宋体">、保住现有财富</font><br /> 　　制胜习惯：保住资本永远是第一位的<br /> 　　投资大师：相信最重要的事情永远是保住资本，这是他投资策略的基石。<br /> 　　失败的投资者：为一的投资目标就是<font face="Times New Roman">"</font><font face="宋体">赚大钱</font><font face="Times New Roman">".</font><font face="宋体">结果，他常常连本钱都保不住。</font><br /> </font></font></font></p><p style="text-indent:nullem;text-align:left;">&nbsp;</p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">2</font><font face="宋体">、投资大师们不冒险么？</font><br /> 　　制胜习惯：努力回避风险<br /> 　　投资大师：作为习惯一的结果，他是风险厌恶者。<br /> 　　失败的投资者：认为只有冒大险才能赚大钱。<br /> 　　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,">&nbsp;&nbsp;3<font face="宋体">、</font><font face="Times New Roman">"</font><font face="宋体">市场总是错的</font><font face="Times New Roman">"</font><br /> 　　制胜习惯：发展你自己的投资哲学<br /> 　　投资大师：他有他自己的投资哲学，这种哲学是他的个性、能力、知识、品位和目标的表达。因此，任何两个极成功的投&nbsp; &nbsp;&nbsp;&nbsp;</font></font></font></p><div align="left">&nbsp; &nbsp;&nbsp; &nbsp; <font face="Tahoma,"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">资者都不可能有一样的投资哲学。<br /> 　　失败的投资者：没有投资哲学，或相信别人的投资哲学。<br /> 　</font></font></font></div><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Times New Roman">4</font><font face="宋体">、衡量什么取决于你</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,">制胜习惯：开发你自己的个性化选择、购买和抛售投资系统<br /> 　　投资大师：已经开发并检验了他自己的个性化选择、购买和抛售投资系统。<br /> 　　失败的投资者：没有系统，或者不加检验和个性化调整地采纳了其他人的系统。（如果这个系统对他来说不管用，他会采</font></font></font></p><div align="left">&nbsp; &nbsp;&nbsp; &nbsp; <font face="Tahoma,"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">纳另一个还是对他不管用的系统。）<br /> 　　</font></font></font></div><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,">5<font face="宋体">、集中于少数投资对象</font><br /> 　　制胜习惯：分散化是荒唐可笑的<br /> 　　投资大师：认为分散化是荒唐可笑的。<br /> 　　失败的投资者：没信心持有任何一个投资对象的大头寸。<br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">6</font><font face="宋体">、省一分钱等于赚一块钱</font><br /> 　&nbsp;&nbsp;制胜习惯：注重税后收益<br /> 　　投资大师：憎恨缴纳税款和其他交易成本，巧妙的安排他的行动以合法实现税额最低化。<br /> 　　失败的投资者：忽视或不重视税收和其他交易成本对长期投资的影响。<br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">7</font><font face="宋体">、术业有专攻</font><br /> 　　制胜习惯：只投资于你懂得领域<br /> 　　投资大师：只投资于他懂的领域。<br /> 　　失败的投资者：没有认识到对自身行为的深刻理解是成功的一个根本性先决条件。很少认识到盈利机会存在于（而且很有</font></font></font></p><div align="left">&nbsp; &nbsp;&nbsp; &nbsp; <font face="Tahoma,"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">可能大量存在于）他自己的专长领域中，同时，对专业的学习机会不抓住，失去成为专业的可能。<br /> 　</font></font></font></div><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">8</font><font face="宋体">、如果你不知道何时说</font><font face="Times New Roman">"</font><font face="宋体">是</font><font face="Times New Roman">",</font><font face="宋体">那就永远说</font><font face="Times New Roman">"</font><font face="宋体">不</font><font face="Times New Roman">"</font><br /> 　　制胜习惯：不做不符合你标准的投资<br /> 　　投资大师：从来不做不符合它标准的投资。可以很轻松地对任何事情说<font face="Times New Roman">"</font><font face="宋体">不</font><font face="Times New Roman">".</font><br /> 　　失败的投资者：没有标准，或采纳了别人的标准。无法对自己的贪欲说<font face="Times New Roman">"</font><font face="宋体">不</font><font face="Times New Roman">".</font><br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">9</font><font face="宋体">、用自己的投资标准虑光器观察投资世界</font><br /> 　　制胜习惯：自己去调查<br /> 　　投资大师：不断的寻找符合他的标准的新投资机会，积极进行独立调查研究。只愿意听取那些他有充分的理由去尊重的投资家或分析家的意见。<br /> 　　失败的投资者：总是寻找那种能让他一夜暴富的<font face="Times New Roman">"</font><font face="宋体">绝对</font><font face="Times New Roman">"</font><font face="宋体">好机会，于是经常跟着</font><font face="Times New Roman">"</font><font face="宋体">本月热点消息</font><font face="Times New Roman">"</font><font face="宋体">走。总是听从其他某个所谓</font><font face="Times New Roman">"</font><font face="宋体">专家</font><font face="Times New Roman">"</font><font face="宋体">的建议。很少再买入之前深入研究一个投资对象。他的</font><font face="Times New Roman">"</font><font face="宋体">调查</font><font face="Times New Roman">"</font><font face="宋体">就是从经纪人和顾问那里或昨天的报纸上得到最新的</font><font face="Times New Roman">"</font><font face="宋体">热点</font><font face="Times New Roman">"</font><font face="宋体">消息。</font><br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">10</font><font face="宋体">、如果无事可做，那就什么也不做</font><br /> 　　制胜习惯：有无限的耐心<br /> 　　投资大师：当他找不到符合他的标准的投资机会时，他会耐心等待，直到发现机会。<br /> 　　失败的投资者：任何时候都必须在市场中有所行动。<br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">11</font><font face="宋体">、叩动扳机</font><br /> 　　制胜习惯：即刻行动<br /> 　　投资大师：在做出决定后即刻行动。<br /> 　　失败的投资者：迟疑不决。<br /> </font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">12</font><font face="宋体">在买之前就知道何时卖</font><br /> 　　制胜习惯：持有赢钱的投资，直到事先确定的退出条件成立<br /> 　　投资大师：持有赢钱的投资，直到事先确定的退出条件成立。<br /> 　　失败的投资者：很少有事先确定的退出法则。常常担心小利润会转变成损失而匆匆脱手，因此经常错失大利润。<br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">13</font><font face="宋体">、永远不要怀疑你的系统</font><br /> 　　制胜习惯：坚定的遵守你的系统<br /> 　　投资大师：坚定的遵守他自己的系统。<br /> 　　失败的投资者：总是<font face="Times New Roman">"</font><font face="宋体">怀疑</font><font face="Times New Roman">"</font><font face="宋体">自己的系统</font><font face="Times New Roman">--</font><font face="宋体">如果他有系统的话。改变标准和</font><font face="Times New Roman">"</font><font face="宋体">立场</font><font face="Times New Roman">"</font><font face="宋体">已证明自己的行为是合理的。</font><br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">14</font><font face="宋体">、承认错误</font><br /> 　　制胜习惯：承认你的错误，立即纠正它们<br /> 　　投资大师：知道自己也会犯错。在发现错误的时候即刻纠正它们，因此很少遭受大损失。<br /> 　　失败的投资者：不忍放弃赔钱的投资，寄希望于<font face="Times New Roman">"</font><font face="宋体">不赔不赚</font><font face="Times New Roman">",</font><font face="宋体">结果经常遭受巨大的损失。</font><br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">15</font><font face="宋体">、从错误中学习</font><br /> 　　制胜习惯：把错误转化为经验<br /> 　　投资大师：把错误看成学习的机会。<br /> 　　失败的投资者：从不在某一方法上坚持足够长的时间，因此也从不知道如何改进一种方法。<br /> 　　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,">16<font face="宋体">、光有愿望是没用的</font><br /> 　　制胜习惯：交学费<br /> 　　投资大师：随着经验的积累，他的回报也越来越多<font face="Times New Roman">……</font><font face="宋体">现在他似乎能用更少的时间赚更多的钱。因为他已经</font><font face="Times New Roman">"</font><font face="宋体">交了学费</font><font face="Times New Roman">".</font><br /> 　　失败的投资者：不知道<font face="Times New Roman">"</font><font face="宋体">交学费</font><font face="Times New Roman">"</font><font face="宋体">是必要的，也是正常的。如果能有专业的人指导或者团队服务更可以减少自身的投资风险。通过在实践中学习，避免重复同样的错误。</font><br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">17</font><font face="宋体">、沉默是金</font><br /> 　　制胜习惯：永远不谈论你在做的事情<br /> 　　投资大师：几乎从不对任何人说他在做什么。对其他人如何评价他的投资决策没兴趣也不关心。<br /> 　　失败的投资者：总是在谈论他当前的投资，根据其他人的观点而不是现实的变化来<font face="Times New Roman">"</font><font face="宋体">检验</font><font face="Times New Roman">"</font><font face="宋体">他的决策。</font><br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">18</font><font face="宋体">、委派的艺术</font><br /> 　　制胜习惯：知道如何用人<br /> 　　投资大师：已经成功地将大多数任务委派给了其他人。<br /> 　　失败的投资者：选择投资顾问和管理者的方法也同他做投资决策的方法一样（参考第十七条）。<br /> 　　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,">19<font face="宋体">、不管你有多少钱，少花点钱</font><br /> 　　制胜习惯：生活节俭<br /> 　　投资大师：花的钱远少于他赚的钱。<br /> 　　失败的投资者：有可能花的钱超过他赚的钱。<br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">20</font><font face="宋体">、钱只是副产品</font><br /> 　　制胜习惯：工作无关与钱<br /> 　　投资大师：工作是为了刺激和自我实现，不是为了钱。<br /> 　　失败的投资者：以赚钱为目标：认为投资是致富的捷径。<br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">21</font><font face="宋体">、专业大师</font><br /> 　　制胜习惯：爱你所作的事，不要爱你所拥有的东西<br /> 　　投资大师：迷恋投资的过程并从中得到满足；可以轻松摆脱任何个别投资对象。<br /> 　　失败的投资者：爱上了他的投资对象。<br /> 　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,"><font face="Times New Roman">22</font><font face="宋体">、这是你的生命</font><br /> 　　制胜习惯：<font face="Times New Roman">24</font><font face="宋体">小时不离投资</font><br /> 　　投资大师：<font face="Times New Roman">24</font><font face="宋体">小时不离投资。</font><br /> 　　失败的投资者：没有为实现他的投资目标而竭尽全力（即使他知道他的目标是什么）。<br /> 　　</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><font face="Tahoma,">23<font face="宋体">、吃你自己做的饭</font><br /> 　　制胜习惯：投入你的财产<br /> 　　投资大师：把他的钱投到了他赖以谋生的地方。例如，沃伦<font face="Times New Roman">·</font><font face="宋体">巴菲特的净财产有</font><font face="Times New Roman">99%</font><font face="宋体">是伯克夏</font><font face="Times New Roman">-</font><font face="宋体">哈撒伟的股份，乔治</font><font face="Times New Roman">·</font><font face="宋体">索罗斯也把他的大部分财产投入了量子基金。他们的个人利益与那些将钱托付给他们的是完全一致的。</font><br /> 　　失败的投资者：投资对他的净财产贡献甚微<font face="Times New Roman">--</font><font face="宋体">实际上，他的投资行为常常威胁到他的财富。他的投资（以及弥补损失的）资金来自于其他地方：企业利润、薪水。</font></font></font></font></p>', 'admin', 1385446111, 369, '', '', 0, 0, 0, 0, 0);
INSERT INTO `gica_z_article` (`id`, `title`, `art_info`, `art_keyword`, `art_content`, `art_writer`, `art_time`, `type_id`, `art_url`, `art_img`, `art_userid`, `sort_order`, `art_click`, `art_set`, `art_attr`) VALUES
(109, '投资，要坚持的三个原则 ', '', '', '<p><font face="微软雅黑"><font size="3"><font color="#000000">一、分散投资的原则</font></font></font></p><div align="left"><font face="微软雅黑"><font size="3"><font color="#000000">&nbsp; &nbsp;&nbsp; &nbsp; 目前我的资金分布在10多个网站，投资利率分布在9%到35%之间，大部分利率集中在20%左右。分散投资做到地域分散，尽量将资金分布在不同省份的网 站；做到老站与新站的分散，在人人贷、红岭创投等老站坚持投资，同时，对一些有考察报告，利率可观的新站也要涉入；做到不同行业的分散，如微贷的汽车贷要 投入，红岭的企业贷也要有投入；做到网络借贷与其他投资的分散，虽然大部分资金投资在网站，但还有部分资金在股市、亲戚朋友（免息）处（去年股市1900 多点的时候，曾将部分网站资金转移到股市，目前已重回网站。在生活中，如果亲戚朋友开口向我借钱，只要是正当用途，一般情况会出手相助。因为网络借贷，积 攒的是资金；亲戚朋友借钱，积攒的是亲情友情）。</font></font></font></div><div align="left"><font face="微软雅黑"><font size="3"><font color="#000000">&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;当然，分散投资会遇到两个问题。一是“篮子钱”（VIP费），在资金量不大的情况下，支付“篮子钱”并不划算，但现在很多新站开业都是免VIP费用 的，多去注册申请，这块费用很多可以省下；二是过于费精力的问题，现在很多网站有自动投标功能，启动这一功能后就可以坐等收益，平时没事偶尔逛逛第三方网 站论坛，看看新闻就OK了。</font></font></font></div><div align="left"><font face="微软雅黑"><font size="3"><font color="#000000">&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;二、长期投资的原则</font></font></font></div><div align="left"><font face="微软雅黑"><font size="3"><font color="#000000">&nbsp; &nbsp;&nbsp; &nbsp; 每到年终，就有投友发帖提醒：到了非常时期了，无论多高的收益不要去碰，落袋为安。我倒觉得，危机更是时机，网站投资，贵在坚持。投资有风险，不投资是最大的风险。落袋为安，但收益肯定是损失了。</font></font></font></div><div align="left"><font face="微软雅黑"><font size="3"><font color="#000000">&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;根据投资的72法则。10%的收益，7年多资金就可以翻倍；20%的收益，3年半就可以翻倍。在很大程度上，时间成本比利率要重要。一年12个月，一个月“落袋”不投资，24%的年利率就成了22%了。</font></font></font></div><div align="left"><font face="微软雅黑"><font size="3"><font color="#000000">&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;在未来的网贷投资路上，肯定还会有第二个、第三个“优易网”出现。如果你不幸中招，不要害怕、不要慌张。只要你在分散投资的基础上，坚持长期投资， 完全可以用时间来弥补损失。如果你投资平均分散在十个网站上，平均收益能达到20%多，一年中有一个网站跑路，那一年照样能达到10%左右的收益，如果有 两个网站跑路，还能基本实现保本，只要坚持投资，来年定能将损失补回来。留得青山在，不愁没柴烧。经济有起有落，但是我们不能丧失投资的信心。</font></font></font></div><div align="left"><font face="微软雅黑"><font size="3"><font color="#000000">&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;三、量力而行的原则</font></font></font></div><div align="left"><font face="微软雅黑"><font size="3"><font color="#000000">&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;我很想发挥资金的杠杆作用，用房贷去撬动网贷。但思量再三，还是没去行动。因为如果我用房贷投入网贷，风险就超出我的承受能力。投资一定要作最坏打算，要确保你所有的投资损失你的生活还能继续。</font></font></font></div><div align="left"><font face="微软雅黑"><font size="3"><font color="#000000">&nbsp; &nbsp;&nbsp; &nbsp; 投资的目的是实现你资金的增长，从而改善你和家人的生活。资金到达一定的程度，只是数字，没有其他的意义。在平时，我们经常看到某某企业破产，企业负责人 外逃；听到某某家产上千，但在一次危机下一夜返贫，负债累累。他人失败的案例，都是没能坚持“量力而行”的原则。我们要从他人的失败吸取教训，量力而行， 保证自己的安全。</font></font></font></div><div align="left"><font face="微软雅黑"><font size="3"><font color="#000000">&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;“理财交流”上有个投票，你是“职业放贷人还是业余投资者？”大部分投友是选择做一个业务投资者，我觉得这个选择是正确的。只有大家坚持本职工作， 社会才能进步，财富才能积累。要知道，从大的方面讲，干好工作、养好身体、培育好亲情友情，都是投资，都是你人生的一大笔财富。</font></font></font></div>', 'admin', 1385446215, 369, '', '', 0, 0, 0, 0, 0),
(110, 'P2P网贷投资新人投资指南', '', '', '<p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><strong>1<font face="宋体">、什么是</font><font face="Times New Roman">P2P</font><font face="宋体">网贷？</font></strong></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">答：简单的说，借款人（<font face="Times New Roman">A</font><font face="宋体">）如需</font><font face="Times New Roman">10</font><font face="宋体">万元，向平台（</font><font face="Times New Roman">B</font><font face="宋体">）申请借款——平台（</font><font face="Times New Roman">B</font><font face="宋体">）对其进行审核，发布借款公告（各种标）——投资人（</font><font face="Times New Roman">C</font><font face="宋体">）通过在平台上投标，将钱通过平台（</font><font face="Times New Roman">B</font><font face="宋体">）借给借款人（</font><font face="Times New Roman">A</font><font face="宋体">）——约定期限到期后，借款人（</font><font face="Times New Roman">A</font><font face="宋体">）通过平台（</font><font face="Times New Roman">B</font><font face="宋体">）偿还本金及之前所约定的利息。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">.</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><strong>2<font face="宋体">、</font><font face="Times New Roman">P2P</font><font face="宋体">网贷违法吗？</font></strong></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">答：当前，我国法律尚没有对互联网金融的明确规定，因此，我们仅将<font face="Times New Roman">P2P</font><font face="宋体">平台定义于民间借贷，需要注意的是，若故意以高利率吸引他人出借款项并将资金用于套利的或者以欺骗手段骗取他人出借款项的，将构成犯罪，要追究相应的刑事责任。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">.</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><strong>3<font face="宋体">、通过</font><font face="Times New Roman">P2P</font><font face="宋体">投资可以达到多大的收益？</font></strong></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">答：投资保守的网贷平台年收益<font face="Times New Roman">8%</font><font face="宋体">—</font><font face="Times New Roman">10%</font><font face="宋体">，投资稍有风险的网贷平台年收益</font><font face="Times New Roman">10%</font><font face="宋体">—</font><font face="Times New Roman">20%</font><font face="宋体">，投资风险适中的网贷平台年收益</font><font face="Times New Roman">20%</font><font face="宋体">—</font><font face="Times New Roman">30%</font><font face="宋体">，投资风险较大的网贷平台年收益</font><font face="Times New Roman">30%</font><font face="宋体">—</font><font face="Times New Roman">45%</font><font face="宋体">。一句话，风险越大，收益越高。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">.</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><strong>4<font face="宋体">、投资</font><font face="Times New Roman">P2P</font><font face="宋体">网贷平台需要哪些必备条件？</font></strong></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">答：银行卡一张（开通网上银行），有闲杂资金未做保值增值财务筹划的投资者。在此，本人不建议用信用卡透支投资网贷，毕竟网贷有风险，有闲钱可以玩玩，把自己玩进去就没意思了。</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">.</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><strong>5<font face="宋体">、新人应该投资哪些网贷平台？</font></strong></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">答：目前国内平台如雨后春笋，最早的成立于<font face="Times New Roman">2007</font><font face="宋体">年，截止目前已有</font><font face="Times New Roman">200</font><font face="宋体">多家，到底应该投资什么样的平台的确是个问题。本人建议投资信用高，服务好，保本保息但收益较低的平台。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">.</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><strong>6<font face="宋体">、</font><font face="Times New Roman">P2P</font><font face="宋体">平台各种借款标简单介绍？</font></strong></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">答：当前，各个平台的借款标通常分为净值标、抵押标、信用标、担保标、秒标等，在此，仅就以上几种标进行解释。</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">净值标：其他投资人以自己的投资做担保发布的借款，利率通常比其他借款标要低，但保险系数要大一些。新人可以尝试从投净值标开始，熟悉投资流程。</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">抵押标：借款人用自己的房屋、车辆等实物在平台进行抵押后所发布的借款标，利率稍高。若借款人逾期，平台将拍卖处理抵押物用于偿还投资人。至于抵押物的处理，目前各个平台尚没有先例。</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">信用标：<font face="Times New Roman">P2P</font><font face="宋体">最早的借款标，以借款人的信用作为其借款额度的标准发布的借款。由于国外个人信用体系较为健全，因此在国外较为流行。但在我国，由于信用体系的不健全，信用标在各平台运行一段后逾期量较大，因此各平台已在逐步采用担保标或抵押标的形式取代信用标。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">担保标：其他投资人以其投资为借款人担保发布的借款，利率较高。担保标一度很流行，但由于一段时期部分借款人大量逾期，造成担保人损失严重而受到重创。</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">秒 标：通常属于娱乐标，平台老板或者借款人为吸引眼球发布的娱乐借款标，随借随还。通常秒标上线几分钟内就被抢光，需要投资者眼观六路、耳听八方，玩的就是 心跳。（注：不是所有的秒标都是好事，有相关人士认为，在一段时期大量发秒标的平台，意味着集中“圈钱”，有“跑路”的预兆。）</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">.</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><strong>7<font face="宋体">、新人投资技巧——怎么避开老赖？</font></strong></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">答：一旦您投资的某项借贷出现逾期，将会打乱您的资金周转计划，并造成利息损失，因此需要避开这些老赖。那么，请关注以下几点：</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">（<font face="Times New Roman">1</font><font face="宋体">）频繁地在平台上借钱的人，又无合理目的描述，要么是投机者（黄牛党），要么就是准备恶意赖账的老赖。前者风险较低些。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">（<font face="Times New Roman">2</font><font face="宋体">）借款利率高，且借款周期超过三个月，又无合理目的描述的，应避开。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">（<font face="Times New Roman">3</font><font face="宋体">）优先投资顺序按“秒标——净值标——抵押标——信用标——担保标”递减。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">（<font face="Times New Roman">4</font><font face="宋体">）大额标，有平台工作人员现场考察的优先。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">（<font face="Times New Roman">5</font><font face="宋体">）观察借款人信用，逾期笔数越少，逾期天数越少的可考虑优先投标。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">（<font face="Times New Roman">6</font><font face="宋体">）避开借贷人以下述目的为筹资方向的借贷，如：房地产、炒房、炒股等。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">.</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><strong>8<font face="宋体">、什么是网贷平台“黄牛党”？</font></strong></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">答：黄牛就是用自己的投资作为担保，发布借款标，然后高息放出，赚取差价的投资人。在有净值标的平台中，黄牛通常发布的都是净值标。如：以<font face="Times New Roman">365</font><font face="宋体">为例，通常黄牛发布年利率为</font><font face="Times New Roman">0.10%</font><font face="宋体">，奖励</font><font face="Times New Roman">1.6</font><font face="宋体">的净值标，其借款</font><font face="Times New Roman">100</font><font face="宋体">元的成本为</font><font face="Times New Roman">0.1+1.6+0.2</font><font face="宋体">（借款管理费）</font><font face="Times New Roman">=1.9</font><font face="宋体">，黄牛实际借款为 </font><font face="Times New Roman">100-1.9=98.1</font><font face="宋体">元。然后黄牛投资年利率为</font><font face="Times New Roman">25%</font><font face="宋体">以上的借款标，每年</font><font face="Times New Roman">100</font><font face="宋体">元利差为</font><font face="Times New Roman">1.7</font><font face="宋体">左右，具体可细算。</font></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">.</font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;"><strong>9<font face="宋体">、新人如何增强自己对平台判断能力？</font></strong></font></font></p><p style="text-indent:nullem;text-align:left;"><font face="Tahoma, Helvetica, SimSun, sans-serif"><font style="font-size:14px;">答：没有人天生下来就对某一事物有判别能力，因此，我的建议是泡论坛，多到一些客观、公正的论坛参与交流，对你的判断能力提升有好处。</font></font></p>', 'admin', 1385446481, 369, '', '', 0, 0, 0, 0, 0),
(111, '专注实体企业的P2P互联网金融新模式受青睐', '', '', '<p>“人人都是金融家”</p><p>&nbsp; &nbsp; P2P网络金融兴起的背后，源自于网络技术的发展，首当其冲的就是互联网安全技术。做一个明智的投资者，尤其是P2P互联网金融的投资者，对于风险的把控 和判断，决定着一切可控的美好愿望。在这个“人人都是金融家”的时代，笔者认为投资者必须掌握核心的风控措施，才能达成财富的愿望。其中，最重要的就是对 模式的选择。互联网企业的发展历史，就是商业模式的历史。互联网企业的成功，就是商业模式的成功，无数个成功和失败的案例已经证明了这点。对P2P金融投 资人来说，当然也要看重P2P金融平台的模式。<br /> &nbsp; &nbsp; 笔者常年观察国内多家P2P互联网金融平台，认为只有与“实体经济”密切联姻的平台，才可能具备最佳的商业模式和最佳的风险控制。P2P互联网金融，虽然 起源于美国的Prosper模式，但是我们独特的国情和人文环境，决定了不可能完全照搬。比如，美国是一个健全的信用社会，美国1915年出现了世界上第 一张信用卡，转眼信用消费快过了100个年头，信用体系建设，信用消费评估都进入了相当成熟的阶段。而且美国的银行存在着较为充分的竞争，信用体系向所有 机构开放。一个机构凭借个人的社会安全号，可以轻易调用到个人的信用记录。因此，美国人做P2P模式完全不需要将平台自身的信用加入其中，只需要做一个中 介信息服务平台。</p><p>&nbsp; &nbsp; “平台有实体，投资无疑虑”</p><p>&nbsp; &nbsp; 笔者对P2P金融平台的考察中发现，专注实体经济服务的平台模式，走出了一条有效风控之路，同时在不断践行着服务中国实体经济发展的宏伟理想。这些平台成 功之道，在于缩小原有借款人群体，只针对实体经济进行服务。投资人出身实体企业，拥有大量的生产制造实体资产，相比于只是纯粹“玩”资本的平台创始人更加 可靠，这首先应当成为P2P借贷投资人考量的因素。这些专注于实体经济的P2P网络金融平台，其成立的本质在于知道实体经济的融资困难，同时也有敏锐的视 觉看到优秀实体中小微企业的发展前景。因此，与高速成长的实体小微企业共同成长，才是投资人的至佳选择。<br /> &nbsp; &nbsp; P2P网络金融平台的另外一个重要作用不言而喻：最佳的投资，莫过于对高速成长企业的投资。平台的重要作用，在于让投资者全面了解哪些是高成长潜力的中小 企业，通过平台的甄别，投资人可以获得更高额的报酬，让每一个高成长潜力的实体企业成为帮助投资人赚钱的工具。帮助投资人辨识投资机会，才是P2P网贷平 台的本质意义。<br /> &nbsp; &nbsp; 专注实体经济的P2P网络金融，从整体经济的运行来看，堪称利国利民的好事。它既发挥了互联网金融的能动性，又给投资人以更大的安全保障，重要的是在这个 实体企业贷款难的时代，其有效推进了实体经济的发展。更值得一提的是，这种模式可以有效规避宏观金融政策对P2P的担忧，坐实，是未来P2P互联网金融长 治久安的不二之选。对于投资人而言，实体企业投资便于追责，风险更小，而投资收益更大。<br /> &nbsp; &nbsp; 人们可以预见，专注高成长的实体企业P2P金融投资模式，将会使整个行业的未来焕发出灿烂的财富之光。</p>', 'admin', 1385446565, 338, '', '', 0, 0, 0, 0, 0),
(112, '三中全会互联网金融被383改革方案“特别鼓励”', '', '', '<p>作为十八届三中全会参考方案之一的“383改革方案”,在金融领域的改革建议中,“降低金融行业的准入门槛”被排在了首要位置。<br /> &nbsp; &nbsp; 相比其它金融机构,互联网机构在方案中被“特别鼓励”,这是否预示着未来互联网金融的发展将成为金融领域改革的重点?民间资本进入,又是否意味着一场新的金融改革将席卷而来?近日,记者采访了互联网企业和多位金融专家,解读金融领域改革的难点和方向。</p><p>互联网金融被“特别鼓励”</p><p>&nbsp; &nbsp; 随着未来金融行业的改革,互联网金融与传统金融行业将并存发展。有人戏称,互联网金融产业链上镶满淘金“梦想”,一只“小蚂蚁”如果插进一脚,未来很有可能变成“大象”。<br /> &nbsp; &nbsp; 互联网金融快速成为今年理财关键词。面对如此诱惑,专门服务小微企业的网上银行业务及基于网络的小企业贷款成为多家银行发力的对象,平安、招行等传统金融 机构也开始上线P2P产品。如今,全国P2P平台超500家,预计年底将达800-1000家;网贷行业全年预计超千亿。<br /> &nbsp; &nbsp; 这次金融领域的改革中,互联网机构被“特别鼓励”,给互联网金融发展释放了一个利好信号。“目前,我们的小微金融服务集团正在筹建中,届时将为小微企业和个人消费者提供网上支付、基金、保险、理财、小额贷款等服务。”<br /> &nbsp; &nbsp; “在法律上,应该给予这些网商平台合理、合法的市场准入以及开办银行的权利,获取金融机构的营业执照。”中国政法大学资本研究中心主任刘纪鹏说。</p><p>大银行与中小企天然不兼容</p><p>&nbsp; &nbsp; 除了互联网金融的热点外,民间资本进入金融领域的意义更加重大。“从温州金改来看,现在要更多扶持民营经济、中小企业尤其是小微企业的发展。”北京大学金 融与证券研究中心主任、教授曹凤岐也表示,这些年民间金融又处在一个不规范状态,这种错位对于中国经济进一步成长很不利,所以改革要让民间金融合法化、规 范化。<br /> &nbsp; &nbsp; 刘纪鹏也表示,中小企业融资难和实体经济发展难的治本途径就是打破目前国有商业银行的高度垄断,开放民间金融,大力扶持新兴民营金融机构的发展。<br /> “目前国内银行业有点两极分化的感觉,国有银行像大恐龙,而基层的银行机构则像小跳蚤。”刘纪鹏介绍,现有的银行体系和结构并不合理。<br /> &nbsp; &nbsp; 但大银行与中小企 业之间却存在着天然的不兼容性,一方面各大银行在投放贷款前需对企业资质进行详细考核,所消耗的成本相对较高,另一方面中小企业贷款数额少,压缩了银行的 获利空间。我国现在拥有中小企业接近2000万家,个体户近3000万户,现今结构的金融服务体系很难支撑如此庞大的中小企业及小微客户的金融需求,已经 严重抑制了中国经济的发展。</p><p>培育实体金融要结合产业特点</p><p>&nbsp; &nbsp; “并非只有开办银行才叫进军金融业,民间资本应结合自身的特点发展实体金融。”刘纪鹏说,产融结合是资本加速集中的有效方式,是产业资本和金融资本发展的 必然结果。因此, 在发展实体金融的同时,可以倾向于培育供应链金融,比如商贸物流和制造业企业完全可以围绕上下游产业链培育金融体系。<br /> &nbsp; &nbsp; 除了传统产业之外,刘纪鹏也提到金融体系中,包括网商金融,网商金融的发展势必成为今后我国商业银行体系的一支重要力量。</p>', 'admin', 1385446595, 338, '', '', 0, 0, 0, 0, 0),
(113, '银行试水P2P加速', '', '', '<p>&nbsp; 在互联网与金融相结合的大趋势下，传统银行在互联网金融方面的探索步伐正在加快。</p><p>&nbsp; &nbsp; 继招行试水P2P之后，《每日经济新闻》记者获悉，农行、浦发也开始涉足。农行目前已成立了专门的部门从事P2P平台的开发和研究，但该消息记者未得到农行证实。浦发也在和第三方机构合作涉足P2P行业。</p><p>&nbsp; &nbsp; 浦发为P2P做支付渠道</p><p>&nbsp; &nbsp; 据行业知情人士透露，目前农行已成立了专门的互联网金融部门，而其中有专门负责P2P研究的团队，预计农行的P2P平台将在年底上线。而浦发则采用另外一种方式，和外面的公司合作，以P2C的方式进入这个领域。</p><p>&nbsp; &nbsp; 浦发银行相关负责人接受&nbsp;《每日经济新闻》记者采访时指出，浦发不是自己建P2P网站，而是为第三方公司提供金融服务，目前浦发银行正为P2P公司做支付渠道，其他细节暂未披露。</p><p>&nbsp; &nbsp; 目前业界比较认可的中国首个P2P平台是在2007年进入中国的，在2012年之后得到高速发展。据网贷之家不完全统计，2011年，全国P2P平台大概 有50家，到今年9月末，这个数字已超过了500家，预计今年底将达到800——1000家；网贷行业去年全年成交量约200亿元，而今年全年预计会超过 1000亿元。</p><p>&nbsp; &nbsp; 面对P2P行业巨大的发展潜力，传统的金融机构也坐不住了，纷纷介入欲分一杯羹。在招行试水P2P之后，已有地方性银行向其了解关于P2P的事情。都认为，无论从互联网走向金融，还是从金融走向互联网，这是发展的大趋势。</p><p>&nbsp;&nbsp;民间P2P定位不同</p><p>&nbsp; &nbsp; 徐红伟对《每日经济新闻》记者表示，P2P平台，银行充当的是一个中介作用，也打破了银行受到存贷比等各方面的限制。</p><p>&nbsp; &nbsp; 东方证券报告指出，招行可能是为小微贷款需求另谋出路。小微贷款领域仍然是巨大的蓝海，大量优质需求难以得到充分满足。招行此举可能正是为了满足自身需求旺盛的小微贷款客户设立P2P平台，同时也创造了增量中间业务收入。</p><p>在P2P行业业内人士看来，传统金融机构对P2P行业的涉足，恰恰证明了P2P行业的潜力</p>', 'admin', 1385446638, 338, '', '', 0, 0, 0, 0, 0),
(114, '融资担保机构不良率低于银行贷款', '', '', '<p>融资担保行业以其增加信用水平的功能在促进小微企业融资方面发挥着独特的作用，但时不时爆发的风险事件让这个行当显得有点乱。</p><p>&nbsp;&nbsp; &nbsp;日前，在中国融资担保业协会成立大会上，银监会副主席阎兆星披露了融资担保业的最新发展状况。截至去年末，全国融资性担保行业共有法人机构8590家， 同比增加188家，增长2.2%，同比增幅减少37个百分点，其中国有控股1907家，占比22.2％，民营及外资控股6683家，占比77.8％。与机 构数量增速放缓不同，融资担保业整体行业资本和拨备持续增长，整体实力稳步增强。截至去年末，实收资本共计8282亿元，同比增长12.3%；行业担保准 备金合计701亿元，同比增长25.2%。<br /> &nbsp;<br /> &nbsp; &nbsp; 在业务开展方面，银担业务合作继续扩大，支持中小微企业融资的作用进一步增强。截至去年末，与融资性担保机构开展业务合作的银行业金融机构总计15414家，较年初增长10.3%；融资性担保贷款余额14596亿元，较年初增长12.3%。<br /> &nbsp;<br /> &nbsp; &nbsp; 在业务质量方面，融资性担保代偿率上升，但融资性担保损失率仍在低位。截至2012年末，融资性担保代偿余额249.5亿元，代偿率为1.3%，较上年末 增加0.9个百分点。融资性担保损失率为0.1%，较上年末增加0.1个百分点。截至去年末，融资性担保贷款不良率为1.3%，较年初增加0.5个百分 点，比银行业金融机构各项贷款不良率总体水平低近0.3个百分点。<br /> &nbsp;<br /> &nbsp; &nbsp; 阎兆星认为，发展数据说明，国务院2009年成立融资性担保业务监管部际联席会议后，融资担保行业自身在规范的同时，对中小微企业的融资增信作用不断增强。<br /> &nbsp;<br /> &nbsp; &nbsp; 融资担保行业是高杠杆、高风险的行业，可靠的担保实力、规范的风险管理和良好的声誉是这个行业的生存基础。“我们很难想象，一个缺乏规范的融资担保行业能 够在解决中小微企业融资难等问题上发挥更大的作用。”阎兆星表示，中国融资担保业协会的成立，将有助于解决行业现存的一些问题并提升行业整体能力素质。<br /> &nbsp;<br /> &nbsp; &nbsp; 据悉，协会将变被动接受监管为自觉规范行为，变无序竞争为有序合作，推动行业的规范健康发展。一是通过组织制定自律公约及技术标准、业务规范，提高行业的 专业化程度和服务水平，充分发挥行业自律对监管的补充作用；二是制定从业人员行为准则，培养职业操守，开展相关专业资格考试及评定，加强对从业人员的自律 管理；三是代表会员单位的共同利益，积极参与有关行业发展及与行业权益相关的决策论证，及时反映会员诉求及制约行业改革发展的问题；四是积极协调会员与监 管部门、银行业金融机构及其他相关主体之间的关系，做好会员之间的沟通，形成良性竞争、合作共赢、规范发展的共识。</p>', 'admin', 1385446682, 338, '', '', 0, 0, 0, 0, 0),
(115, '王岐山：应给予民间借贷合理性合法性', '', '', '<p style="margin:24px 0px 0px;padding:0px;border:0px;font-size:14px;background-color:rgb(255, 255, 255);">王岐山认为，所有的法都得服从宪法。法治建设不断推进，人大承担的立法任务会越来越重。对于刑诉法修改，王岐山表示赞成。他说，宪法是根本大法，法的从属关系上看，刑事诉讼法在刑法边上。</p><p style="margin:24px 0px 0px;padding:0px;border:0px;font-size:14px;background-color:rgb(255, 255, 255);">王岐山说，这么多年一直在思考情理法这三个字。有时候讲情讲理未必合法。实际上，中国要从情理法三者上不断探索他们的关系。“其实西方也一样。律师玩儿命地用各种方式影响陪审团，实际很多时候就出来了情，出来了理，而不完全是法了。”</p><p style="margin:24px 0px 0px;padding:0px;border:0px;font-size:14px;background-color:rgb(255, 255, 255);">王岐山说，他老想修改刑法，现在工作中就面对着问题。比如说，民间金融和所谓的非法高利贷，就得研究、界定。“因为现在我们说真的，民间借贷的这种合理 性合法性应该给予，咱们互相借点儿钱的事儿不是经常有的吗？很平常的。但是我们防止的什么？防止的是非法集资，防止旧社会的‘驴打滚’。”</p>', 'admin', 1385446722, 338, '', '', 0, 0, 0, 0, 0),
(116, '调查：网贷行业市场最为活跃的网贷系统绿麻雀', '', '', '<p>P2P网贷系统，是P2P借贷与网络借贷相结合的金融服务网站。作为现下最具有发展的朝阳产业，其对现代企业乃至个人的影响是越来越大，同时也促使了一 批站在时代前列的p2p网贷代表企业。日前，记者专访了菏泽市伟德电子科技有限公司旗下绿麻雀网贷系统负责人王伟，王伟就“安全”、“可靠”、“专业”、 “全面”等方面，详细解读了绿麻雀从开发研制到获得中国软件评测中心安全测试以至最后怎样获得了广大客户的好评这一发展历程。<br /><br /> 　　绿麻雀系统由菏泽市伟德电子科技有限公司推出，是目前市场上功能最为齐全与成熟的一套P2P借贷系统，其致力于为中小微企业、创业投资人士及各公司白 领提供最安全、最可靠的IT解决方案，包括p2p网贷网站、贷款催收管理系统、网站运营策划等等，正是有了这些贴心化的设计与服务才促使了绿麻雀深得广大 客户的拥护与信赖。推出至今，绿麻雀网贷平台系统先后为融进所、小商贷、成功贷、新华贷、融易信、莱商贷、国安贷、泰山贷、微贷中国等近三十多家大型企业 搭建了P2P网贷网站及运营平台。<br /><br /> 　　作为网贷系统中的佼佼者，绿麻雀始终以设计品牌影响力、诚实守信、争取互利互赢的文化理念及其领先的网络营销能力服务于社会大众，实时把握时代脉搏，从不间断推陈出新，力争成为行业中最具安全可靠的时代先锋。<br /><br /> 　　绿麻雀虽然是最新研制的一版网贷系统，但其功能强大，设计全面，借款标种丰富，拥有净值标，秒还标，抵押标，担保标，信用标，天标，竞价标，流转标 等，并且拥有自动投标，自动还款，自动备份等功能，正是由于这些强大的功能，促使越来越多的客户更信任绿麻雀，甚至于依赖绿麻雀，因为他们相信，绿麻雀会 为他们带来好的丰厚效益与较高的人气。<br /><br /> 　　随着p2p网贷行业的迅速发展，人们对投资理财也会越来越发的关注，而网贷系统的开发也会因为这些外界因素而备受瞩目，而这些外在的因素都会成为绿麻 雀不断前进的动力，相信，通过团队的不断努力加上产品本身的颇受认可的领先技术，较短的时间内，成为市场上占有量第一的几率不在意料之外。</p>', 'admin', 1385447027, 338, '', '', 0, 0, 0, 0, 0),
(117, '绿麻雀网贷系统：专业定制p2p借贷系统平台', '', '', '<div id="Cnt-Main-Article-QQ" style="position:relative;"><p>时至当下网贷作为最为火热的潮流行业，越来越备受人们的关注，而也正是由于这股潮流之风，<span>p2p</span>网贷自然而然的就被推到了时代先锋的风口浪尖上。</p><p>近几年，随着国内<span>p2p</span>网络借贷平台的迅速发展，投资用户对<span>p2p</span>借贷系统的要求也是越来越高，因为涉及到个人资金的在线进入与放出，所以不论是在安全方面还是系统负载力方面要求都是很高的。</p><p>P2P绿麻雀网贷系统是菏泽市伟德电子科技有限公司于<span>2011</span>年<span>10</span>月份开发的一套专业性很强的<span>p2p</span>借 贷系统，而根据该系统负责人王伟给出的数据不难看出，现下市场上大多数的平台都在使用该系统。从研发出世到现在，已经时隔两年的时间，绿麻雀始终以设计品 牌影响力、诚实守信、争取互利互赢的文化理念及其领先的网络营销能力服务于社会大众，超前的理念、先进的技术、专业的服务、完善的体系，使绿麻雀网贷成为 创立最早，市场占有率第一的网贷行业领军品牌。</p><p>绿麻雀网贷系统版本的多样化，给了广大投资人士一个很好的广阔发展空间，不论选择哪一版式，都能够得到很好的全方位的技术支持于售后服务。这些版本 包括网络普及模式的普通版、创新流转模式的流转版、普通流转两模式综合体的超级版和即将上市的普通模式的多城市版。其流转版是一款类似于安心贷借贷模式的 程序，包括流转担保标、整合手机短信、<span>QQ</span>登陆、微博登陆等。而普通版是具有国内主流<span>p2p</span>网贷平台所有功能和最新开发的功能，且当前主流的借贷网站都是用的这种模式，比如拍拍贷、红岭创投等。另外，最新功能还具有最详细的统计功能、推广功能、分站功能和客服系统等，这些多样化的网贷功能让你拥有一个全国分站化的不一样的网站平台。</p><p>中国小微金融的春天即将到来，互联网金融创新的巨大能量就会释放出来，绿麻雀网贷系统将集多年的系统开发经验和顾客的有力支持这些强大的有力资源，帮助互联网金融领域的企业释放强大的资本实力与互联网商机。</p></div>', 'admin', 1385447134, 338, '', '', 0, 0, 0, 0, 0),
(118, '绿麻雀：专心研发p2p网贷系统', '', '', '<p>索引：今年以来，投资市场低迷，市民纷纷寻找新的理财方式，以达到保值增资的目的。p2p网贷系统作为现下新兴的金融产品，受到了越来越多人士的青睐。</p><p>近日，各小微企业和各个专业性强的p2p网贷系统研发商私下组织了一个小的研讨会，本次聚会以“创新、求实、服务、发展、高效、诚信”为主题，以p2p网贷系统研制为主要探讨对象，虽然是一个小小的探讨聚会，却促使他们彼此互相学习，取长补短。</p><p>今年以来，投资市场低迷，市民纷纷寻找新的理财方式，以达到保值增资的目的。P2P网络借贷作为新兴的金融产品，自然也就成为现下讨论的一大焦点。而 作为专门研制p2p网贷系统软件开发的菏泽市牡丹区伟德电子科技有限公司更具有发言权，且其负责人王伟也坦率的和大家分享了现下的发展局势和业绩心得。</p><p>P2P网络借贷对绝大数人来说是陌生的，据伟德电子科技相关负责人王总介绍，P2P网络借贷是将线下的民间借贷搬到网上，以互联网为媒介，投资者只需 在网站上注册会员，充值账户，轻轻点击鼠标，即可完成投资。与传统理财方式相比，P2P具有足不出户、操作简便、收益高的优势，但在这一方便快捷的前提下 是需要有一个好的网贷系统做支撑，更需要一个好的技术团队去维护。</p><p>伟德电子科技有限公司作为一家致力P2P网贷系统开发，运营、策划等一体的互联网金融信息服务商，其目前服务的P2P网贷平台多不胜数，绝大多数的平 台运营良好，如朋友贷、积储在线、鲁商贷等等。有这样的好的成绩不得不归功于该公司新研制的绿麻雀网贷系统(www.lvmaque.com)，该系统一 直以设计品牌影响力，诚实守信，争取互利互赢的文化理念，领先的网络营销能力为广大客户服务。他们一条龙的服务更是得到不少客户的青睐，包括网站建设的系 统开发、服务器提供人员培训、网站初期策划和网站宣传营销等。</p><p>伟德电子科技不断创新发展，加强技术研发，巩固数据安全，努力促进中国p2p行业阳光透明、健康持续的发展。虽然新事物的道路向来是坎坷艰难的，但对于未来的前景王总始终抱有满满的信心，相信，在不久的时间内，他们会有一个好的成绩好的面貌展现在大家面前。</p>', 'admin', 1385447358, 338, '', '', 0, 0, 0, 0, 0),
(119, 'P2P理财应注意分散风险', '', '', '<p style="margin:15px 0cm 0px;background:white;"><span style="color:#333333;"><span>&nbsp; </span></span><span style="color:#333333;">随着网络信贷行业今年来的迅猛发展，<span>P2P</span>理财成为百姓理财的新热点，但<span>P2P</span>的鱼龙混杂以及高风险特性也不容忽视。将<span>P2P</span>作为资产配置的一部分并控制投资比例是更为理性选择，此外，还应将资金分散投资在不同的<span>P2P</span>平台，并选择不同标的。</span></p><p style="margin:15px 0cm 0px;background:white;"><span style="color:#333333;"><span>P2P</span>投资有两大风险，一是投资标的风险，即借款人可能违约的风险；二是<span>P2P</span>平台和担保公司的风险，目前很多平台对<span>P2P</span>借贷进行担保，或以其他担保公司进行担保，因此一旦<span>P2P</span>借贷风险产生，平台是否有足够的担保能力、平台的流动性管理能力都将影响<span>P2P</span>投资本金及收益的安全。</span></p><p style="margin:15px 0cm 0px;background:white;"><span style="color:#333333;">对<span>P2P</span>投资者来说，首先需要甄选<span>P2P</span>平台。由于<span>P2P</span>行业发展迅猛，各类<span>P2P</span>平台如雨后春笋般冒出，难免出现鱼龙混杂的现象，因此选择<span>P2P</span>平台是<span>P2P</span>投资的第一步，也是非常重要的一步。</span></p><p style="text-indent:32px;margin:15px 0cm 0px;background:white;"><span style="color:#333333;">在甄选<span>P2P</span>平台的过程中，一些投资者往往仅根据收益率的高低来选择<span>P2P</span>平台，有的投资者抱着侥幸心理，认为刚成立的<span>P2P</span>平台短期内不会出现问题，不知不觉间追求畸高的收益率，偏离正常的投资行为变成赌博，自然风险较高。像上海的诺诺镑客成立已经有四年之久，在行业内知名度也是比较高的，这类平台是稳健投资者不错的选择。</span></p><p style="text-indent:32px;margin:15px 0cm 0px;background:white;"><span style="color:#333333;">对收益率过高的<span>P2P</span>平台保持谨慎，原因之一在于，以过高的收益率吸引投资者的平台，开出天价收益率的动机需要分析，例如，是否是非法集资或为关联企业融资，目前已经出现问题的<span>P2P</span>平台中，有不少是将<span>P2P</span>平台当做募资平台解决关联企业资金困境。</span></p><p style="margin:15px 0cm 0px;background:white;"><span style="color:#333333;">另一原因在于，过高的收益率可能导致<span>P2P</span>平台投资者收益率和该笔贷款实际贷款利率的倒挂，<span>P2P</span>平台等于“赔本赚吆喝”，这种亏本经营能持续多久值得担忧。</span></p><p style="margin:15px 0cm 0px;background:white;"><span style="color:#333333;">因此投资者不要过于看重收益率，应将关注重点放在借款人的信用情况、经营状况、盈利能力、偿债能力上。<span>P2P</span>平台对借款人的信息披露是否充分、透明，<span>P2P</span>平台是否建立了一套完备的风控体系，提供有效的信息和方式帮助投资者甄别借款人的信用风险，这些才应该是投资者关注的重点。</span></p><p style="margin:15px 0cm 0px;background:white;"><span style="color:#333333;">此外，流动性风险也是导致部分<span>P2P</span>平台爆发风险的原因，<span>P2P</span>平台是否对可能出现逾期并引发集中兑付的产品有周全的安排和应对举措，这都是投资者需要了解的。</span></p><p style="margin:15px 0cm 0px;background:white;"><span style="color:#333333;">由于<span>P2P</span>平台风险的爆发，越来越多<span>P2P</span>平台引入了担保公司对<span>P2P</span>进行担保，但也不能因此盲目认为有担保公司担保的项目就安全，也有的担保公司担保能力较低，出现问题后，这类担保公司往往不具备垫付能力。因此了解平台的综合实力，包括风险控制能力、流动性管理能力，以及是否有强大实力的股东背景，就至关重要。</span></p><p><span style="color:#333333;">出于降低风险的考虑，投资者在投资<span>P2P</span>时应分散投资风险，包括分散在不同的平台进行投资，以及本着“不要将鸡蛋放在一个篮子”的原则，控制家庭资产配置<span>P2P</span>类高风险资产的比例。</span></p>', 'admin', 1385448134, 342, '', 'UF/Uploads/Article/20131126144214837.gif', 0, 0, 0, 0, 0);
INSERT INTO `gica_z_article` (`id`, `title`, `art_info`, `art_keyword`, `art_content`, `art_writer`, `art_time`, `type_id`, `art_url`, `art_img`, `art_userid`, `sort_order`, `art_click`, `art_set`, `art_attr`) VALUES
(120, '银行试水P2P 市场反应火爆', '', '', '<p style="text-indent:2em;">随着人人贷、宜信等网络P2P不断涌现、风生水起，紧跟平安集团陆金所的步伐，近期招商银行试水P2P在业内引起了巨大的轰动。银行“正规军”也开始进入P2P，使得人们对这一从来被市场认为是高风险高收益、野蛮生长的领域有了新的认识。</p><p style="text-indent:2em;">记者昨日在招行“小企业E家”平台网页上看到，招行“e+稳健融资项目”正在火热募集中，投资门槛为1万元起，预期年化收益率为6.0%―6.3%，此前多期项目已被抢投一空。</p><p style="text-indent:2em;">●南方日报记者 黄倩蔚</p><p style="text-indent:2em;"><strong>招行8项目募1.5亿</strong></p><p style="text-indent:2em;">招行官网显示，这个名为“e+稳健融资项目”的P2P网贷，自9月17日开始上线，最小投资单位为1万元。招行平台显示，平台融资总额为3835万元，预 期收益总额为120.2万元。不过，记者粗略统计了一下，从仅58万元的项目融资，到最高达5000万元的融资项目，截至目前，该项目已成功发行8期，前 后多个项目加起来，项目滚动总额事实上已经高达1.48亿元。据业内测算，这已相当于国内首家P2P平台拍拍贷五年总交易量的三分之一。</p><div class="ad250x250 fLeft marRig10">&nbsp;</div><p style="text-indent:2em;">显然，与普通的P2P平台不一样，招行的P2P融资项目由于都是企业信贷，规模都大得多。但由于由银行的“大招牌”信用背书，这些项目无一不是轻松完成募资的。其中规模最大的一期为5000万元，在仅1天时间内就有76笔出资。</p><p style="text-indent:2em;">这8期融资项目，融资期限从177天至182天不等，预期年化收益率为6.1%―6.3%。融资用途大多表述为“日常经营性资金”、“采购资金”、“补充企业流动资金”等。</p><p style="text-indent:2em;">对每一期融资项目，招行均对融资方的“央行征信记录、近年财务报表真实性、授信质押方式、融资方在银行是否有授信”等关键信息进行了审核和披露，而项目的还款来源，则统一注明“银行兑付凭证”。不过，招行并没有明确指出项目的收益和本金是否有保证。</p><p style="text-indent:2em;">从招行“小企业E家”平台首页的宣传，可以看到这些“e+稳健融资项目”均为招行推荐项目，并打出了“高收益也可低风险”、“出资人享半年高收益”的字眼。在支付上，不仅限于招行卡，而是支持各家商业银行借记卡在线投标。</p><p style="text-indent:2em;"><strong>P2P投融资需求巨大</strong></p><p style="text-indent:2em;">事实上，除了喝“头啖汤”的平安集团陆金所和招行以外，近日还传出不少银行都正在摩拳擦掌准备进军P2P行业的消息。万惠投融董事长陈宝国在10月27日 举办的2013（首届）民间资本与互联网金融创新论坛上透露，“有地方性银行找我们交流P2P事宜，试图了解P2P理念，地方性银行也要做准备。”此 外，P2P第三方机构网贷之家创始人徐红伟也透露，农行、浦发将效仿平安、招行，试图杀入P2P行业，不过农行和浦发暂未就上述消息进行回应。</p><p style="text-indent:2em;">此外，记者也了解到，最近刚将电子银行部改为网络金融部的广发银行也有准备进入P2P领域的打算。</p><p style="text-indent:2em;">是什么让银行大鳄也纷纷投身P2P网贷领域呢？据业内估计，P2P网贷成交额有望从去年底的200亿元剧增至今年底的1000亿元，像陆金所、人人贷等相 对大型的网贷公司不少项目一上线不久便会被投资人争抢一空。这样的增长速度和需求情况预示着这一模式有着极大的经营空间。</p><p style="text-indent:2em;">不过，业内人士分析认为，银行试水P2P的初衷与定位不尽相同。以中国平安设立的P2P平台陆金所为例，陆金所高级品牌经理刘婕表示，“传统金融有很多没 有服务到的地方，比如做30万元以下小额贷款的就不多；另一方面，我们发现投资人的投资渠道很少，如果没有5万块钱连银行理财产品都买不到。所以陆金所定 位30万元以下，无论是融资端还是投资端，我们主要做这样的市场”。</p><p style="text-indent:2em;">此外，银行亦可以借此平台，在不占用本行信贷额度和存贷比指标的情况下，满足小微企业客户的信贷需求。“银行来做P2P，一方面可以规避信贷额度管控和银 行存贷比指标的制约，尽可能满足其中小企业客户的信贷需求；另一方面，通过产品发行和创设，银行亦可收获不菲的中间业务收入，应该说是一种积极的业务创新 尝试。”海通证券分析师此前对媒体表示。</p><p style="text-indent:2em;">市场人士认为，未来会有越来越多银行进军P2P领域。中央财经大学教授、中国银行业研究中心主任郭田勇也认为，传统银行业与互联网金融相结合，可以很快地把业务规模做上去，应该可以视作银行在利率市场化进程和探索转型之路上的一种创新。</p><p style="text-indent:2em;"><strong>银行引领P2P行业规范</strong></p><p style="text-indent:2em;">然而，与行业发展不对称的是，目前P2P监管却处于真空。事实上，前段时间，由央行牵头的一行三会以及工信部、公安部、财政部、国务院法制办组成的调研组曾到深圳重点调研P2P行业。</p><p style="text-indent:2em;">而银行的加入，毫无疑问会加快监管出台规范的进程。这也是众多网贷公司负责人在公开场合所提到的。人人贷创始人杨一夫表示，金融大鳄进场有利于P2P行业 走向阳光，也直接证明传统金融机构对P2P行业的认可，代表了行业发展的潮流，是一个积极信号，甚至有利于行业监管的加速推进。</p><p style="text-indent:2em;">此前有媒体引述知情人士的话透露，招行的该项业务已经在监管机构备案并获得监管批准。</p><p style="text-indent:2em;">相比较民间P2P，由银行搭建P2P平台无论在融资安全性还是风险控制方面都更具优势。且相比动辄高达20%年化收益率的小型新P2P公司项目，“正规军”给出的收益率水平可算得上是相当保守。如这次招行的6%―6.3%、平安陆金所的8%左右，在业内处于较稳健水平。</p><p style="text-indent:2em;">此外，因为考虑到现有的信用体系尚不足以让个人投资者判断借款人的信用，陆金所严格根据“一一对应”的方式来匹配投资和理财，并引入了平安融资担保（天 津）有限公司（简称平安担保）为本金、利息、逾期罚息进行全额担保。如借款人未能按时还款，并且逾期80天仍未还清，则由担保公司代偿。</p><p style="text-indent:2em;">与此同时，平安担保承担着筛选借款人的任务。他们利用平安集团的线下渠道收集材料，从而保证资料的真实性。之后，数据会传到后台中心进行审核，平安集团还专门从台湾引进了一个无抵押小额贷款的风控团队。</p><p style="text-indent:2em;">与平安集团通过子公司陆金所操作有所不同，招商银行是以一家传统商业银行的角色来创办P2P平台的，在融资安全性和风险控制方面更具优势，对风险偏好较低的投资人也更具吸引力。</p><p style="text-indent:2em;"><strong>电子银行</strong></p><p style="text-indent:2em;"><strong>迎来井喷期</strong></p><p style="text-indent:2em;"><strong>链接</strong></p><p style="text-indent:2em;">长期来看，电子银行的发展更将成为商业银行转型的关键一环。2013年银行中期业绩报告显示，16家上市银行的电子银行业务都有较大幅度的增长。目前，这 些银行的电子银行交易替代率普遍超过70%。其中，招商银行电子银行替代率为91.85%。与此同时，工商银行、农业银行、中国银行、交通银行、兴业银 行、光大银行、浦发银行等位于第二梯队，除光大银行，均达到70%以上。</p><p style="text-indent:2em;">从有披露电子银行业务收入的三家银行来看，其增幅都远超其它传统业务。据半年报显示，中信银行网络银行中间业务收入同比增长56.17%，而农行、建行在上半年已完成去年全年电子银行业务收入的60%。</p><p style="text-indent:2em;">事实上，推动电子银行发展的最大优势不仅在于给银行带来了“增量”业务，更减少了运营成本。以招行为例，截至2013年6月末，电子银行非现金业务替代率 为91.85%，其中，网上银行/手机银行替代率88.23%，相当于节省817个网点和6058个柜员机，较去年增加96个网点和723个柜员机，每年 可节省大量运营成本。</p><p style="text-indent:2em;">招行表示，其手机银行预计到今年底的交易量将达到10000亿元。上述招行零售银行部人士表示，因为抓住互联网革命带来的机遇，网上银行曾带动了招行电子银行业务的大发展。</p>', 'admin', 1385448341, 342, '', 'UF/Uploads/Article/20131126144541539.jpg', 0, 0, 0, 0, 0),
(121, '互联网金融 投资逻辑 找准“差异化”定位 ', '', '', '<p>&nbsp; 互联网金融现在是互联网和金融领域最火爆的话题。金融是否会成为下一个被互联网颠覆的行业成为讨论焦点，这种讨论对风险投资行业而言，则是有没有投资机会？该如何投资？</p><p>&nbsp;&nbsp;&nbsp;&nbsp;具体如何看互联网金融的投资价值？我们认为有这样几点，一、技术背景；二、差异化定位；三、平台优势；四、不越雷池。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;互 联网金融有广义和狭义之分，广义互联网金融泛指所有利用互联网技术开展的一切与信用货币的发行、保管、兑换、结算等相关经济活动，包括网上银行、券商基金 的网络销售、第三方支付、P2P借贷等。而狭义互联网金融则要从信用货币的融通角度分析，一般分为两种方式，直接融资和间接融资。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;直 接融资是指资金需求者直接向资金提供者借钱，典型的如股票、债券等。间接融资则是资金提供者将资金提供给金融中介（如银行），并获得利息，资金需求者则通 过金融中介获得资金。谢平教授将互联网金融模式定义为第三种融资模式，具有支付便捷、市场信息不对称度非常低，资金供需双方直接交易等特点，银行等金融中 介不再发挥作用，完全被取代。</p><table style="padding-right:10px;" class="" align="left" border="0" cellpadding="0" cellspacing="0"><tbody><tr><td><div id="adhzh" name="hzh">&nbsp;</div></td></tr></tbody></table><p>&nbsp;&nbsp;&nbsp;&nbsp;商业形态面面观</p><p>&nbsp;&nbsp;&nbsp;&nbsp;目前广义的互联网金融主要有三 种商业形态，一是传统金融机构将其金融业务互联网化，也就是所谓金融互联网，如网上银行、券商网络销售基金；二是互联网企业以自身技术、数据、渠道等优势 来开展金融业务，如余额宝、阿里金融、京东供应链金融等；三是以互联网概念为基础开展金融业务，如P2P借贷、众筹等。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;第一种商业 形态，主体是传统金融机构，包括银行、券商、保险公司等。传统金融机构参与到所谓互联网金融里来，其实仅仅是其金融业务互联网化，并未改变传统资金融通的 方式。从另一个角度来看，则是这种商业形态并无互联网技术对金融业务的创新和改变，只是借助一种新技术来降低金融业务交易成本。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;第 二和第三种商业形态，则是未来互联网金融发展的方向，但目前也存在许多问题。第二种的主体是互联网企业，或者说是拥有较强互联网技术背景，并拥有一定的平 台和数据，进而以此为基础开展金融业务。典型的如阿里巴巴在淘宝平台上开展金融业务，包括针对淘宝商家的小贷业务，也包括针对淘宝用户的余额宝等业务。其 优势在于阿里巴巴可以利用所积累的大数据进行风险控制，有效的风险控制才能实现所谓的金融脱媒，否则终究难以避免成为金融机构的一种渠道或者另一个金融中 介。当然，目前第二种商业形态里也包含了很多仅仅是金融机构开展业务渠道的互联网企业，在发挥渠道功能的同时也提供一些金融资讯等服务，典型的如东方财富 网等。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;从概念上看，第三种商业形态其实是真正的互联网金融。典型的如P2P借贷，借助P2P平台实现资金供需双方的直接融资，从而 实现金融脱媒。但国内的P2P借贷在相关的政策监管不完善和行业激烈竞争下，演变成了银行或担保公司，也就是不受国家对金融机构的监管却做着金融机构才可 以开展的业务，满足一部分中小企业及个人融资需求的同时，也蕴含着巨大的风险，众筹模式目前大部分带有公益性质，其投资价值还值得继续观察。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;找准“差异化”定位</p><p>&nbsp;&nbsp;&nbsp;&nbsp;对 投资机构而言，投资是为了获得收益，投资项目的标准则是盈利且能持续盈利。从目前VC/PE已投的互联网金融领域项目来看，主要集中于第三方支付、金融的 互联网服务平台以及P2P借贷平台。准确地讲，里面真正涉及到互联网金融业务的是第三方支付和P2P借贷。对于金融的互联网服务平台，最大优势在于只做平 台不参与金融业务，没有法律风险，能更加充分发挥互联网渠道的优势。对投资机构而言，这是典型的互联网模式，容易理解、能赚钱且风险小（特别是法律风 险）。第三方支付的投资价值在于其作为资金支付过程中信用中介，在互联网交易中从促进交易完成到创造交易所体现出的巨大发展潜力，同时，第三方支付也是目 前互联网金融领域参与金融业务并首先得到监管层认可。另外是P2P借贷，由于传统金融体系难以满足国内日渐庞大的中小企业及个人信贷需求，P2P借贷在一 定程度上能够起到补充作用，市场前景非常好。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;金融和互联网都是具有较高门槛的行业，需要较强的技术背景。金融行业的技术背景体现在 对行业有深刻理解，能够对金融体系运行规律有准确把握，特别是在构建金融风控模型等方面具有较强优势。互联网技术背景则体现在前期大量的软硬件设备投入， 并在诸如云计算、大数据等技术方面具有较强背景，这在互联网金融企业进行大数据分析、构建风控模型等方面能够形成优势。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;能够与传统 金融体系市场定位形成差异化，满足其不能满足的需求，对于互联网金融至关重要。这也是为何在概念部分强调“金融脱媒”是互联网金融的核心所在，如果不能抓 住这个核心，那非金融机构来参与金融业务面临的风险将非常高。从差异化角度分析，传统金融机构除拥有无可颠覆的制度性优势外，还有着多年积累下来的数据、 技术、人才等资源优势，非金融机构如果所从事业务完全与其对抗，短期内能够发挥其规模小所具有的灵活、反应快等优势，但长远看，基本没有竞争力。所以，差 异化定位无论从短期还是长期角度看，都是互联网金融投资考察的重要方面。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;阿里巴巴、京东等大型电子商务企业在互联网金融行业已做出 了一个标杆，其依托的就是电商平台。在互联网金融这个新兴业务启动初期，能够以平台为基础构建一个完善的生态系统，不仅有利于开展真正意义上的互联网金融 业务，还可以借助平台内多方参与所体现出的供需匹配来规避风险，并实现稳定盈利。另外，从互联网金融要实现金融脱媒角度看，提供平台也是实质所在。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;金 融行业与其他传统行业一个非常大的区别，在于法律监管非常严格，一旦跨越雷池，后果非常严重。近年因所谓非法集资而锒铛入狱的不在少数，暂且不讨论非法集 资罪名是否有问题，从投资机构角度出发，自然要避免被投企业这个风险。其实，目前最具代表性的P2P借贷也可以说是民间借贷网络化，P2P借贷的快速发展 （目前在册的已经有一千多家企业）是在享受政策监管滞后的红利，许多P2P借贷公司的业务游走在合法和非法边界上，而在行业竞争激烈的背景下，构建资金 池、利用信息优势编造假项目骗取资金等违法行为也部分存在。如果在法律风险规避上不进行仔细调查，后期给投资机构造成的损失将难以估量。所以，在对互联网 金融投资方面，对公司所从事业务的法律风险考察绝不可掉以轻心。</p>', 'admin', 1385448500, 342, '', 'UF/Uploads/Article/20131126144820827.jpg', 0, 0, 0, 0, 0),
(122, '互联网理财为百姓带来真实惠', '', '', '<p>金融市场的创新正以前所未有的速度向前推进，中央高层对金融创新的鼓励，将进一步助推金融创新的广度与深度。《中共中央关于全面深化改革若干重大问题的决定》明确提出，要“鼓励金融创新，丰富金融市场层次和产品。”</p><p style="margin:0px 0px 20px;padding:0px;color:#5e5e5e;font-family:宋体;font-size:14px;font-style:normal;font-variant:normal;font-weight:normal;letter-spacing:normal;text-align:left;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;">2013年可谓是中国互联网金融发展元年，继2010年新36条、2012年国务院正式把温州设为金融综合改革试验区之后，政府公开表示，民营资本进入 金融领域就要打破垄断，温州试点的成功经验要向全国推广，2013年更是包括国十条、上海自贸区等重大政策利好发布，特别是十八届三中全会更是明确要求 “鼓励金融创新，丰富金融市场层次和产品”，这些举措都被解读为中央有意打破国有银行垄断，民间金融改革尝试开放箭在弦上。</p><p style="margin:0px 0px 20px;padding:0px;color:#5e5e5e;font-family:宋体;font-size:14px;font-style:normal;font-variant:normal;font-weight:normal;letter-spacing:normal;text-align:left;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;">作为民间金融的一种新兴形式，P2P网络借贷和网络理财在2013年获得了突飞猛进的发展。在迅猛的发展后面是旺盛的民间理财的需求。长久以来，中国的 银行占着世界上最大息差的便宜，但是，银行理财产品利率低、期限长、门槛高、认购麻烦、赎回也麻烦，根本不能满足人们日常的理财需求，很多产品甚至连本金 都不能给予保障，很多手里有点闲钱的人苦于投资无门。而另一方面，国内的众多小微企业急需资金，而又苦于银行门槛太高，借款太难。因此，将借款人和理财人 以最高的效率连接在一起的网络借贷和理财(简称“网贷”)行业就应运而生了，这其中包括红岭创投、宜人贷、拍拍贷、利道网贷等一批优秀的互联网金融公司逐 渐以规范的管理、先进的运营模式，走在了中国互联网金融创新改革的前列，也给老百姓带来了实实在在的实惠。</p><p style="margin:0px 0px 20px;padding:0px;color:#5e5e5e;font-family:宋体;font-size:14px;font-style:normal;font-variant:normal;font-weight:normal;letter-spacing:normal;text-align:left;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;">近日，记者就中国互联网金融的行业态势，特地采访了国内知名的网络借贷和理财平台——利道网贷负责人何侨，毕业于中国政法大学，曾先后在北京市政法机 关、某中央国家部委、某香港上市公司和知名资源投资集团任职，具备丰富行业经验的何侨高度重视P2P行业的政策法律问题，他指出：目前国家已经把金融上升 到国家大战略的高度，之所以大力鼓励民间资本进入金融领域，大力推动金融创新改革，目的就是为了在未来的国际金融竞争中抢占新格局。因此，无论从中央政策 还是国家法律，政府对互联网金融的发展都是扶持和引导并重。由于中国的互联网金融起步基本上和国外同步，因此选择互联网金融作为中国金融创新改革的突破 口，将使我国互联网金融行业与国际一流企业站在同一起跑线上!利道网贷作为一家规范运营的互联网金融企业，采取了业内领先的“复合型P2P”模式，在进行 充分的市场调研的基础上，针对目前国内理财产品存在的门槛高、赎回难、周期长、灵活性不足等缺陷，在行业内率先提出对理财投资人实行“0门槛、0费用、0 风险、100%本息保障”制度，利道网贷第一次开创了“50元起投”、“债权转让”、“自动理财”、“30天短期天标”等金融创新产品，投资理财人实现享 受到当天赎回资金，预设条件自动理财等非常先进而人性化的产品体验，让理财不再是普通老百姓的奢望。同时，利道还在业内第一次引入了“360度服务”理 念，启用了全国客服专线，提出了“每一个客户都是大客户”的服务理念，实现让每个客户享受到银行大户才能享受的一对一专属服务，对于年老行动不便或是电脑 操作不太熟练的客户，利道网贷还可以实行上门指导服务。</p><p style="margin:0px 0px 20px;padding:0px;color:#5e5e5e;font-family:宋体;font-size:14px;font-style:normal;font-variant:normal;font-weight:normal;letter-spacing:normal;text-align:left;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;">在目前，银行主要服务于一些比较大的客户，网贷行业则可以满足那些真正的小微客户，网络理财、网络借贷以其小快灵的特点，是现有银行体系的有益补充。记 者也谈到了最近社会上对于P2P网贷有着不少的争议，问利道网贷如何看待这个问题。法律专业背景的何侨特别强调，目前P2P网贷行业可谓鱼龙混在，一些低 水平个体户性质的P2P平台网站漏洞百出，仅仅依靠砸广告、依靠推销人员的天花乱坠拓展市场，特别是一些P2P平台自身经营管理存在非常大的问题，以至于 破产跑路，对整个市场造成了较为恶劣的影响，但是这仅仅是行业中的极少数，整个行业依然处于国家鼓励和扶持，将来一定会有针对性的正式监管办法出台。何侨 指出，利道网贷第一次真正实现了有保障的100%本息保障，利道的复合型P2P模式，将第三方担保机构和利道平台自身的严格信用审核相结合，所有借款项目 都有至少三轮苛刻的风控评估方可上线发行，利道投入巨资建立了自己的信用评级系统，参考借鉴了国际著名信用评级机构FICO以及国内四大国有银行和知名担 保公司的信用审核体系，并斥巨资建立云计算系统，确保了大数据的运行安全。</p><p style="margin:0px 0px 20px;padding:0px;color:#5e5e5e;font-family:宋体;font-size:14px;font-style:normal;font-variant:normal;font-weight:normal;letter-spacing:normal;text-align:left;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;">中国改革开放20年，走过了很多国家100年要走的道路。人们的观念的发展有的时候很难跟上中国改革的速度。90年代的时候，中国人还接受不了信用卡， 而现在基本上白领们每个人都有信用卡;2000年初，大家对于网络支付非常害怕，到今天支付宝、财付通已经成为人们日常生活网购完全离不开的工具;到今 天，银行理财、信托、基金、股票等等理财产品已经非常丰富了，但是作为0门槛、0费用、0风险的利道网贷，却给老百姓带来了以往想都不敢想的理财实惠，我 们完全可以想象这一更加先进的互联网金融领军品牌的发展空间!</p><p style="margin:0px 0px 20px;padding:0px;color:#5e5e5e;font-family:宋体;font-size:14px;font-style:normal;font-variant:normal;font-weight:normal;letter-spacing:normal;text-align:left;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;">附：利道复合型P2P模式的起源及发展前景</p><p style="margin:0px 0px 20px;padding:0px;color:#5e5e5e;font-family:宋体;font-size:14px;font-style:normal;font-variant:normal;font-weight:normal;letter-spacing:normal;text-align:left;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;">复合型P2P模式源于“个人对个人小额借款”，是一种将小额资金聚集起来通过一个中间平台借给有资金需求人群的一种商业模式，该模式由2006年诺贝尔 和平奖得主尤努斯教授(孟加拉国)首创。自20世纪90年代以来，“个人对个人小额借款”在世界多国蓬勃发展，演进出众多发展模式，展现出良好的发展势 头。目前，国际知名的网络小额贷款服务平台有英国的Zopa、美国的Prosper和LendingCLub等机构，这些机构以其互联网金融创新模式和巨 大的市场前景深受国际风投资本的青睐。截至2013年11月，成立仅6年的LendingCLub公司就已获得包括摩根士丹利、Google公司、 FoundationCapital基金在内的风投融资，该公司估值现已高达23亿美元，成为美国估值最高的民营科技公司之一。（蔡小飞）</p>', 'admin', 1385448769, 342, '', 'UF/Uploads/Article/20131126145249232.jpg', 0, 0, 0, 0, 0),
(123, '民间借贷合法化早有铺垫 P2P望能步后尘 ', '', '', '<p>东方网11月26日报道：日前《温州市民间融资管理条例》（以下简称《条例》）通过。《条例》规定，单笔借款金额300万元以上、累计借款 1000万元以上、向三十人以上特定对象借款，均属大额民间借贷；凡涉及上述情形之一，借款人都应当自合同签订之日起15日内，将合同副本报送地方金融管 理部门或者其委托的民间融资行业服务机构备案。这意味着一直处于灰色地带的民间借贷，终于通过一部地方法规，首次获得了合法身份。</p><p><strong>央行早有定性</strong></p><p>早在2011年11月，中国人民银行有关负责人在接受采访时就表示，民间借贷是正规金融的有益补充，具有制度层面合法性。而当时对于“民间借贷”与所谓 “高利贷”的区别，根据《最高人民法院关于人民法院审理借贷案件的若干意见》规定，民间借贷的利率可以适当高于银行的利率，各地人民法院可根据本地区的实 际情况具体掌握，但最高不得超过银行同类贷款利率的4倍。</p><p>此次《条例》的通过其实是这种地方政府机构对“正规金融的有益补充”的进一步 落实。而对于利率上限，并未在《条例》中出现。仅规定利率由借贷双方协商确定，但不得违反国家有关利率限制的规定。对此媒体有报道称，今年9月，温州在上 报稿中曾规定，一月期以上的民间借贷，年化利率最高不得超过48%，超过则按高利贷予以行政处罚。但中央有关部门后引起了一些争议，并且明确要求修 改。”48%的利率上限，已经突破央行最高利率规定，并且会对高利贷形成正面导向作用，所以最终采用了模糊表述。</p><p><strong>P2P行业望能跟上</strong></p><p>P2P行业也是至今在灰色地带，民间借贷的合法化对一年以来受到关注的P2P网络借贷平台又有什么影响？几家较有规模的P2P网站负责人表示P2P做的 基本是小额借贷，而《条例》规定的单笔借款金额为300万元以上，因此对P2P行业并没有直接的影响。不过也表示，希望既然300万元、30人以上的标 准，已经远远超过了非法集资的标准（个人20万元，30人以上，单位100万元，150人以上）集资诈骗（个人10万元、单位50万元），那么P2P的合 法性问题，是不是可以有希望解决了？</p><p>据悉，9月底由央行联合多部委组成的调研小组在深圳对互联网金融尤其是P2P行业进行调研，一些地方监管部门也已将研究P2P纳入工作。P2P被“招安”的路线愈发明显。</p>', 'admin', 1385448946, 342, '', 'UF/Uploads/Article/20131126145545516.jpg', 0, 0, 0, 0, 0),
(124, '绿麻雀网贷系统：最具代表性的P2P借贷系统', '当今互联网金融行业火爆,互联网金融现在是以p2p网络借贷平台最为突出、我们公司在2011年p2p网络借贷平台刚刚流行的时候就介入了这一行业， 并且开发出了一套完善的p2p网贷系统,绿麻雀系统。', '', '<p>当今互联网金融行业火爆,互联网金融现在是以p2p网络借贷平台最为突出、我们公司在2011年p2p网络借贷平台刚刚流行的时候就介入了这一行业， 并且开发出了一套完善的p2p网贷系统,绿麻雀系统。</p><p>绿麻雀是我们原创开发的一款专业的p2p借贷系统，并且我们公司提供p2p网贷平台的全方位技术支持和网站运营策划,我们拥有一支高素质，高学历的技术管理团队，都是来自IT前沿，拥有高超的技术和丰富的制作经验。能为客户提供高质量服务。</p><p>经过两年多时间的发展和更新绿麻雀系统占网贷市场份额的百分之三十以上。</p><p>得到了广大网贷平台的认可和欢迎,解决网贷平台技术问题 网站功能二次开发等等业务</p><p>我们技术工程师十余名均是专业的 软件开发人员</p><p>采用安全快速的网站架构,充分保证用户网站资金安全</p><p>p2p网贷平台以后会是中国金融改革最重要的一个创新,这种平台以后会是各投资担保公司必备的网站。</p><p>p2p网贷平台大家所熟悉的几个人人贷 拍拍贷 安心贷 其实这些网站的功能看起来差不多其实他们每个网站的运营模式是不一样的,普通的p2p网贷模式网站很多了如果你真的想把一个平台做好 就一定要选择一个合适自己公司的运营模式 运营思路 大胆创新 只有创新才能有更好的发展更快的发展，我们公司会根据贵公司的实际情况为您量身打造一套适合贵公司的运营模式和方案。</p><p>至今为止我们已经策划了很多现在做的都不错的网贷平台的运营方案 运营指导。因为只有完善的运营方案平台才能做的更好 更顺利，网贷平台现在有很多了可是大部分思路模式都是一样的没有任何新意其实这样就限制了他们自身的发展。</p><p>随着p2p网络借贷平台的激增竞争也是很强烈,大家分分使用各种手段来进行网络宣传和推广，我们拥有两年网络网贷平台推广经验 并且有上万名好友的企业QQ可以群发。无论是做搜索引擎排名优化还是软文营销QQ群营销都是我们公司的特长，我们能在很短的时间内让网站拥有大量人气和投 资者。任何生意都一样 宣传最重要再好的平台宣传做的不到们也很难火起来。相信我们可以快速提高你们网站的知名度</p><p>我们拥有稳定、高速、安全的国内主机与极速美国主机，MS/MY数据库空间,企业邮局等;完美支持p2p网贷系统运作。费用便宜!</p><p>域名注册服务提供各类域名注册，且价格实惠!</p><p>绿麻雀系统一直以设计品牌影响力，诚实守信，争取互利互赢的文化理念，领先的软件开发能力为广大客户服务。且能为客户带来了便利并得到客户的一 致认可。以务实创新精神,服务与满足不同用户需求，追求精品;为客户提供高品质的服务，最大限度地满足客户的需求，携手 共创“双赢”。</p>', 'admin', 1385521517, 342, '', 'UF/Uploads/Article/20131127110517450.gif', 0, 0, 0, 0, 0),
(125, '绿麻雀网贷系统：在创新中获取价值!', '绿麻雀是一款专业的p2p借贷系统，并且提供p2p网贷平台的全方位技术支持和网站运营策划,拥有一支高素质，高学历的技术管理团队，都是来自IT前沿，拥有高超的技术和丰富的制作经验。能为客户提供稳定，高效的服务以及解决问题的最佳方案。', '', '<p>绿麻雀是一款专业的p2p借贷系统，并且提供p2p网贷平台的全方位技术支持和网站运营策划,拥有一支高素质，高学历的技术管理团队，都是来自IT前沿，拥有高超的技术和丰富的制作经验。能为客户提供稳定，高效的服务以及解决问题的最佳方案。</p><p>所 谓P2P即peer-to-peer，是个人对个人的一种贷款模式，其优势在于弥补了商业银行系统的不足，缓解中小企业融资难的问题，促成了民间资金的合 理配置。那么，怎样选择P2P产品?首先是寻找一个成熟的管理平台，好比银行理财产品我们更愿意选择国有大银行，基金类产品我们更愿意选择央企或国企背景 的信托一样。选择一个资本雄厚的平台无疑是安全保障的第一步。其次需要考虑的是在拥有雄厚的平台的条件下更需要一个好的安全网贷系统。如何甄选一个好的网 贷系统也是起步的难题。</p><p>绿麻雀是伟德电子科技有限公司最新研制的一款P2P借贷系统，并且提供p2p网贷平台的全方位技术支持和网站运营策划相关服务。其始终以设计品牌影响力、诚实守信、争取互利互赢的文化理念及其领先的网络营销能 力服务于社会大众，且一直以来受到了广大客户的一致认可与肯定。其功能分别从系统安全化、管理智能化、交互人性化、借贷多样化四方面进行优化设计，旨在提 升平台资金安全、方便管理维护、提升用户体验等。同时新系统还增加了安全检测、流转标、自动投标、自动备份等功能。除此之外，该系统的一条龙服务更是给客 户商添油加彩，包括网站建设系统开发，服务器提供人员培训、网站初期策划和网站宣传营销等等。</p><p>p2p网贷平台的上线必须是要有支撑P2P网 络借贷正常运转的具有一定复用性的站点或平台，一般拥有全套完整的资金流数据分析计算和支撑工具。为借贷双方提供信息流通交互、信息价值认定和其他促成交 易完成的服务。借贷交易系统后台支撑系统主要是对整个借贷交易系统进行管理、维护等功能，主要包括用户的账户管理、借款标的审核和发布、以及用户的实名认 证、手机认证等功能。此外，系统还拥有强大的数据统计功能，可实时观察平台交易的状态和最新的统计数据。</p><p>p2p 网贷系统开发是我们的专业核心服务，且拥有多项与互联网相关的产品和服务。可以满足不同类型企业的要求,此外与多家企业有着紧密的合作关系。借款者和投资 者的个人管理中心平台，主要包括个人资料管理、账户管理、借款标和投资标的管理以及明细、实名认证、在线充值和提现等等功能。</p><p>绿麻雀一直以 设计品牌影响力，诚实守信，争取互利互赢的文化理念，领先的网络营销能力为广大客户服务。且能为客户带来了便利并得到客户的一致认可。以务实创新精神,服 务与满足不同用户需求，追求精品;为客户提供高品质的服务，最大限度地满足客户的需求，携手共创“双赢”;成就客户价值观,方能与客成为忠诚可靠的合作伙 伴。</p>', 'admin', 1385521605, 342, '', 'UF/Uploads/Article/2013112711064511.png', 0, 0, 0, 0, 0),
(126, 'p2p网贷系统：首选绿麻雀！', '近期以来，P2P成 为一个热门词汇，而P2P平台上高达10%以上的年化收益率以及较低的门槛，对于普通投资者具有很强的吸引力。但随着P2P网贷一系列挤兑问题的发生，对 P2P风险的担忧也让市场争议声不绝于耳。近期有银行也悄然加入P2P的战局，促使更多的投资者关注P2P。', '', '<p>近期以来，P2P成 为一个热门词汇，而P2P平台上高达10%以上的年化收益率以及较低的门槛，对于普通投资者具有很强的吸引力。但随着P2P网贷一系列挤兑问题的发生，对 P2P风险的担忧也让市场争议声不绝于耳。近期有银行也悄然加入P2P的战局，促使更多的投资者关注P2P。</p><p>P2P绿麻雀网贷系统是菏泽市伟德电子科技有限公司于2011年10月份开发的一套专业性很强的p2p借贷系统，</p><p>而根据该系统负责人王伟给出的总结不难看出，现下市场上大多数的平台都在使用该系统。</p><p>p2p绿麻雀网贷系统呈现出来的系统版本的多样化，能够得到很好的全方位的技术支持和售后服务，包括网络</p><p>普及模式的普通版，创新流转模式的流转班，普通流转两模式综合体的超级版和即将上市的普通模式的</p><p>多城市版。其流转版是一款类似于安心贷借贷模式的程序，包括流转担保标、整合手机短信、QQ登陆、微博登陆等。</p><p>时代不断进步，技术革故鼎新。对网贷产品不断优化升级，力求完善、完满、完美，让用户享受更方便、更全面、更安全的服务，一直是绿麻雀系统所有研发和运营人员的光荣使命。</p><p>随着网贷行业的高速发展，人们对投资理财也会越来越发的关注，选择一款功能完善，安全，专业的网贷系统尤为重要，</p><p>但要重点考虑产品的投向、管理方式、产品的风险控制、系统的安全保障才能保证投资安全,绿麻雀网贷系统将是您最终的选择！</p>', 'admin', 1385521690, 342, '', 'UF/Uploads/Article/20131127110810269.jpg', 0, 0, 0, 0, 0),
