(313, '政策法规', '', '', '', '<p>&nbsp;</p><p style="text-align: center; margin: 0cm 0cm 0pt" align="center"><span style="color: #f00"><strong><span style="font-family: 宋体; font-size: 15pt">相关政策法规</span></strong></span></p><p style="text-align: left; margin: 0cm 0cm 0pt" align="left"><font size="3"><span style="font-family: 宋体; color: #333333">1</span><span style="font-family: 宋体; color: #333333">、<span style="color: #f90"><strong>民间借贷受法律保护</strong></span></span></font></p><p style="text-align: left; text-indent: 21pt; margin: 0cm 0cm 0pt" align="left"><span style="font-family: 宋体; color: #333333"><font size="3">民间借贷是指公民之间、公民与法人之间、公民与其它组织之间的借贷。只要双方当事人意思表示真实即可认定有效，因借贷产生的抵押相应有效，但利率不得超过人民银行规定的相关利率。民间借贷是一种直接融资渠道，银行借贷则是一种间接融资渠道。民间借贷是民间资本的一种投资渠道，是民间金融的一种形式。</font></span></p><p style="text-align: left; text-indent: 21pt; margin: 0cm 0cm 0pt" align="left"><span style="font-family: 宋体; color: #333333"><font size="3">《合同法》和《最高人民法院关于人民法院审理借贷案件的若干意见》从法律上肯定了民间借贷行为的合法性，同时，可以采用第三方对借款提供担保的方式，保障出借人收回借款本金、利息的权利。民间借贷受法律保护。依据《最高人民法院关于人民法院审理借贷案件的若干意见》的规定，公民之间、公民与法人之间、公民与其他组织之间的借贷属于民间借贷，作为一种民事法律行为，在行为人具有完全民事行为能力（年满<span>18</span>周岁，且不存在足以影响自身行为的精神疾病的情形）、意思表示真实且不违反法律、行政法规禁止性规定的情况下，民间借贷受法律保护。<span> </span></font></span></p><p style="text-align: left; text-indent: 21pt; margin: 0cm 0cm 0pt" align="left">&nbsp;</p><p style="text-align: left; margin: 0cm 0cm 0pt" align="left"><font size="3"><span style="font-family: 宋体; color: #333333">2</span><span style="font-family: 宋体; color: #333333">、<strong><span style="color: #f90">利率规定</span></strong></span></font></p><p style="text-align: left; text-indent: 21pt; margin: 0cm 0cm 0pt" align="left"><span style="font-family: 宋体; color: #333333"><font size="3">《合同法》第二百一十一条：自然人之间的借款合同对支付利息没有约定或者约定不明确的，视为不支付利息。自然人之间的借款合同约定支付利息的，借款的利率不得违反国家有关限制借款利率的规定。《最高人民法院关于人民法院审理借贷案件的若干意见》第六条：民间借贷的利率可以适当高于银行的利率，各地人民法院可根据本地区的实际情况具体掌握，但最高不得超过银行同类贷款利率的四倍（包含利率本数）。超出此限度的，超出部分的利息不予保护。<span> </span></font></span></p><p style="text-align: left; text-indent: 21pt; margin: 0cm 0cm 0pt" align="left">&nbsp;</p><p style="text-align: left; margin: 0cm 0cm 0pt" align="left"><font size="3"><span style="font-family: 宋体; color: #333333">3</span><span style="font-family: 宋体; color: #333333">、<span style="color: #f90"><strong>电子合同规定</strong></span></span></font></p><p style="text-align: left; text-indent: 21pt; margin: 0cm 0cm 0pt" align="left"><span style="font-family: 宋体; color: #333333"><font size="3">《合同法》第二章第十条规定：当事人订立合同，有书面形式、口头形式和其他形式。第十一条规定：书面形式是指合同书、信件和数据电文（包括电报、电传、传真、电子数据交换和电子邮件）等可以有形地表现所载内容的形式。<span> </span></font></span></p><p style="text-align: left; margin: 0cm 0cm 0pt" align="left"><span style="font-family: 宋体; color: #333333"><font size="3">&nbsp;</font></span></p><p style="text-align: left; margin: 0cm 0cm 0pt" align="left"><font size="3"><span style="font-family: 宋体; color: #333333">4</span><span style="font-family: 宋体; color: #333333">、<span style="color: #f90"><strong>担保规定</strong></span></span></font></p><p style="text-align: left; text-indent: 21pt; margin: 0cm 0cm 0pt" align="left"><span style="font-family: 宋体; color: #333333"><font size="3">《合同法》第一百九十八条订立借款合同，贷款人可以要求借款人提供担保。担保依照《中华人民共和国担保法》的规定。《最高人民法院关于人民法院审理借贷案件的若干意见》第十三条：在借贷关系中，仅起联系、介绍作用的人，不承担保证责任。对债务的履行确有保证意思表示的，应认定为保证人，承担保证责任。<span> </span></font></span></p><p style="text-align: left; margin: 0cm 0cm 0pt" align="left"><span style="font-family: 宋体; color: #333333"><font size="3">&nbsp;</font></span></p><p style="text-align: left; margin: 0cm 0cm 0pt" align="left"><font size="3"><span style="font-family: 宋体; color: #333333">5</span><span style="font-family: 宋体; color: #333333">、<span style="color: #f90"><strong>居间平台收费规定</strong></span></span></font></p><p style="text-align: left; text-indent: 21pt; margin: 0cm 0cm 0pt" align="left"><span style="font-family: 宋体; color: #333333"><font size="3">《合同法》第二十三章“居间合同”中第四百二十六条规定：居间人促成合同成立的，委托人应当按照约定支付报酬。对居间人的报酬没有约定或者约定不明确，依照本法第六十一条的规定仍不能确定的，根据居间人的劳务合理确定。因此贷款服务机构的存在和服务费的收取都是符合法律规定并受法律保护的。盛世汇盈既不吸储，也不放贷，作为一个网络信用管理及借贷服务中介机构，其业务范围和经营活动完全符合相关法律和国家的政策规定。盛世汇盈将在国家法律和相关政策的指引下，为广大借款人、出借人提供优质、高效的服务。</font></span></p><p style="text-align: left; text-indent: 21pt; margin: 0cm 0cm 0pt" align="left"><span style="font-family: 宋体; color: #333333"><font size="3">&nbsp;</font></span></p>', 0, 0, 1, 'zc', 0, 0, 0),
(341, '关于我们', '', '', '', '<div><img alt="" src="/UF/Uploads/Article/20131125183424.gif" style="height:256px;width:360px;float:right;margin:10px;" /> 　　XXX网站隶属于XXXXXX管理有限公司。XXXXXX经工商局登记注册于2013年成立，注册资本1000万。位于XXXXXXXXXXXXXXXXXXXXXXXXX。是目前XX地区最安全、最专业的网络信贷理财平台之一</div><div>XXXX顺应全球电子商务未来发展的趋势，充分挖掘互联网金融市场潜力，通过建立一个安全、高效、诚信、互惠互助的网络借贷平台，让人们有机会相互帮助实现双赢的结果，帮助投资者及创业者更好地应对目前世界金融危机影响下的经济困境。</div><div>我们深信，依赖现代网络创新技术将民间借贷引入的模式，定会在快捷、便利、透明的体系下得到更健康的发展，并实现利益最大化！</div><div>XXXXX严格遵守国家相关法律法规，并敦促其会员在信息发布和使用过程中严格遵守相关法规。同时，我们也将竭尽所能，不断完善对网站平台的管理！</div><div>让我们携起手来，愿您的财富同xxxx一起成长！</div><div>愿您的创业梦想，在盛世下飞翔！</div><div>&nbsp;</div><div><div><strong><span style="font-size:24px;">P2P平台介绍</span></strong></div><div>XXXXX采用创新的技术和理念，通过互联网建立一个安全、高效、诚信的平台，规范了个人之间的借贷行为，使之更加安全、有效。让人们有机会得到帮助，以及帮助到需要的朋友，同时得到更好的回报。</div><div>现实中朋友家人之间往往由于面子等问题不方便借款以及不好意思催款。XXXXX鼓励大家通过这一平台来帮助解决这些问题。另外，如果朋友家人正好没有钱帮您，而朋友的朋友很可能有闲钱，大家通过人人聚财这个平台就可传递这种信赖关系,扩大信赖的朋友圈子，解决自己的问题。</div><div>通过下面图片可以了解XXXXX如何工作的：需要钱的人发布信息，其他人以竞标方式参与，聚合大众的力量，以市场化的方式决定利率，以及监督借款行为。</div><div style="text-align:center;">&nbsp;<img alt="" src="/UF/Uploads/Article/20131125182918.gif" style="float:none;margin:0px;" /></div><div><strong><span style="font-size:24px;">平成立目的台</span></strong></div><div>为有需要帮助的人伸出援手！为有能力的人实现资产增值！让我们成为成功路上最好的伙伴！&nbsp;</div><div>&nbsp;</div><div><strong><span style="font-size:24px;">愿景</span></strong></div><div>打造一个全民参与、安全、高效、诚信、互惠互利的互联网金融服务平台</div><div>&nbsp;</div></div>', 4, 0, 0, 'dfafa', 0, 1350443735, 0),
