(322, '帮助中心', '', '', '', '<p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="color: #f90"><span style="font-family: 微软雅黑; font-size: 9pt; font-weight: bold">投标利息</span></span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="font-family: 微软雅黑; color: rgb(51,51,51); font-size: 9pt">　　借款人发布的借款标中标示的借款利息将由投资人获得。</span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="color: #f90"><span style="font-family: 微软雅黑; font-size: 9pt; font-weight: bold">投标奖励</span></span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="font-family: 微软雅黑; color: rgb(51,51,51); font-size: 9pt">　　借款人发布借款标时若附加借款奖励，投标奖励金额可设为借款金额的<font face="微软雅黑">0-2%</font><font face="宋体">，投资人将按投标金额的比例获得投标奖励。</font></span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="font-family: 微软雅黑; color: rgb(51,51,51); font-size: 9pt">　　例：如借款标总额<font face="微软雅黑">10</font><font face="宋体">万元、投标奖励为</font><font face="微软雅黑">1%</font><font face="宋体">，若投资人投标金额</font><font face="微软雅黑">1</font><font face="宋体">万元，投标奖励可获得</font><font face="微软雅黑">100</font><font face="宋体">元。</font></span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="color: #f90"><span style="font-family: 微软雅黑; font-size: 9pt; font-weight: bold">担保奖励</span></span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="font-family: 微软雅黑; color: rgb(51,51,51); font-size: 9pt">　　借款人发布担保标的时候应包含担保奖励，担保奖励金额可设为借款金额的<font face="微软雅黑">0.8-6%</font><font face="宋体">，投资人可以在申请获得担保人资格后进行担保标的担保操作。</font></span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="font-family: 微软雅黑; color: rgb(51,51,51); font-size: 9pt">　　例：如借款标总额<font face="微软雅黑">10</font><font face="宋体">万元、投标奖励为</font><font face="微软雅黑">1%</font><font face="宋体">，担保奖励为</font><font face="微软雅黑">1%</font><font face="宋体">，若投资人担保</font><font face="微软雅黑">1</font><font face="宋体">万元，投标</font><font face="微软雅黑">1</font><font face="宋体">万元，则投资人将可获得担保奖励</font><font face="微软雅黑">100</font><font face="宋体">元，投标奖励</font><font face="微软雅黑">100</font><font face="宋体">元。</font></span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="color: #f90"><span style="font-family: 微软雅黑; font-size: 9pt; font-weight: bold">考察提成</span></span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="font-family: 微软雅黑; color: rgb(51,51,51); font-size: 9pt">　　若投资人已经取得区域客服资格并愿意协同温州贷工作人员进行考察业务，九洲贷贷网站将给予会员一定的考察提成。</span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="color: #f90"><span style="font-family: 微软雅黑; font-size: 9pt; font-weight: bold">滞纳金</span></span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="font-family: 微软雅黑; color: rgb(51,51,51); font-size: 9pt">　　借款人正常使用借款额度，不会出现滞纳金与催收费等处罚费用，滞纳金按每天<font face="微软雅黑">0.8%</font><font face="宋体">计算，催收费用在逾期超过</font><font face="微软雅黑">30</font><font face="宋体">天后按</font><font face="微软雅黑">0.4%</font><font face="宋体">计算，并需要增加上门催收费用</font></span></p><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0">&nbsp;</p><p style="margin-top: 0pt; margin-bottom: 0pt" class="p0"><span style="font-family: 微软雅黑; color: rgb(51,51,51); font-size: 9pt"><font face="宋体"><span style="font-family: 微软雅黑; color: rgb(51,51,51); font-size: 9pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 本页面内容仅供参考，以网站的公告与具体规定为准。</span></font></span></p><!--EndFragment--><p style="text-align: left; margin-top: 0pt; margin-bottom: 0pt" class="p0">&nbsp;</p>', 5, 1, 0, 'help', 0, 1346243687, 0),
(371, '办公环境', '', '', '', '<p>此处上传公司办公环境照片</p>', 0, 0, 341, 'huanjing', 0, 1385012501, 0),
(364, '企业信用等级说明', '', '', '', '<p><span style="font-size: 18px"><span style="font-family: simsun"><font size="4"><span style="color: #00f">信用等级</span>是<font size="4">盛世投资</font>用来评估款人信用所使用的一套体系。目前盛世投资信用等级共分四级，从<span style="color: #00f">最高的&nbsp;AAA&nbsp;级到最低的&nbsp;B&nbsp;级</span>。用户的信用等级越高，能得到的款额度越高，费用也越低。提高信用等级，可以增加出者对用户的信任度、并能以更低的成本成功款。</font></span></span></p><p><span style="font-size: 18px"><span style="font-family: simsun"><font size="4">等级积分获取规则如下：</font></span></span></p><ol><li><font size="4">通过邮箱认证，可获得会员信用等级积分&nbsp;&nbsp;5分；</font></li><li><font size="4">通过手机认证，可获得会员信用等级积分&nbsp;&nbsp;10分；</font></li><li><font size="4"><font size="4">通过实名认证，可获得会员信用等级积分&nbsp;&nbsp;10分；</font></font></li><li><font size="4"><font size="4"><font size="4">通过视频认证，可获得会员信用等级积分&nbsp;&nbsp;5分；</font></font></font></li><li><font size="4"><font size="4"><font size="4">通过现场认证，可获得会员信用等级积分&nbsp;&nbsp;10分；</font></font></font></li><li><font size="4"><font size="4"><font size="4">会员上传可信资料，每类资料审核通过后，分别增加会员信用等级积分&nbsp;&nbsp;10分；</font></font></font></li></ol><table style="width: 669px; height: 170px" border="1" align="center"><caption><font size="4"><font size="4"><span>会员信用等级积分规则</span></font></font></caption><tbody><tr><td style="text-align: center"><font size="4"><font size="4">&nbsp;信用等级</font></font></td><td style="text-align: center"><font size="4"><font size="4">&nbsp;<img style="margin: 0px; float: none" alt="" src="/UF/leveico/maque001.gif" /></font></font></td><td style="text-align: center"><font size="4"><font size="4">&nbsp;<img style="margin: 0px; float: none" alt="" src="/UF/leveico/maque002.gif" /></font></font></td><td style="text-align: center"><font size="4"><font size="4">&nbsp;<img style="margin: 0px; float: none" alt="" src="/UF/leveico/maque003.gif" /></font></font></td><td style="text-align: center">&nbsp;</td></tr><tr><td style="text-align: center"><font size="4"><font size="4">&nbsp;信用分数</font></font></td><td style="text-align: center"><font size="4"><font size="4">&nbsp;0-50分</font></font></td><td style="text-align: center"><font size="4"><font size="4">&nbsp;51-70分</font></font></td><td style="text-align: center"><font size="4"><font size="4">&nbsp;71-90分</font></font></td><td style="text-align: center"><font size="4"><font size="4">&nbsp;91分以上</font></font></td></tr></tbody></table><p><font size="4"><font size="4">&nbsp;</font></font></p><p>&nbsp;</p>', 0, 0, 322, 'xinyongdengji', 0, 1379990098, 1),
