(355, '福建中兰德担保有限公司', '', '', '', '<p>深圳中科智融资担保有限公司成立于1999年12月23日，注册资本7.57亿元人民币。深圳中科智是我国第一家民营担保公司，第一家经商务部审批的中外合资担保公司，亦是全国中小企业信用担保体系试点范围的担保机构。</p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; 股东背景：</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; 深圳中科智的股东为：北京中科智担保有限公司、上海中科智担保有限公司、RAND INTERNATLONAL（H.K）GROUP CO.LIMITED、AMERINVEST GROUP CORPORATION、ORIENWISE（SZ）LIMITED，上述公司存在交叉持股等情况，但最终股东为花旗集团、凯雷投资等国际风投机构。</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp;&nbsp;部分荣誉和资质：</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 12px"><span style="font-family: 宋体">2005年当选为全国十大最具影响力的中小企业信用担保机构；</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 12px"><span style="font-family: 宋体">2007年被认定为深圳市首批民营领军骨干企业；</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 12px"><span style="font-family: 宋体">2008年当选为中国担保500亿上榜机构；</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 12px"><span style="font-family: 宋体">2009年万亿担保规模上榜机构30强；</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 12px"><span style="font-family: 宋体">2010年全国担保机构三十强；</span></span></p><p><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 12px"><span style="font-family: 宋体">2011年3月30日获得广东省人民政府金融工作办公室颁发的《融</span></span><span style="font-size: 12px"><span style="font-family: 宋体">资性担保机构经营许可证》，是深圳市首批获得融资性担保经营许可证的十家担保公司之一；</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 12px"><span style="font-family: 宋体">2011年6月27日加入深圳市中小企业信用再担保中心；</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 12px"><span style="font-family: 宋体">合作银行及额度：</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 12px"><span style="font-family: 宋体">2012年3月获得国家开发银行15亿元授信额度。</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 12px"><span style="font-family: 宋体">2012年5月获得建设银行22亿元授信额度。</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 12px"><span style="font-family: 宋体">2012年8月获得国安村镇银行1亿元授信额度。</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; </span></span><span style="font-size: 12px"><span style="font-family: 宋体">2012年8月获得桂银村镇银行1亿元授信额度。</span></span></p><p><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; 深圳中科智业务立足于深圳市，辐射珠三角，为所在区域社会经济的发展做出了突出的贡献。截至2012年6月末，深圳中科智累计担保企业户数2703家，累计担保总额207亿元，在保余额为5亿元。</span></span></p><p>&nbsp;</p>', 10, 0, 354, 'fjzl', 0, 1370397680, 0),
(356, '上海中科智融资担保有限公司', '', '', '', '<p>&nbsp;上海中科智融资担保有限公司成立于2003年7月8日，是中国中科智担保集团股份有限公司旗下的子公司。2004年11月经股份制改造，由英属奥润维斯（诚思）有限公司协议并购。公司为外商独资企业，注册资本为美元5850万元。公司是完全按市场化运作模式经营的商业担保公司。公司致力于搭建上海中小企业融资平台，为中小企业融资、履约、发债等提供信用担保。公司成立近9年来，凭借不懈的市场开拓和卓越的风险管理，与上海多家银行保持着良好的合作关系，累计为近九百家中小企业提供了融资担保、履约担保等服务。已累计对外担保80多亿元，累计服务企业820户，服务国民数量1万5千多人。取得了一定的社会效益与经济效益，保持着很高的信用口碑。</p><p><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; 上海中科智担保有限公司是中国中科智担保旗下主营银行渠道商业担保业务的专业机构，与多家银行通力合作，为企业申请银行贷款提供最有效的担保。此外还提供履约、现金、商品、股权、票据等商业担保业务及中介服务，形成从资金流担保、物流担保到权益担保的完整业务链条，为交易双方提供一揽子融资及风险防范方案。</span></span></p><p><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; 公司与各大银行广泛合作，合作银行有：中国工商银行、北京银行、国家开发银行、福州市商业银行、中国银行、广发银行等。</span></span></p><p align="left"><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; 截止2012年7月31日融资担保在保余额32500万元，履约担保在保余额39415万元。</span></span><span style="font-size: 12px"><span style="font-family: 宋体">公司开业至2012年7月31日累计担保金额749152万元。</span></span><span style="font-size: 12px"><span style="font-family: 宋体">代偿率为：0.29%&nbsp;</span></span></p>', 9, 0, 354, 'shzk', 0, 1370397742, 0),
(357, '重庆中科智担保投资有限公司', '', '', '', '<p>重庆中科智担保投资有限公司成立于2007年5月，注册资金本11000万元，为深圳中科智担保投资有限公司的全资子公司。其主营业务为融资性担保业务、履约担保业务、诉讼保全担保业务，业务范围覆盖重庆及周边省市。</p><p><span style="font-size: 12px"><span style="font-family: 宋体">&nbsp;&nbsp;&nbsp; 进入重庆担保市场以来，秉承中科智担保一贯完善、严谨的风险操作风格，得到了重庆地方市场的认可。先后获得过“成绩突出的担保机构”、“成长型担保机构”称号。截止2012年6月底，重庆中科智累计服务企业约50家，累计担保金额约5亿元，在保余额为1亿多元。2011年年度代偿率为0.95%。</span></span></p><p>&nbsp;</p>', 8, 0, 354, 'cqzk', 0, 1370397824, 0),
(363, '投资等级规则说明', '', '', '', '<p><span style="font-size: 18px"><span style="font-family: simsun">本平台用户在平台通过投标、提前还款、评论都可以获得相应的积分，积分越多，等级也就越高。</span></span></p><p><span style="font-size: 18px">积分可在商城进行抽奖或兑换礼品。（</span><span style="font-size: 18px"><span style="color: rgb(51,51,51)"><span style="color: #00f">投资总积分</span>是指您在本平台获得和消费的所有积分，</span></span><span style="font-size: 18px"><span style="font-family: simsun; color: rgb(51,51,51)"><span style="color: #00f">活跃积分</span>是指您在本平台目前所剩余的可用积分）</span></span></p><p><span style="font-size: 18px"><span style="font-size: 18px"><span style="font-family: simsun"><span>积分获取渠道：&nbsp;</span></span></span></span></p><p style="font-family: 宋体, arial, helvetica, sans-serif; color: rgb(51,51,51)"><span style="font-size: 18px"><span style="font-size: 18px"><span style="font-family: simsun"><span>1、投资积分：每次投标都能获得相应积分，投标积分计算公式为：投资金额*天数/1000=投资积分（即：1000元/天）。<span style="color: rgb(0,0,255)">例如：投资天标1万，积分10000*1/1000=10分，一月标2万，积分20000*30/1000=600分。</span></span></span></span></span></p><p style="font-family: 宋体, arial, helvetica, sans-serif; color: rgb(51,51,51)"><span style="font-size: 18px"><span style="font-size: 18px"><span style="font-family: simsun"><span>2、提前还款积分：每次借款提前还款都能获得相应积分，还款积分计算公式为：借款金额*提前天数/1000。<span style="color: rgb(0,0,255)">例如：借款1万，提前5天还款，积分10000*5/1000=50分。</span></span></span></span></span></p><p><span style="font-size: 18px"><span style="font-size: 18px"><span style="font-family: simsun">3、生日特权：凡在生日当天投标的用户更可享所投标双倍积分。</span></span></span></p><p><span style="font-size: 18px"><span style="color: rgb(0,0,255)">等级规则图如下：</span></span></p><table style="border-bottom: medium none; border-left: medium none; width: 600px; border-collapse: collapse; margin-left: 6.75pt; border-top: medium none; margin-right: 6.75pt; border-right: medium none" border="1" cellspacing="0" cellpadding="0" width="271" align="left"><tbody><tr style="height: 26.65pt"><td style="border-bottom: windowtext 2.5pt double; border-left: windowtext 2.5pt double; padding-bottom: 0cm; padding-left: 5.4pt; width: 59.4pt; padding-right: 5.4pt; height: 26.65pt; border-top: windowtext 2.5pt double; border-right: windowtext 2.5pt double; padding-top: 0cm" width="79"><p style="text-align: center" align="center"><span style="font-size: 18px"><span style="font-family: 宋体">等级名称</span></span></p></td><td style="border-bottom: windowtext 2.5pt double; border-left: medium none; padding-bottom: 0cm; padding-left: 5.4pt; width: 81pt; padding-right: 5.4pt; height: 26.65pt; border-top: windowtext 2.5pt double; border-right: windowtext 2.5pt double; padding-top: 0cm" width="108"><p style="text-align: center" align="center"><span style="font-size: 18px"><span style="font-family: 宋体">等级分数</span></span></p></td><td style="border-bottom: windowtext 2.5pt double; border-left: medium none; padding-bottom: 0cm; padding-left: 5.4pt; width: 63pt; padding-right: 5.4pt; height: 26.65pt; border-top: windowtext 2.5pt double; border-right: windowtext 2.5pt double; padding-top: 0cm" width="84"><p style="text-align: center" align="center"><span style="font-size: 18px"><span style="font-family: 宋体">图标显示</span></span></p></td></tr><tr style="height: 27.95pt"><td style="border-bottom: windowtext 2.5pt double; border-left: windowtext 2.5pt double; padding-bottom: 0cm; padding-left: 5.4pt; width: 59.4pt; padding-right: 5.4pt; height: 27.95pt; border-top: medium none; border-right: windowtext 2.5pt double; padding-top: 0cm" width="79"><p style="text-align: center" align="center"><span style="font-size: 18px">1<span style="font-family: 宋体">级</span></span></p></td><td style="border-bottom: windowtext 2.5pt double; border-left: medium none; padding-bottom: 0cm; padding-left: 5.4pt; width: 81pt; padding-right: 5.4pt; height: 27.95pt; border-top: medium none; border-right: windowtext 2.5pt double; padding-top: 0cm" width="108"><p style="text-align: center" align="center"><span style="font-size: 18px">0-499</span></p></td><td style="border-bottom: windowtext 2.5pt dou