(20, 'textarea', '绿麻雀系统,绿麻雀网站,p2p网贷系统', '网站关键词', '在首页的keywords中显示', 118, 'web_keywords', 1),
(21, 'textarea', '绿麻雀系统  超级版演示网站最好用的p2p网贷系统作，集安全，稳定，绿麻雀网站打造实用为一体的p2p网贷系统！', '网站描述', '在网站首页的描述中显示', 117, 'web_descript', 1),
(103, 'input', '1', ' 是否开启手动手机验证', ' 0代表不开启，则由系统自动向会员发送手机验证码；1代表开启，表示由管理员在后台手动审核会员的手机验证', 0, 'is_manual', 1),
(102, 'input', '23:59:59', ' 流转标自动还款时钟设置', '23:59:59 表示该流转标将会在还款当天的23:59:59由系统自动执行还款操作，填写请遵循hh:mm:ss格式', 0, 'auto_back_time ', 1),
(19, 'input', '绿麻雀系统', '网站名称', '出现在每个页面的title后面', 120, 'web_name', 1),
(27, 'input', '绿麻雀系统  超级版演示网站最好用的p2p网贷系统', '首页title', '首页标题', 119, 'index_title', 1),
(56, 'textarea', 'All Rights Reserved.绿麻雀系统最好的p2p网贷系统 <br>菏泽市牡丹区伟德电子科技有限公司 版权所有 鲁ICP备13073066号<br>公司地址：山东省菏泽市牡丹区凤凰城C栋727室  网址：www.lvmaque.com 联系电话：18769071212', '网站底部', '网站底部的版权和联系信息', 116, 'bottom', 1),
(71, 'input', '0', 'VIP费用', 'VIP费用(每年)', 0, 'fee_vip', 1),
(72, 'input', '1|1', '逾期罚息', '逾期后罚息的计算,(3|8)表示逾期3天开始算罚息,每天千分之8', 110, 'fee_expired', 1),
(73, 'input', '10|10', '催收费', '逾期以后的催收费,(30|2)表示逾期30天以后开始算每天千分之2的催收费', 111, 'fee_call', 1),
(95, 'input', '5000-19999|2|20000-49999|2.5|50000|3', ' 线下充值奖励', ' 填入5000-10000|1|10001-30000|1.5|30001|2 表示，线下充值金额在5000至10000以内的奖励千分之1，在10000至30000以内的奖励千分之1.5，大于30000时奖励千分之2', 0, 'offline_reward', 1),
(64, 'input', '5-10000|0-0|5-100', '提现手续费', '以10-50|0-0|3-30的形式填入，数字从左到右依次表示超出回款资金总额的每笔收取总额的千分之10作为手续费,最大手续费上限50元;提现在回款总金额内的每笔收费千分之0元，手续费上限0元;单日单笔提现上限3万,单日提现资金上限30万', 10, 'fee_tqtx', 1),
(66, 'input', '0.05|24', '发标时的年化利率', '以10|24的形式填入，表示年化利率最小10%,最大24%', 1, 'rate_lixi', 1),
(69, 'input', '10', '投资者成交管理费', '10表示收取投资者所赚利息的10%', 113, 'fee_invest_manage', 1),
(70, 'input', '1|30', '借款期限(按天)', '以1|24的形式填入，以天为单位，表示按天借款时最少借款时间为1天，最多24天', 1, 'borrow_duration_day', 1),
(67, 'input', '1|12', '借款期限', '以1|24的形式填入，以月为单位，表示最小借款时间为1个月，最大24个月', 1, 'borrow_duration', 1),
(74, 'input', '0', '借款保证金', '借款者借款成功后冻结的保证金,填10表示借款总金额的10%', 114, 'money_deposit', 1),
(75, 'input', '0', '视频认证费用', '', 0, 'fee_video', 1),
(76, 'input', '0', '现场认证费用', '', 0, 'fee_face', 1),
(77, 'input', '0', '实名认证费用', '', 0, 'fee_idcard', 1),
(78, 'input', '0', 'VIP默认额度', '', 0, 'limit_vip', 1),
(79, 'input', '0.1|5|0.5|1', '借款者管理费', '以0.1|1|0.2|4的形式填入，表示按天时每天收取借款总额0.1%的管理费，按月时在借款期限小于等于4个月时收取借款总额1%的管理费，借款期限大于4个月时(收获取借款总额1%的管理费+超过4个月的时间里每月收取借款总额0.2%的管理费)', 115, 'fee_borrow_manage', 1),
(90, 'input', '0', '客服提成', '客服提成比例,填2表示千分之二', 0, 'customer_rate', 0),
(91, 'input', '-3|-10|100', '非正常还款积分规则', '填入-3|-10|100表示,迟还|逾期还款|比率  公式：扣减信用积分=需还金额/比率*（迟还|逾期）例如：借款1000元，迟还了10天，即1000/100*(-3)= -30分，表示扣减了30分信用积分', 0, 'credit_borrow', 1),
(92, 'input', '1', '给投资人的积分', '表示每1000元借出1天加1个投资积分，投标积分计算公式为：投资金额*天数/1000=投资积分，例如：投资天标1万，积分10000*1/1000=10分，一月标2万，积分20000*30/1000=600分。', 0, 'invest_integral', 1),
(93, 'input', '1', '邀请下线奖励', '填入整数，如2表示千分之二,即你所邀请的下线每投标成功一次，您可获得千分之二的奖励', 2, 'award_invest', 1),
(94, 'input', '2013-01-04|2013-12-30', '排行榜期限', '某时间段内的月投标排名，前面时间为开始时间，后者为结束时间', 2, 'rankDate', 1),
(96, 'input', '23:59:59', ' 到期还款时钟设置', ' 23:59:59 表示借款人必须在还款到期当天的23:59:59之前进行还款，否则该标变为逾期。填写请遵照hh:mm:ss格式', 0, 'back_time', 1),
(97, 'input', '0', ' 银行卡修改开关', ' 1表示可以修改，0表示不可以修改', 0, 'edit_bank', 1),
(98, 'input', '1|1|2', ' 回款投标自动奖励', ' 以1|1.5|2的形式填入，表示回款续投一月标奖励1‰回款续投二月标奖励1.5‰ 回款续投三月标及以上奖励2‰，如果投标金额大于回款资金池金额，有效续投奖励以回款金额资金池总额为标准，否则以投标金额为准', 0, 'today_reward', 1),
(101, 'input', '0', '资金空置利率', ' 填整数，如1表示 1/10000,填0表示不启用', 0, 'free_rate ', 1),
(100, 'input', 'lvmaque', ' 后台登陆路径', ' 可修改后台登陆路径,格式为任意字母组合。例如：如填写admin，访问路径即为：【http://www.您的域名.com/admin 】                      ', 0, 'admin_url', 1);
